(407, 407, '2022-10-15 17:12:54', '2022-10-15 17:12:54', 'MTZ5FunrcDY', 'Mayku FormBox - a desktop vacuum former that puts the power of making in your hands', 'The Mayku‚ÄàFormBox puts the power of making in your hands. Powered by any vacuum cleaner, it works with a world of materials and helps you to make your ideas real. Whether you‚Äôre crafting by hand or partnering with your 3D printer, the FormBox is your very own desktop production line.\n\nReady to buy a FormBox? Reserve yours here ‚û°Ô∏èhttps://www.mayku.me/pages/reserve-a-formbox?utm_source=YouTube&utm_medium=Video&utm_content=Meet%20the%20FormBox\n\nBenefits and Features:\n--Prototype‚Äàat‚ÄàSpeed\nRapidly create product prototypes with high-quality finishes to show your clients your vision, in real life.\n\n--Choose‚ÄàFrom‚Äàa‚ÄàWorld‚Äàof‚ÄàMaterials\nBring your ideas into the real world in hundreds of different ways by choosing from a huge range of sheet materials. Make the way you want to.\n\n--Turbocharge‚Äàyour‚Äà3D‚Äàprinter\nPioneer the future of desktop manufacturing. Partner the FormBox with your 3D printer to create professional batches of products from your studio.\n\n--Small‚ÄàFootprint,‚ÄàBig‚ÄàPower\nThe FormBox gives you advanced manufacturing technology in a space no larger than a laptop, giving you and your business the space you need to grow.\n\n--Precision‚ÄàControl\nTake control over your making with precise time and temperature settings - for consistent mold making, every time.\n\n--Making‚ÄàMade‚ÄàSimple\nThe FormBox has been meticulously designed to make a complex process as simple as possible, leaving you to focus on your ideas. It‚Äôs making, made simple.\n\n--Vacuum‚ÄàPower\nPlug any vacuum cleaner into the FormBox and use its suction to kickstart your own desktop factory.\n\n--Auto‚ÄàSwitch\nThe FormBox has an internal auto-vacuum system, simply plug your vacuum cleaner into the port on the back and the suction will start exactly when you need it - magical making.\n\nWant to know more about the FormBox and how it can improve your workflow? Click here to Speak To A Specialist ‚û°Ô∏èhttps://www.mayku.me/pages/specialist?utm_source=YouTube&utm_medium=Video&utm_content=Meet%20the%20FormBox\n\nAsk, share and learn with the Mayku Forum! üöÄ https://forum.mayku.me/\n\n\nCome and join us on social media:\nüõ† Facebook: https://www.facebook.com/TeamMayku\nüõ† Twitter: https://twitter.com/TeamMayku\nüõ† Instagram: https://www.instagram.com/teammayku/\nüõ† LinkedIn: https://www.linkedin.com/company/mayku', '00:00:00', 'MTZ5FunrcDY', 'video/youtube', 'https://i.ytimg.com/vi/MTZ5FunrcDY/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-08-06 06:27:13'),
(408, 408, '2022-10-15 17:12:54', '2022-10-15 17:12:54', 'oWRV4Bbq0Ic', 'ANET A8 Plus Assembly Guide, Setup, Review, Easy Upgrades (STLs Included). Is This Printer Worth It?', 'The ANET A8 Plus is an entry level printer and its smaller predecessor, the A8, had been based on the Prusa i3 machines. The A8 plus adds volume with a build size of 300mm x 300mm x 350mm which is quite generous considering the low cost of this machine. \n\nThe frame is an all metal extrusion construction making it very stable and stiff. It comes with a direct drive extruder, heated print bed, and simple LCD screen. \n\nOverall this kit is fairly simple to assemble, however, it will take you some time to do. Pay close attention to the details while assembling to get the most of out of your printer later. Also, keep a close watch on the quality of parts as you are likely to get some sub-par quality parts in a kit with a price this low. Don\'t expect a turn key printer out of the box, and do expect to have to get creative at times.\n\nMy biggest complaints about this machine is the lack of strain relief, no wire management, and lack of grommets for wires passing through metal enclosures. The heated bed connector and cable is also inadequate for the application. I would be happy to pay more for a printer that addresses these issues. I have tried to rectify some of these problems with my own design files that you can find here:\n\n‚ñ∫ https://www.thingiverse.com/thing:4929130\n\nThat being said, this printer prints surprisingly well if you take good care in setting it up properly. The direct drive extruder meters filament well, and small details come out sharp in fine prints. The simplicity of the machine makes it a good candidate for fun and simple future upgrades and would be a good platform to build your knowledge of 3D printing. \n\nI did not include slicer settings in this video but you should be able to find slicer profiles for A8 machines online quite easily. It is a very popular platform. You can also start with other generic printer profiles from other popular machines like the Creality machines. Select a Creality machine with a direct drive extruder and get that slicer profile... adjust the printer dimensions and you should have something that works nicely.\n\nI would recommend this machine for beginners and advanced users alike. In either case you would be looking for a hobby printer and a project, not a ready to use tool. If you are looking for a more straightforward experience in getting printing, I would suggest the ANET ET5X as it is much easier to assemble and the print quality is also good. The overall machine is more well thought out than the A8 and is only slightly more expensive. \n\nANET A8 Plus. As an Amazon Associate I earn from qualifying purchases (at no extra cost to you):\nhttps://amzn.to/3PP71Bk\n\nIf you have any questions about the assembly, the printer, etc, please post your comments in the comment section down below. I try and get back to everyone. \n\nThanks for watching!\n\n#3DPRINTER #DIY #MAKER\n\n\n****************************************************************\n\nIf you enjoy and have benefited from my content and are feeling generous I would love your support! You can \"buy me a coffee\" here:\n\n‚ñ∫ https://www.paypal.com/donate/?hosted_button_id=V2T6MEFUGP73Y\n\nBy supporting my channel you are encouraging me to continue with this time consuming endeavor. A lot of time goes into design work, building my projects, filming the videos, editing the videos, etc. Plus it all costs money! Your generosity goes a long way in helping me bring you better content as often as I can!\n\nFollow me on Instagram!\n\n‚ñ∫ https://www.instagram.com/embracemaking/\n\nIf you liked this video, perhaps you will also enjoy some channels that I personally find inspiring and interesting...\n\nDIY and MAKER:\n\n‚ñ∫ The Hacksmith\nhttps://www.youtube.com/channel/UCjgpFI5dU-D1-kh9H1muoxQ\n\n‚ñ∫ Adam Savage Tested\nhttps://www.youtube.com/channel/UCiDJtJKMICpb9B1qf7qjEOA\n\n‚ñ∫ Thomas Sanladerer\nhttps://www.youtube.com/user/ThomasSanladerer', '00:00:00', 'oWRV4Bbq0Ic', 'video/youtube', 'https://i.ytimg.com/vi/oWRV4Bbq0Ic/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-10-05 08:59:05'),
