om/offers/SZFctCkU/checkout\n----------------------------------------------------------------------------\nCourses: https://www.aosnote.com/store\nWebsite: https://www.aosnote.com/\n----------------------------------------------------------------------------\nThank youüôè. If you find this video valuable, please don\'t forget to like, subscribe, and share to support this channel üëç\n\n0:00 - Introduction\n0:27 - Create a keypair\n1:51 - Open PowerShell\n3:37 - Put the keypair in the user\'s folder\n4:12 - Launch an Ec2 Instance\n6:33 - SSH into instance using PowerShell', '00:00:00', 'sJ3SJ-66-F8', 'video/youtube', 'https://i.ytimg.com/vi/sJ3SJ-66-F8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-10-18 12:30:05'),
