(439, 439, '2022-10-20 01:30:45', '2022-10-20 01:30:45', 'S6pdx0yLe4s', 'Impressora 3D Barata Lista De Materiais', 'Mais um super projeto est√° come√ßando hoje, √© a nossa primeira impressora 3D do canal nesse v√≠deo mostro a voc√™s todas as pe√ßas necess√°rias para a montagem, da impressora 3D incluindo todas as pe√ßas para a montagem do frame da mesmo n√£o se gostou deixe seu like e continue seguindo canal para mais v√≠deos sobre impressora.\n\nLink da desenho: http://bit.ly/2K0GjEZ\nLink da planilha com a lista de pe√ßas: https://goo.gl/Xn8pA8', '00:00:00', 'S6pdx0yLe4s', 'video/youtube', 'https://i.ytimg.com/vi/S6pdx0yLe4s/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCjoAeGYdt4nFPu_SHoT3P7A', '2019-03-31 04:49:15'),
