(449, 449, '2022-10-20 02:08:24', '2022-10-20 02:08:24', 'F7KzJ7e6EAc', 'Hist√≥ria do PHP - Curso PHP Iniciante #01 - Gustavo Guanabara', 'A Linguagem PHP come√ßou em 1994, quando Rasmus Lerdorf resolveu criar um gerenciador de visitas para o seu site. Sua primeira cria√ß√£o n√£o era uma linguagem, e sim uma ferramenta. Batizada de Personal Home Page, usava comandos simples inspirados da linguagem PERL. A segunda vers√£o da ferramenta j√° permitia a manipula√ß√£o de formul√°rios e pequenos livros de visita: o Personal Home Page/ Forms Interpreter, ou PHP/FI. Essa vers√£o ficou bastante popular e come√ßou a se espalhar em 1995.\n\nCom o objetivo de fazer sua ferramenta crescer, Rasmus liberou o acesso ao c√≥digo-fonte da CGI em 1996, o que despertou o interesse de diversos programadores, entre eles os israelenses Zeev Suraski e Andi Gutmans. Esses dois reescreveram o n√∫cleo da ferramenta e a transformou em uma Linguagem de Scripts, nos moldes em que n√≥s temos o PHP atualmente.\n\nA partir de 1998, o PHP j√° come√ßava a se destacar como uma das linguagens mais utilizadas na Internet. Foi nessa √©poca que a linguagem foi rebatizada e passou a se chamar PHP: Hypertext Preprocessor e chegou √† sua vers√£o 3.0, com muitas funcionalidades interessantes.\n\nEm 2000, a quarta vers√£o do PHP surge para eliminar a maioria dos erros e falhas de seguran√ßa encontrados pela comunidade. Enquanto isso, Zeev e Andi resolveram reescrever todo o n√∫cleo da linguagem, abandonando quase que completamente o projeto original de Rasmus Lerdorf.\n\nQuatro anos depois, em 2004, surge o PHP5 que ficou mundialmente conhecido e atualmente conta com 32 vers√µes internas, com mais de 1000 corre√ß√µes de falhas de seguran√ßa.\n\nAt√© hoje (Ago/2014) se discute bastante sobre a vers√£o 6.0 do PHP, mas o m√°ximo que foi atingido at√© o momento da grava√ß√£o desse curso foi a vers√£o 5.6.\n\nAula do Curso de PHP para Iniciantes criado pelo professor Gustavo Guanabara para o portal CursoemVideo.com.\n\nCurso em V√≠deo\nSite: http://www.cursoemvideo.com\nYouTube: http://www.youtube.com/cursosemvideo\nFacebook: http://www.facebook.com/cursosemvideo\nTwitter: http://twitter.com/cursosemvideo\nGoogle+: http://plus.google.com/112666558837414979080\n\nPatroc√≠nio\nHOSTNET: http://www.hostnet.com.br\nT1SITE: http://www.t1site.com.br', '00:00:00', 'F7KzJ7e6EAc', 'video/youtube', 'https://i.ytimg.com/vi/F7KzJ7e6EAc/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCrWvhVmt0Qac3HgsjQK62FQ', '2014-08-04 04:27:35'),
(450, 450, '2022-10-20 02:08:24', '2022-10-20 02:08:24', 'Eup6utTPe2U', 'Como funciona o PHP - Curso PHP Iniciante #02 - Gustavo Guanabara', 'Como funciona o PHP? Como transformar meu computador em um servidor? Como funciona tecnologias server-side? Qual √© a diferen√ßa entre tecnologias PHP, ASP, JSP e etc? A segunda aula do seu Curso de PHP do Curso em V√≠deo vai responder a essas e muitas outras perguntas que normalmente s√£o feitas por quem est√° iniciando seus estudos em PHP.\n\nA infra-estrutura da Internet √© baseada no modelo cliente x servidor. A Internet interliga clientes a servidores que possuem arquivos e fornecem c√≥pias desses documentos.\n\nNas tecnologias client-side, a fun√ß√£o do servidor √© apenas fornecer arquivos que o cliente solicita. Quem vai ter mais trabalho de processamento √© o lado do cliente (client-side) que ter√° seu navegador trabalhando para interpretar os c√≥digos e arquivos enviados pelo server. S√£o exemplos de tecnologias client-side: HTML, CSS, JavaScript e Flash.\n\nJ√° nas tecnologias server-side, o servidor vai assumir a maior parte do trabalho, j√° que existe a interpreta√ß√£o de c√≥digos do lado do servidor (server-side), que no caso do PHP s√£o chamados scripts de seridor.\n\nPara o PHP funcionar corretamente, o servidor precisa ter o Apache, que √© um program server, um interpretador PHP (engine) e suporte a um ou mais tipos de banco de dados (geralmente MySQL).\n\nPara transformar seu computador em um servidor com suporte PHP, voc√™ precisa de um sistema AMP (Apache + MySQL + PHP). Para usar PHP no Windows, instalamos um sistema WAMP. Para usar PHP no Linux, instalamos um sistema LAMP. Para usar PHP no Mac, instalamos um sistema MAMP.\n\nAula do Curso de PHP para Iniciantes criado pelo professor Gustavo Guanabara para o portal CursoemVideo.com.\n\nCurso em V√≠deo\nSite: http://www.cursoemvideo.com\nYouTube: http://www.youtube.com/cursosemvideo\nFacebook: http://www.facebook.com/cursosemvideo\nTwitter: http://twitter.com/cursosemvideo\nGoogle+: http://plus.google.com/112666558837414979080\n\nPatroc√≠nio\nHOSTNET: http://www.hostnet.com.br\nT1SITE: http://www.t1site.com.br', '00:00:00', 'Eup6utTPe2U', 'video/youtube', 'https://i.ytimg.com/vi/Eup6utTPe2U/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCrWvhVmt0Qac3HgsjQK62FQ', '2014-08-06 04:25:20'),
(451, 451, '2022-10-20 02:08:24', '2022-10-20 02:08:24', '3ltZBbKACh4', 'Como Instalar o PHP - Curso de PHP Iniciante #03 - Gustavo Guanabara', 'Nessa aula do Curso Gr√°tis de PHP para Iniciantes voc√™ vai aprender como instalar um servidor PHP no seu computador e vai ver como criar o seu primeiro exemplo de c√≥digo PHP: o \"Ol√°, Mundo!\".\n\n√â poss√≠vel instalar o PHP no seu PC, bem como todas as ferramentas necess√°rias para o desenvolvimento na linguagem, como o Apache, MySQL, PHPMyAdmin, interpretadores e etc.\n\nVoc√™ pode fazer o download das ferramentas usadas no Curso de PHP para Iniciantes acessando o endere√ßo abaixo:\n\nhttp://cursoemvideo.com/cursos/download-gratis-curso-php/\n\nEm primeiro lugar, voc√™ deve ter instalado um servidor AMP de acordo com o Sistema Operacional utilizado no seu computador.\n\nUm WAMP para quem usa Windows (recomendamos o EasyPHP)\nUm LAMP para quem usa Linux\nUm MAMP para quem usa MacOS\n\nAl√©m disso ser√° necess√°rio instalar um editor de c√≥digo para fazer a cria√ß√£o e modifica√ß√£o dos seus documentos PHP. Existem v√°rias op√ß√µes no mercado, mas n√≥s indicamos o PHPStorm da JetBrains, que pode ser baixado gratuitamente a partir do link acima.\n\nNo EasyPHP, enquanto o programa estiver aberto os servi√ßos do Apache, interpretador PHP e do MySQL estar√£o ativos. Para encerrar todos esses processos, basta fechar a janela do aplicativo e tudo ser√° suspenso.\n\nClicando com o bot√£o direito do mouse sobre o √≠cone do EasyPHP que fica ao lado do rel√≥gio, voc√™ pode escolher \"Local Web\" ou \"Local Host\" (tecla de atalho: F7) para ter acesso ao seu servidor local e poder executar seus scripts.\n\nAo criar seus scripts, voc√™ deve salv√°-los em um local espec√≠fico. A localiza√ß√£o dessa pasta vai depender da vers√£o do EasyPHP que foi instalada. \n\nPara vers√µes mais recentes: C:\\Arquivos de Programas\\EasyPHP\\data\\localweb\\\nPara vers√µes mais antigas: C:\\Arquivos de Programas\\EasyPHP\\www\\\n\nNo PHPStorm, crie um novo projeto e direcione para uma das pastas indicadas acima, dependendo da vers√£o escolhida do seu servidor. A grande vantagem do uso do PHPStorm, √© que ele complementa seu c√≥digo automaticamente e auxilia bastante na cria√ß√£o de grandes scripts.\n\nAs tags HTML se diferenciam da super-tag PHP pela sua estrutura.\n\nOs comandos echo ou print servem para escrever algo na tela. Basta utilizar o comando abaixo dentro da tag PHP:\n\necho \"Ol√°, Mundo\";\n\nPara acessar seu servidor local, salve o arquivo PHP na pasta do seu servidor (precisa ser nesse local espec√≠fico) e acessar seu servidor local, que pode ser http://127.0.0.1, http://localhost ou algum outro ligeiramente diferente. Para evitar problemas, use o atalho do bot√£o direito do mouse sobre o √≠cone do EasyPHP ao lado do rel√≥gio do Windows e escolhendo Local Host.\n\nVoc√™ tamb√©m pode integrar o PHP ao HTML, CSS ou JavaScript sem problema algum. Durante a aula ser√° demonstrado um exemplo desse tipo de situa√ß√£o.\n\nO PHP √© uma linguagem completa. Por isso, a comunidade sempre colabora para a cria√ß√£o da documenta√ß√£o, inclusive j√° traduzida para Portugu√™s-BR.\n\nPara ter acesso √† documenta√ß√£o completa do PHP, pode acessar nossa √°rea de downloads para ver a documenta√ß√£o online ou baixar a vers√£o offline da ajuda.\n\nhttp://cursoemvideo.com/cursos/download-gratis-curso-php/\n\nA partir de agora, seu computador √© um servidor web e voc√™ j√° pode come√ßar a criar seus scripts PHP :)\n\nAula do Curso de PHP criado pelo professor Gustavo Guanabara para o portal CursoemVideo.com.\n\nCurso em V√≠deo\nSite: http://www.cursoemvideo.com\nYouTube: http://www.youtube.com/cursosemvideo\nFacebook: http://www.facebook.com/cursosemvideo\nTwitter: http://twitter.com/cursosemvideo\nGoogle+: http://plus.google.com/112666558837414979080\n\nPatroc√≠nio\nHOSTNET: http://www.hostnet.com.br\nT1Site: http://www.t1site.com.br', '00:00:00', '3ltZBbKACh4', 'video/youtube', 'https://i.ytimg.com/vi/3ltZBbKACh4/mq