(454, 454, '2022-10-20 02:08:24', '2022-10-20 02:08:24', 'fCZdbl9-qkw', 'Operadores Aritm√©ticos - Curso PHP Iniciante #05 - Gustavo Guanabara', 'Como fazer contas no PHP? Como realizar somas, multiplica√ß√µes e mais? Exponencia√ß√µes em PHP? Raiz quadrada em PHP?\n\nOs operadores aritm√©ticos do PHP s√£o:\n\n+  √© o operador de adi√ß√£o\n-  √© o operador de subtra√ß√£o\n*  √© o operador de multiplica√ß√£o\n/  √© o operador de divis√£o Real\n%  √© o operador de m√≥dulo (resto da divis√£o)\n\nO c√≥digo a seguir, vai somar dois n√∫meros:\n\n$n1 = 3;\n$n2 = 2;\n$s = $n1 + $n2;\necho ‚ÄúA soma entre $n1 e $n2 √© igual a $s‚Äù;\n\nO c√≥digo acima vai mostrar na tela a mensagem\n\n A soma entre 3 e 2 √© igual a 5\n\nOutra coisa importante a saber √© a ordem de preced√™ncia de operadores aritm√©ticos em PHP. Sempre em uma express√£o, os operadores que ser√£o executados s√£o, na ordem:\n\nEm primeiro lugar, par√™nteses ( )\nEm segundo lugar, operadores de multiplica√ß√£o, divis√£o e m√≥dulo * / %\nEm seguida, as adi√ß√µes e subtra√ß√µes + -\nPor exemplo, considerando o c√≥digo a seguir:\n\n$media = $nota1 + $nota2 / 2;\n\nA m√©dia ser√° calculada de maneira errada, j√° que segundo a ordem de preced√™ncia, a divis√£o ser√° feita antes. O correto seria escrever\n\n$media = ($nota1 + $nota2) / 2; \n\nNote que o uso dos par√™nteses muda bastante as coisas.\n\nObtendo valores da URL com PHP\n\nVamos analisar a URL abaixo:\n\nhttp://localhost/aula05/operadores.php?a=3&b=2\n\nNo link acima, o arquivo operadores.php est√° sendo chamado dentro da pasta aula05 do servidor local. Na linha, ser√£o passados dois valores: a valendo 3 e b valendo 2.\n\nPara pegar esses valores no script PHP, use o c√≥digo\n\n$valor1 = $_GET[\"a\"];\n$valor2 = $_GET[\"b\"]; \n\nNo c√≥digo acima, o par√¢metro a (3) passado pela URL ser√° armazenado na vari√°vel $valor1. De maneira similar, a vari√°vel $valor2 vai conter o valor do par√¢metro b (2).\n\nObs: use sempre $_GET com todas as letras mai√∫sculas.\n\nFun√ß√µes Matem√°ticas em PHP\n\nabs() : Retorna o valor absoluto de um n√∫mero. Ex: abs(-5) = 5\npow() : Calcula uma pot√™ncia. Ex: pow(3,2) = 32 = 9\nsqrt() : Calcula a raiz quadrada de um n√∫mero. Ex: sqrt(25) = 5\nround() : Arredonda valores. Ex: round(3.8) = 4\nintval() : Trunca um n√∫mero. Retorna a parte inteira de um valor. Ex: abs(8.7) = 8\nnumber_format() : Formata um n√∫mero Real. Ex: number_format(3258.754, 2, \",\", \".\") = 3.258. 75.\n\nObs: Ainda existem os m√©todos ceil() e floor() para arredondamentos para cima e para baixo, respectivamente. A fun√ß√£o round() vai usar as regras de arredondamento.\n\nAula do Curso de PHP criado pelo professor Gustavo Guanabara para o portal CursoemVideo.com.\n\nCurso em V√≠deo\nSite: http://www.cursoemvideo.com\nYouTube: http://www.youtube.com/cursosemvideo\nFacebook: http://www.facebook.com/cursosemvideo\nTwitter: http://twitter.com/cursosemvideo\nGoogle+: http://plus.google.com/112666558837414979080\n\nPatroc√≠nio\nHOSTNET: http://www.hostnet.com.br\nT1Site: http://www.t1site.com.br', '00:00:00', 'fCZdbl9-qkw', 'video/youtube', 'https://i.ytimg.com/vi/fCZdbl9-qkw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCrWvhVmt0Qac3HgsjQK62FQ', '2014-09-01 03:10:57'),
(455, 455, '2022-10-20 02:08:24', '2022-10-20 02:08:24', 'NuBt0B_GeEo', 'Operadores de Atribui√ß√£o - Curso PHP Iniciante #06 - Gustavo Guanabara', 'Uma atribui√ß√£o acontece quando queremos colocar algum valor dentro de uma vari√°vel, seja ele um n√∫mero ou string est√°tica, o resultado de uma express√£o, o retorno de uma fun√ß√£o ou o conte√∫do de outra vari√°vel.\n\n== Operadores de Atribui√ß√£o do PHP\n\nOs operadores de atribui√ß√£o do PHP s√£o += -= *= /= %= e .=\n\nVejamos alguns exemplos:\n\n$c = $c + 5;      $c += 5;\n$c = $c - $a;     $c -= $a;\n$c = $c + 1;      $c += 1;\n\nNa √∫ltima linha da tabela acima, voc√™ verifica a adi√ß√£o de apenas uma unidade na vari√°vel. Nesses casos, podemos usar os operadores de incremento.\n\n== Operadores de Incremento ou Decremento\n\n$c = $c + 1;     $c += 1;    $c++;\n\nQualquer uma das formas acima √© v√°lida. De maneira similar, temos:\n\n$c = $c - 1;    $c -= 1;    $c--;\n\nA forma de utilizar o operador de incremento/ decremento faz toda diferen√ßa se ele aparece antes ou depois da vari√°vel. Assim, \n\n$c ++    $c--\n\nv√£o apresentar resultados diferentes de acordo com a situa√ß√£o. Durante a aula, vai ser explicado melhor como utilizar pr√©-incremento, p√≥s-incremento, pr√©-decremento e p√≥s-decremento em PHP.\n\n== Coment√°rios em PHP\n\nExistem tr√™s tipos de coment√°rios em PHP. Os coment√°rios inline // e # transformam tudo o que est√° ap√≥s o(s) s√≠mbolo(s) ser√° considerado coment√°rio.\n\nExiste tamb√©m o coment√°rio multiline, que vai criar coment√°rios que ocupem v√°rias linhas:\n\n?php\n    /* Esse coment√°rio vai ocupar\n       v√°rias linhas do seu c√≥digo\n       e todas ser√£o ignoradas */\n    $a += 1; // Esse √© um coment√°rio de uma linha\n   $b ++; # Esse aqui tamb√©m √©\n?\n\n== Vari√°veis Referenciadas\n\nColocar um caractere & na frente de uma vari√°vel vai criar um ponteiro em PHP. Ela n√£o ser√° uma vari√°vel de fato, mas ser√° uma refer√™ncia √† vari√°vel original. Considere o c√≥digo:\n\n?php\n $x = 3;\n        $y = $x;\n        $z = &$x;\n?\n\nA vari√°vel $x vai receber 3. A vari√°vel $y vai receber o valor que est√° dentro da vari√°vel $x. A vari√°vel $z vai ser uma liga√ß√£o com a vari√°vel $x. Mais tarde, qualquer modifica√ß√£o em $y n√£o vai alterar o valor de $x. Por√©m, se mudarmos o valor de $z, o valor de $x ser√° afetado, j√° que existe uma rela√ß√£o entre as duas.\n\n== Vari√°veis de Vari√°veis (vari√°veis variantes)\n\nColocar um segundo $ na frente de uma vari√°vel tamb√©m possui um efeito bem peculiar. Ele vai criar uma vari√°vel dinamicamente, dependendo do conte√∫do da vari√°vel original. Essas s√£o as vari√°veis de vari√°veis em PHP.\n\n?php\n $nome = ‚Äúgustavo‚Äù;\n $$nome = ‚Äúprofessor‚Äù;\n?\n\nCom essas linhas, teremos uma vari√°vel $nome, como o conte√∫do ‚Äúgustavo‚Äù e a linha de baixo vai criar uma vari√°vel $gustavo, com o conte√∫do ‚Äúprofessor‚Äù.\n\nVeja a aula em v√≠deo e tire todas as suas d√∫vidas sobre esses conte√∫dos sobre atribui√ß√£o de valores em PHP.\n\nAula do Curso de PHP para Iniciantes criado pelo professor Gustavo Guanabara para o portal CursoemVideo.com.\n\nCurso em V√≠deo\nSite: http://www.cursoemvideo.com\nYouTube: http://www.youtube.com/cursosemvideo\nFacebook: http://www.facebook.com/cursosemvideo\nTwitter: http://twitter.com/cursosemvideo\nGoogle+: http://plus.google.com/112666558837414979080\n\nPatroc√≠nio\nHOSTNET: http://www.hostnet.com.br\nT1SITE: http://www.t1site.com.br', '00:00:00', 'NuBt0B_GeEo', 'video/youtube', 'https://i.ytimg.com/vi/NuBt0B_GeEo/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCrWvhVmt0Qac3HgsjQK62FQ', '2014-09-07 07:50:39'),
(456, 456, '2022-10-20 02:08:24', '2022-10-20 02:08:24', 'YrmPk8zL9Qw', 'Operadores Relacionais - Curso PHP Iniciante #07 - Gustavo Guanabara', 'Aula do Curso de PHP criado pelo professor Gustavo Guanabara para o portal CursoemVideo.com.\n\nCurso em V√≠deo\nSite: http://www.cursoemvideo.com\nYouTube: http://www.youtube.com/cursosemvideo\nFacebook: http://www.facebook.com/cursosemvideo\nTwitter: http://twitter.com/cursosemvideo\nGoogle+: http://plus.google.com/112666558837414979080\n\nPatroc√≠nio\nHOSTNET: http://www.hostnet.com.br\nTRAINNING: http://www.trainning.com.br\nTOY SHOW: http://www.toyshow.com.br', '00:00:00', 'YrmPk8zL9Qw', 'video/youtube', 'https://i.ytimg.com/vi/YrmPk8zL9Qw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCrWvhVmt0Qac3HgsjQK62FQ', '2014-09-15 02:08:43'),
(457, 457, '2022-10-20 02:08:24', '2022-10-20 02:08:24', 'gvZfP2iBkw4', 'Integra√ß√£o HTML5 + PHP - Curso PHP Iniciante #08 - Gustavo Guanabara', 'Liga√ß√£o formul√°rio HTML PHP, integra√ß√£o HTML5 com PHP via formul√°rio. \n\nNessa oitava aula do Curso de PHP, vamos aprender como aumentar a interatividade dos nossos scripts PHP com formul√°rios HTML5.\n\nFormul√°rios em HTML5\nSe voc√™ n√£o sabe como lidar com formul√°rios HTML5, n√£o se esque√ßa de assistir antes as duas aulas que tratam desse assunto no Curso em V√≠deo Gr√°tis de HTML5.\n\nFormul√°rios HTML5 - Parte 1: http://youtu.be/metoFY-x_yg\nFormul√°rios HTML5 - Parte 2: http://youtu.be/lwuDJN9Udfc\nFormul√°rios HTML5 e JavaScript: http://youtu.be/YY5hqlcbfoI\n\nL√° voc√™ vai aprender como escrever c√≥digos espec√≠ficos para a cria√ß√£o de formul√°rios completos e vai estudar todos os novos controles de formul√°rios adicionados ao HTML5, como o range, color, number, date, etc.\n\nPor exemplo, vamos considerar um formul√°rio que use o m√©todo GET e envie um valor V para o arquivo DADOS.PHP:\n\nObs: O m√©todo GET envia dados de um formul√°rio diretamente pela URL.\n\nInterligando o formul√°rio HTML com o script PHP\n\nPara interligar o formul√°rio, vamos usar a cl√°usula $_GET\n\n?php\n $valor = $_GET[‚Äúv‚Äù];\n echo ‚ÄúDigitou $valor‚Äù;\n?\n\nObs: O $_GET sempre vai utilizar todas as letras mai√∫sculas.\nObs: Se por acaso seu formul√°rio utilizar o m√©todo post, voc√™ vai precisar usar $_POST.\n\nInterligando outros tipos de controles de formul√°rios HTML5 com PHP\n\nA integra√ß√£o de qualquer controle de formul√°rio PHP pode ser feita atrav√©s do par√¢metro NAME de cada um deles. Durante a aula, criamos um formul√°rio com v√°rios tipos de controles e interligamos eles ao arquivo PHP.\n\nPegando o ano atual com PHP\n\nPara obter o ano atual no PHP, utilizamos\n\n$idade = date(‚ÄúY‚Äù) - $ano; \n\n\nAula do Curso de HTML5 criado pelo professor Gustavo Guanabara para o portal CursoemVideo.com.\n\nCurso em V√≠deo\nSite: http://www.cursoemvideo.com\nYouTube: http://www.youtube.com/cursosemvideo\nFacebook: http://www.facebook.com/cursosemvideo\nTwitter: http://twitter.com/cursosemvideo\nGoogle+: http://plus.google.com/112666558837414979080\n\nPatroc√≠nio\nHOSTNET: http://www.hostnet.com.br\nT1SITE: http://www.t1site.com.br', '00:00:00', 'gvZfP2iBkw4', 'video/youtube', 'https://i.ytimg.com/vi/gvZfP2iBkw4/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCrWvhVmt0Qac3HgsjQK62FQ', '2014-10-09 01:17:39'),
(458, 458, '2022-10-20 02:08:24', '2022-10-20 02:08:24', 'qAisUeI5oKE', 'Estrutura Condicional if - Curso de PHP Iniciante #09 - Gustavo Guanabara', 'O PHP permite a cria√ß√£o de condic√µes. Nessa aula, veremos como utilizar a estrutura IF.\n\nA estrutura condicional em PHP √© representada da seguinte forma:\n\nif ($idade = 18) {\n $vota = true;\n} else {\n $vota = false;\n}\n\nEstruturas condicionais aninhadas\n\nQuando colocamos uma condicional dentro da outra, dizemos que estamos aninhando estruturas (termo que se refere a ninho). Para aninhar blocos, utilizamos uma sintaxe semelhante √† anterior:\n\nif ($peso  50) {\n $tipo = ‚Äúmuito magro‚Äù;\n} else {\n if ($peso =50 && $peso 70) {\n  $tipo = ‚Äúpeso normal‚Äù;\n } else {\n  $tipo = ‚Äúacima do peso‚Äù;\n }\n}\n\nSimplificando estruturas condicionais aninhadas\n\nNo PHP, podemos substituir uma cl√°usula else seguida de outro if (como feito acima) por uma estrutura elseif {} que vai se comportar exatamente da mesma maneira, mas usar√° menos blocos.\n\nif ($tipo == ‚Äúnacional‚Äù) {\n $imposto = 0;\n} elseif ($tipo == ‚Äúimportado‚Äù) {\n $imposto = 60;\n} elseif ($tipo == ‚Äúmercosul‚Äù) {\n $imposto = 20;\n} else {\n $imposto = 80;\n}\n\nNa pr√≥xima aula veremos como criar estruturas condicionais com m√∫ltiplos valores utilizando o comando switch. At√© l√°!\n\nAula do Curso de PHP criado pelo professor Gustavo Guanabara para o portal CursoemVideo.com.\n\nCurso em V√≠deo\nSite: http://www.cursoemvideo.com\nYouTube: http://www.youtube.com/cursosemvideo\nFacebook: http://www.facebook.com/cursosemvideo\nTwitter: http://twitter.com/cursosemvideo\nGoogle+: http://plus.google.com/112666558837414979080\n\nPatroc√≠nio\nHOSTNET: http://www.hostnet.com.br\nT1SITE: http://www.t1site.com.br', '00:00:00', 'qAisUeI5oKE', 'video/youtube', 'https://i.ytimg.com/vi/qAisUeI5oKE/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCrWvhVmt0Qac3HgsjQK62FQ', '2014-09-26 09:36:31'),
(459, 459, '2022-10-20 02:08:24', '2022-10-20 02:08:24', 'thElQ5IhM1Q', 'Estrutura Condicional Switch - Curso de PHP Iniciante #10 - Gustavo Guanabara', 'Estruturas de condi√ß√£o de m√∫ltipla escolha em PHP. Switch case em PHP usa a mesma sintaxe do Java e da Linguagem C e C++.\n\nAula do Curso de PHP criado pelo professor Gustavo Guanabara para o portal CursoemVideo.com.\n\nCurso em V√≠deo\nSite: http://www.cursoemvideo.com\nYouTube: http://www.youtube.com/cursosemvideo\nFacebook: http://www.facebook.com/cursosemvideo\nTwitter: http://twitter.com/cursosemvideo\nGoogle+: http://plus.google.com/112666558837414979080\n\nPatroc√≠nio\nHOSTNET: http://www.hostnet.com.br\nT1SITE: http://www.t1site.com.br', '00:00:00', 'thElQ5IhM1Q', 'video/youtube', 'https://i.ytimg.com/vi/thElQ5IhM1Q/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCrWvhVmt0Qac3HgsjQK62FQ', '2014-10-06 04:33:32'),
(460, 460, '2022-10-20 02:08:24', '2022-10-20 02:08:24', '3jk8fSWpQIg', 'Estrutura de Repeti√ß√£o While - Curso de PHP Iniciante #11 - Gustavo Guanabara', 'Vamos agora come√ßar as Estruturas de Repeti√ß√£o em PHP, partindo da estrutura WHILE (enquanto). \n\nA Estrutura While (enquanto), tamb√©m conhecida como Estrutura de Repeti√ß√£o com Teste L√≥gico no in√≠cio, realiza o teste de uma express√£o l√≥gica sempre na primeira linha da estrutura. Vamos ver como realizar uma contagem progressiva de 1 at√© 10, utilizando a estrutura while em PHP.\n\n$c = 1;\nwhile ($c = 10) {\n echo $c;\n $c++;\n}\n\nDurante a aula, veremos tamb√©m como realizar outras contagens, como por exemplo a contagem regressiva.\n\nOutra coisa que vamos aprender durante essa aula de repeti√ß√£o √© criar c√≥digo HTML dinamicamente, utilizando scripts PHP. No exemplo apresentado, vamos criar v√°rias caixas de texto com nomes e etiquetas diferentes usando uma estrutura de repeti√ß√£o em PHP.\n\nAula do Curso de PHP criado pelo professor Gustavo Guanabara para o portal CursoemVideo.com.\n\nCurso em V√≠deo\nSite: http://www.cursoemvideo.com\nYouTube: http://www.youtube.com/cursosemvideo\nFacebook: http://www.facebook.com/cursosemvideo\nTwitter: http://twitter.com/cursosemvideo\nGoogle+: http://plus.google.com/112666558837414979080\n\nPatroc√≠nio\nHOSTNET: http://www.hostnet.com.br\nT1SITE: http://www.t1site.com.br', '00:00:00', '3jk8fSWpQIg', 'video/youtube', 'https://i.ytimg.com/vi/3jk8fSWpQIg/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCrWvhVmt0Qac3HgsjQK62FQ', '2014-10-10 04:35:35'),
(461, 461, '2022-10-20 02:08:24', '2022-10-20 02:08:24', '6QymvmX3YJU', 'Estrutura de Repeti√ß√£o Do While - Curso de PHP Iniciante #12 - Gustavo Guanabara', 'Aula do Curso de PHP criado pelo professor Gustavo Guanabara para o portal CursoemVideo.com.\n\nCurso em V√≠deo\nSite: http://www.cursoemvideo.com\nYouTube: http://www.youtube.com/cursosemvideo\nFacebook: http://www.facebook.com/cursosemvideo\nTwitter: http://twitter.com/cursosemvideo\nGoogle+: http://plus.google.com/112666558837414979080\n\nPatroc√≠nio\nHOSTNET: http://www.hostnet.com.br\nT1SITE: http://www.t1site.com.br', '00:00:00', '6QymvmX3YJU', 'video/youtube', 'https://i.ytimg.com/vi/6QymvmX3YJU/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCrWvhVmt0Qac3HgsjQK62FQ', '2014-10-17 06:17:24'),
