(482, 482, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'XspbsepnhQ4', 'PHP Null Data Type - Full PHP 8 Tutorial', 'A short video about the NULL data type & how it is cast. It\'s a simple but very useful data type which you\'ll see in later videos.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments on videos, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.9\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-', '00:00:00', 'XspbsepnhQ4', 'video/youtube', 'https://i.ytimg.com/vi/XspbsepnhQ4/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-09 11:11:51'),
(483, 483, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'C8ZFLq24g_A', 'PHP Array Data Type - Indexed, Associative & Multi-Dimensional Arrays - Full PHP 8 Tutorial', 'In PHP you can have regular index-based arrays also known as indexed arrays, you could also have arrays with custom keys also known as associative arrays & can have arrays within arrays which are called multi-dimensional arrays. You will learn all that you need to know about arrays to get started using them goes over how arrays are indexed by default & how re-indexing happens. Also, you will learn how to check if an element exists in an array at the specific key & the difference between array_key_exists & isset().\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.10\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nCHAPTERS\n00:00 - Intro\n00:43 - What are arrays\n01:27 - Indexed arrays & accessing elements\n03:06 - Undefined array key\n03:41 - Check if array key exists - isset()\n04:04 - Mutate arrays\n04:52 - Get length of array - count()\n05:04 - Add elements to an array - square bracket syntax\n05:37 - Add multiple elements to an array using array_push\n06:05 - Name your keys (associative arrays)\n07:11 - Add elements to associative arrays at specified keys\n07:45 - Multi-dimensional arrays\n10:02 - Duplicate keys & overwriting\n11:18 - Having keys on only some elements & how automatic indexing works\n12:05 - Removing an element from the end of an array using array_pop\n12:27 - Removing an element from the beginning of an array using array_shift & re-indexing\n13:14 - Removing element(s) from arrays by specifying keys using unset\n13:59 - Using unset() does not re-index arrays\n15:00 - Casting to arrays\n15:27 - Another way to check if the key exists in array & the difference between array_key_exists & isset()', '00:00:00', 'C8ZFLq24g_A', 'video/youtube', 'https://i.ytimg.com/vi/C8ZFLq24g_A/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-12 08:47:55'),
(484, 484, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'bPntels5hw8', 'What Are Expressions In PHP & How They Are Evaluated - Full PHP 8 Tutorial', 'It\'s time to move on to expressions. Think of it as a new chapter in this course. Up until now, you have learned how to get PHP up & running, basic syntax, variables, constants, data types, casting & so on. However, almost everything in PHP is an expression & you\'ve already seen expressions in previous videos. Let\'s do a quick review of what expressions are & what will be the topics of the upcoming videos.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments on videos, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.11\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-', '00:00:00', 'bPntels5hw8', 'video/youtube', 'https://i.ytimg.com/vi/bPntels5hw8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-13 11:22:44'),
(485, 485, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 't8U2FGjjqM8', 'PHP Operators Part 1 - Full PHP 8 Tutorial', 'In this video, you will learn all about Arithmetic, String, Comparison & Assignment operators. You will learn things beyond basic because, in my opinion, things I discuss in this video are important to know which is why I decided to split it into two videos to not make it too long. The second video will cover the rest of the operators.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.12\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nRFC Discussing String To Number Comparison - https://wiki.php.net/rfc/string_to_number_comparison\nType Comparison Tables - https://www.php.net/manual/en/types.comparisons.php\n\nCHAPTERS\n00:00 - Intro\n00:47 - Arithmetic Operators\n04:35 - Assignment Operators\n07:12 - String Operators\n07:39 - Comparison Operators', '00:00:00', 't8U2FGjjqM8', 'video/youtube', 'https://i.ytimg.com/vi/t8U2FGjjqM8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-18 12:59:20'),
(486, 486, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'gCVlQdbddXY', 'PHP Operators Part 2 - Full PHP 8 Tutorial', 'We continue with the rest of the operators in this video where you will learn error control operator (@), pre & post increment (++) & decrement (--) operators, array operators (+, ==, ===, !=, !==), logical operators (&&, ||, !, and, or, xor) with explanation on what short-circuiting is & how it works & bitwise operators (& | ^ ~) also explaining how to use bitwise operators & how it works.\n\nIn addition to the basic explanation of how to use these operators & how they work I also talk about some important things so I recommend watching the video fully.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments on videos, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.13\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nCHAPTERS\n00:00 - Intro\n00:11 - Error Control Operator (@)\n01:26 - Increment / Decrement Operators (++ --)\n03:17 - Logical Operators (&& || !)\n04:52 - Logical Operators (and or xor)\n05:45 - Logical Operators - Short Circuiting\n07:55 - Bitwise Operators (& | ^ ~)\n12:42 - Array Operators (+ == === != !==)\n15:32 - Execution Operator, Type Operator, & Nullsafe Operator', '00:00:00', 'gCVlQdbddXY', 'video/youtube', 'https://i.ytimg.com/vi/gCVlQdbddXY/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-21 02:03:27'),
(487, 487, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'pmX_-x3LX-k', 'PHP Operator Precedence & Associativity - Full PHP 8 Tutorial', 'Operator precedence & associativity are very important topics to know because it can result in unexpected output when you combine multiple operators in an expression. Hoping that this video makes it clear how operations are grouped & what operator precedence & associativity are & how it works.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.14\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nhttps://www.php.net/manual/en/language.operators.precedence.php', '00:00:00', 'pmX_-x3LX-k', 'video/youtube', 'https://i.ytimg.com/vi/pmX_-x3LX-k/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-21 10:18:09');
