(488, 488, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'PUWrc6vzRMw', 'Control Structures in PHP - Conditional Statements - if/else - Full PHP 8 Tutorial', 'It\'s time to learn control structures which you will use a lot in PHP and in any programming language. Control structures allow you to group multiple statements & execute them after a certain condition is met or keep executing them until some condition is met. They basically allow you to control the flow of the code execution. The first control structure that is covered in this video is if, else, & elseif conditional statements.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments on videos, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.15\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-', '00:00:00', 'PUWrc6vzRMw', 'video/youtube', 'https://i.ytimg.com/vi/PUWrc6vzRMw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-27 12:15:43'),
(489, 489, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'NhXvpHB_PMQ', 'PHP Loops Tutorial - Break & Continue Statements - Full PHP 8 Tutorial', 'Loops are simple but there are some important things that you need to be aware of when working with them, such as performance, things to be aware of when working with references, how to break out of nested loops, how to handle infinite loops & so on. Loop is basically a control structure that allows you to execute a block of code or multiple statements N times until a given condition evaluates to false or you manually break out of the loop. In this video, we cover while loops, do-while loops, for loops & foreach loops with examples on iterating over strings, arrays, and so on.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.16\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nCHAPTERS\n00:00 - Intro\n00:15 - While loop\n01:05 - Infinite loops\n01:32 - Break statement & use-case of an infinite loop\n02:05 - Break out of multiple levels of nested loops\n02:31 - Continue statement\n03:32 - Alternative while loop syntax\n03:47 - Do-While loop\n04:26 - For loop\n05:07 - Multiple expressions within for loop\n05:48 - Iterate over strings\n06:09 - Iterate over arrays\n06:23 - Performance concerns\n07:20 - Foreach loop\n08:38 - Overwriting array elements using assignment by reference\n09:15 - Something to be aware of - variable within the foreach loop is not destroyed\n10:30 - Iterate over associative arrays\n11:48 - Alternative foreach & for loop syntax', '00:00:00', 'NhXvpHB_PMQ', 'video/youtube', 'https://i.ytimg.com/vi/NhXvpHB_PMQ/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-29 11:07:16'),
(490, 490, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'egDgLO8kvtI', 'PHP Switch Statement - Switch vs if/else statement - Full PHP 8 Tutorial', 'In this PHP tutorial you will learn about the switch statement in PHP, how to use it with examples, concerns when using switch statement within loops & the differences between the series of if statements & the switch statement. The switch statement is similar to if, elseif, else statements. The main difference is that the switch statement takes a single expression & compares its value against multiple values (cases).\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments on videos, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.17\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nCheck https://www.php.net/manual/en/control-structures.alternative-syntax.php for alternative syntax for the switch statement.\n\nCHAPTERS\n00:00 - Switch statement\n00:50 - Default case\n01:00 - Break statement within switch & how does switch statement work\n02:39 - Fall-through strategy & use-case of omitting the break statement\n03:28 - Loose comparison\n04:10 - Switch statement within loops & using break\n04:57 - Using continue statement within the switch statement that\'s within loop\n05:42 - Difference between switch statement & series of if statements (switch vs if). Demonstrating example of the performance difference', '00:00:00', 'egDgLO8kvtI', 'video/youtube', 'https://i.ytimg.com/vi/egDgLO8kvtI/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-31 05:00:55'),
(491, 491, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'jCUyvHUKSmE', 'PHP Match Expression - Match vs Switch - Full PHP 8 Tutorial', 'In this PHP tutorial, you will learn about the newly added feature the match expression which was introduced in PHP 8. Match expression makes a block for switch statements much shorter & easier to read. You\'ll learn about the main differences between the match expression & switch statements with a real example. Do you like the match expression? Let me know your thoughts in the comments.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments on videos, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.18\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nCheck https://www.php.net/manual/en/control-structures.match.php for more info about match expression.', '00:00:00', 'jCUyvHUKSmE', 'video/youtube', 'https://i.ytimg.com/vi/jCUyvHUKSmE/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-01-02 12:54:12'),
(492, 492, '2022-10-20 02:08:26', '2022-10-20 02:08:26', '6cPc_SEfgSw', 'PHP Return, Declare & Tickable Statements - Full PHP 8 Tutorial', 'In this PHP tutorial, you will learn about the declare & return statements. When the return is used within a function it stops the execution of the function & returns the value of the expression it\'s given, if no expression is given it will return null. If the return is used in the global scope (out of a function) then the execution of that script will end & will return the value of the expression or null if no expression is given. Declare statement is used to set execution directives, there are three directives: ticks directive, encoding directive & strict_types directive. \n\nThe reason I did not talk about the goto statement is that it just makes code harder to maintain & read. You can use other control structures to achieve the same result. If you still want to know how to use it, here is the link to the docs: https://www.php.net/manual/en/control-structures.goto.php\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.19\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nCheck https://www.php.net/manual/en/control-structures.match.php for more info about match expression.\n\nCHAPTERS\n00:00 - Return statement\n01:41 - Declare statement (ticks directive)\n03:22 - Declare statement (encoding directive)\n03:43 - Declare statement (strict_types directive)\n05:45 - Goto statement', '00:00:00', '6cPc_SEfgSw', 'video/youtube', 'https://i.ytimg.com/vi/6cPc_SEfgSw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-01-03 09:53:20'),
(493, 493, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'pQLO6l5lp-Y', 'How To Include Files In PHP - Include and Require - Full PHP 8 Tutorial', 'In this PHP tutorial, you will learn how to include PHP files with some actual practical examples. You will learn how to use output buffering to render a PHP file into a string using, how files are actually being loaded & located, the differences between require, include, require_once & include_once, & how to use include statements for code reusability. You will also learn a few things to be aware of when including files because again this flexibility & ease of use comes at a cost of possible bugs.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.20\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nCHAPTERS\n00:00 - Include & Require\n00:42 - Syntax\n01:00 - Difference between include & require\n01:30 - How are files located/loaded\n02:13 - Difference between include_once, require_once & include, require\n02:35 - Example usage of require_once with the variable being overwritten if the file is included more than once\n04:13 - Bad practice\n04:48 - Return value of include & using return within the included file\n05:27 - Using include within HTML for code re-usability\n06:59 - Including file into a string using output control functions (storing HTML of the included file in a string instead of printing it)', '00:00:00', 'pQLO6l5lp-Y', 'video/youtube', 'https://i.ytimg.com/vi/pQLO6l5lp-Y/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-01-07 03:49:08'),
