(500, 500, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'LVEhccXXnOo', 'How To Work With PHPs Configuration File - PHP.INI - Full PHP 8 Tutorial', 'In this PHP tutorial, you will learn what the PHP configuration file is, what are some of the important settings & how to change them. The php.ini file is the settings or the configuration file for your PHP, each version can have its own php.ini. This file allows you to control how certain things in PHP work. You are able to also change some of the configuration settings at runtime by using ini_set.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.27\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nhttps://www.php.net/manual/en/ini.list.php\nhttps://www.php.net/manual/en/ini.core.php', '00:00:00', 'LVEhccXXnOo', 'video/youtube', 'https://i.ytimg.com/vi/LVEhccXXnOo/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-01-26 02:32:05'),
