(502, 502, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'ytVPiYILz80', 'Basic Apache Webserver Configuration & Virtual Hosts - Full PHP 8 Tutorial', 'In this PHP tutorial, you will learn the basics of apache configuration files & how to work with them. You will also learn how to rewrite URLs using .htaccess files & the difference between .htaccess & httpd.conf files and why you should not use .htaccess files.\n\nNOTE\nAt 13:20 I copied htaccess content into vhosts config, if it does not work for you or you are setting rewrite rules globally then try the following instead:\n\nRewriteCond %{LA-U:REQUEST_FILENAME} !-f\nRewriteCond %{LA-U:REQUEST_FILENAME} !-d\n\nThe reason for it is because LA-U (look-ahead URL based) is needed for the proper value of REQUEST_FILENAME in some cases. More info on it can be read on https://httpd.apache.org/docs/current/mod/mod_rewrite.html (search for LA-U)\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.29\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nDefault locations of the apache configuration file by OS - https://cwiki.apache.org/confluence/display/HTTPD/DistrosDefaultLayout\nContext where the directives are allowed - https://httpd.apache.org/docs/2.4/mod/directive-dict.html#Context\nmod_rewrite - https://httpd.apache.org/docs/2.4/mod/mod_rewrite.html\nvirtual hosts - https://httpd.apache.org/docs/2.4/vhosts/\nvirtual hosts examples - https://httpd.apache.org/docs/2.4/vhosts/examples.html\n\nCHAPTERS\n00:00 - Intro\n00:38 - Apache configuration file - httpd.conf\n05:12 - Virtual hosts\n07:22 - .htaccess files', '00:00:00', 'ytVPiYILz80', 'video/youtube', 'https://i.ytimg.