(503, 503, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'p7F2GgVxHc0', 'Working With File System In PHP - Full PHP 8 Tutorial', 'In this PHP tutorial, you will learn how to work with files & filesystem in PHP. You will learn how to create & delete directories, open files, put content, read content, read files line by line, read CSV files, some tips & things to be aware of such as return value caching for some of the file related functions.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.30\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nDocs for clearstatcache & list of affected functions - https://www.php.net/manual/en/function.clearstatcache.php\nDocs for fopen & modes - https://www.php.net/manual/en/function.fopen.php\nFilesystem functions - https://www.php.net/manual/en/ref.filesystem.php\n\nCHAPTERS\n00:00 - List of all files & directories - scandir\n00:44 - Check if file is a directory or a file - is_dir / is_file\n00:58 - Create & delete directories - mkdir / rmdir\n02:02 - Check if file or directory exists & print filesize - file_exists / filesize\n02:28 - Clear cached values of functions like filesize - clearstatcache\n03:30 - Open files & resource data type - fopen\n04:25 - Using error control operator to suppress warnings\n05:25 - Read files line by line - fgets / fclose\n06:25 - Read csv files - fgetcsv\n07:02 - Get file contents & store in a variable - file_get_contents\n07:57 - Write content to a file - file_put_contents\n08:50 - Delete, copy, rename & move files - unlink / copy / rename\n09:34 - Get information about a file - pathinfo', '00:00:00', 'p7F2GgVxHc0', 'video/youtube', 'https://i.ytimg.com/vi/p7F2GgVxHc0/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-02-08 03:33:59'),
(504, 504, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'oXcX4ucj32M', 'Mini Exercise Project Overview - Full PHP 8 Tutorial', 'We\'ve reached the end of the first section of the course. Finally! This means that now we get to move on to more fun topics & actually work on a project. It may not seem so but we actually covered a lot of topics in this first section & there are a lot more tutorials/lessons on the way. There is a small exercise project that I will implement in the next video using things that we\'ve learned so far. The project that we\'ll be working on is going to be a simple budgeting/expense tracking application, but because we have not covered all the necessary things to implement this now we will slowly add on features as I cover the related topics. We will start with a simple file parser that reads one or multiply CSV files & extracts transactions from them.\n\nI really hope you enjoyed the first section of the course, please do let me know what you thought about it or if you have any kind of feedback. I have not recorded videos for the second section of the course yet & but will be recording them soon so it might be a couple of weeks before I start publishing videos for the second section of the course.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.31\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nPROJECT INSTRUCTIONS & REPO\nhttps://github.com/ggelashvili/learnphptherightway-project/tree/1.31', '00:00:00', 'oXcX4ucj32M', 'video/youtube', 'https://i.ytimg.com/vi/oXcX4ucj32M/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-02-11 03:25:03'),
(505, 505, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'MOsolLaVnsI', 'Building Small Part Of The App With Procedural PHP - Full PHP 8 Tutorial', 'I implement the solution to the exercise project that was discussed in the last video. I tried to use the things that were covered so far in this course. In the second section of the course, we\'ll refactor this to object-oriented PHP. \n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.32\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nSOURCE CODE\nhttps://github.com/ggelashvili/learnphptherightway-project/tree/1.32', '00:00:00', 'MOsolLaVnsI', 'video/youtube', 'https://i.ytimg.com/vi/MOsolLaVnsI/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-02-14 09:36:54'),
(506, 506, '2022-10-20 02:08:26', '2022-10-20 02:08:26', '1SujQeVK4MU', 'PHP OOP Tutorial Section 2 - Intro to Object Oriented Programming - Full PHP 8 Tutorial', 'This is the section of the course that will teach you Object-Oriented PHP the right way.  In this video, I do a quick review of what was covered, what will be covered & how OOP compares to procedural PHP.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.0\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-', '00:00:00', '1SujQeVK4MU', 'video/youtube', 'https://i.ytimg.com/vi/1SujQeVK4MU/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-02-26 09:31:53'),
(507, 507, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'I_9-xWmkh28', 'PHP Docker Tutorial - Nginx - PHPFPM VS Apache - Full PHP 8 Tutorial', 'In this lesson, you will learn how to get PHP project up & running using docker. For the webserver, we\'ll be using Nginx because you already know how to set it up with apache & it\'s good to know both. I also talk about mod_php & php-fpm and towards the end of the video I discuss another alternative of XAMPP called Laragon.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.1\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nSource Repo - https://github.com/ggelashvili/learnphptherightway-project/tree/2.1\nInstall Docker - https://docs.docker.com/get-docker/\nInstall Docker-Compose (For Linux) - https://docs.docker.com/compose/install/\nNginx Config Docs - https://www.nginx.com/resources/wiki/start/topics/examples/full/', '00:00:00', 'I_9-xWmkh28', 'video/youtube', 'https://i.ytimg.com/vi/I_9-xWmkh28/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-03-03 04:06:43'),
(508, 508, '2022-10-20 02:08:26', '2022-10-20 02:08:26', '6FW72q5fIx8', 'PHP Classes & Objects - Typed Properties - Constructors & Destructors - Full PHP 8 Tutorial', 'In this lesson, you will learn all about classes & objects in PHP. How to create classes & objects, set properties, typed properties, their visibility, create methods, learn about method chaining, what are constructors & destructors & so on. Make sure to watch it till the end since I cover some important things that you should be aware of when working with destructors.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.2\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nCHAPTERS\n00:00 - Objects & Classes\n00:56 - Creating class & object\n02:58 - Class properties\n04:43 - Typed properties\n07:50 - Class constructor, $this, & constructor arguments\n09:54 - Methods\n11:34 - Method chaining\n13:44 - Creating objects using variables\n14:05 - Creating multiple objects of the same class\n14:40 - Class destructor\n18:05 - stdClass & object casting', '00:00:00', '6FW72q5fIx8', 'video/youtube', 'https://i.ytimg.com/vi/6FW72q5fIx8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-03-08 05:07:21'),
(509, 509, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'T1PbFz-o6kw', 'Constructor Property Promotion - Nullsafe Operator - Full PHP 8 Tutorial', 'In this lesson, you will learn a couple of new features that were added to PHP 8. It\'s related to the last video because we covered constructors in the last lesson & in this lesson, we\'ll cover constructor property promotion & null safe operator. \r\n\r\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.3\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\r\n\nRESOURCES\nConstructor Property Promotion RFC - https://wiki.php.net/rfc/constructor_promotion\nNull-safe Operator RFC - https://wiki.php.net/rfc/nullsafe_operator\r\n\nCHAPTERS\r\n00:00 - Constructor Property Promotion\r\n03:50 - Nullsafe operator', '00:00:00', 'T1PbFz-o6kw', 'video/youtube', 'https://i.ytimg.com/vi/T1PbFz-o6kw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-03-10 11:00:58'),
(510, 510, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'Jni9c0-NjrY', 'PHP Namespace Tutorial - Full PHP 8 Tutorial', 'In this video, you will learn all you need to know about namespaces in PHP. Not only you will learn the basics of namespaces, but if you watch this video till the end you will know a lot of important details about namespaces. There are some caveats & things to be aware of when working with namespaces. \n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.4\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nNamespaces Docs - https://www.php.net/manual/en/language.namespaces.php\nName Resolution Rules - https://www.php.net/manual/en/language.namespaces.rules.php\n\nHow does a name like \\my\\name or \\name resolve?\nhttps://www.php.net/manual/en/language.namespaces.faq.php#language.namespaces.faq.full\n\nHow does a name like my\\name resolve?\nhttps://www.php.net/manual/en/language.namespaces.faq.php#language.namespaces.faq.qualified\n\nHow does an unqualified class name like *name* resolve?\nhttps://www.php.net/manual/en/language.namespaces.faq.php#language.namespaces.faq.shortname1\n\nHow does an unqualified function name or an unqualified constant name like *name* resolve?\nhttps://www.php.net/manual/en/language.namespaces.faq.php#language.namespaces.faq.shortname2\n\nDefining Multiple Namespaces In The Same File\nhttps://www.php.net/manual/en/language.namespaces.definitionmultiple.php', '00:00:00', 'Jni9c0-NjrY', 'video/youtube', 'https://i.ytimg.com/vi/Jni9c0-NjrY/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-03-15 04:07:50'),
(511, 511, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'rqzYdHdyMH0', 'PHP Coding Standards, Autoloading (PSR-4) & Composer - Full PHP 8 Tutorial', 'In this video, you will learn how to autoload your classes instead of using include & require statements. I\'ll show you how autoloader works, how to register custom autoloader & then how to use composer to handle autoloading for you. In addition to autoloading, you will learn about coding standards (PSR) and dependency management using composer.\r\n\r\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.5\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\r\n\r\nRESOURCES\nPSR-1 - https://www.php-fig.org/psr/psr-1/\nPSR-4 - https://www.php-fig.org/psr/psr-4/\nPSR-12 - https://www.php-fig.org/psr/psr-12/ \r\nSymfony Coding Standards Fixer - https://cs.symfony.com/\r\nPHP Code Sniffer - https://pear.php.net/package/PHP_CodeSniffer/\r\nComposer - https://getcomposer.org/\r\nVersioning - https://getcomposer.org/doc/articles/versions.md\r\nPHP Autoloading - https://www.php.net/manual/en/language.oop5.autoload.php\r\nPEAR Coding Standards - https://pear.php.net/manual/en/standards.php\r\nSymfony Coding Standards - https://symfony.com/doc/current/contributing/code/standards.html\n\nFor source, you can either use the code from https://github.com/ggelashvili/learnphptherightway-project/tree/2.1 as a starting base & build upon it following this lesson or you can use the one that\'s already built at the end of section 2 for exercise: https://github.com/ggelashvili/learnphptherightway-project/tree/2.33\n\nCHAPTERS\n00:00 - Autoloading\n05:52 - PSR\n10:27 - Composer & dependency management\n16:31 - Autoloading using composer', '00:00:00', 'rqzYdHdyMH0', 'video/youtube', 'https://i.ytimg.com/vi/rqzYdHdyMH0/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-03-19 04:52:09'),
(512, 512, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'bEGNvUxYf2o', 'Object Oriented PHP - Class Constants - Full PHP 8 Tutorial', 'In the first section of the course, you learned how to work with constants in PHP. In this lesson, you will learn how to work with class constants, how to access them using the scope resolution operator & so on. I also show a good use case for it with a real example.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.6\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nVideo About Constants - https://youtu.be/6JtP8xk1U_k\nPHP 8.1 Enums - https://wiki.php.net/rfc/enumerations', '00:00:00', 'bEGNvUxYf2o', 'video/youtube', 'https://i.ytimg.com/vi/bEGNvUxYf2o/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-06-29 01:30:57'),
(513, 513, '2022-10-20 02:08:26', '2022-10-20 02:08:26', '6VVN-2SCx7Q', 'Static Properties & Methods In Object Oriented PHP -  Full PHP 8 Tutorial', 'In the first section of the course, you learned about variable scopes & static variables. In this lesson, you will learn about static properties & methods of the class with some use cases including singleton & factory design patterns. There are few differences between static properties & non-static properties, one is that static properties are associated & belong to the class itself & not to any particular object, while non-static properties are associated & belong to the object. So when you create an object, that object gets fresh values for the non-static properties. Another difference is that you need to use the dollar sign when accessing static properties, unlike regular properties where you don\'t use the dollar sign to access non-static properties.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.7\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nVideo About Static Variables & Scopes - https://youtu.be/et1aVZWMvVE&t=193', '00:00:00', '6VVN-2SCx7Q', 'video/youtube', 'https://i.ytimg.com/vi/6VVN-2SCx7Q/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-03-25 06:02:39'),
(514, 514, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'kA9BTNPFObo', 'PHP - Encapsulation & Abstraction -  Full PHP 8 Tutorial', 'This video covers two out of four Object Oriented Programming principles: encapsulation & abstraction. I cover how encapsulation & abstraction can be broken & some tricks to accessing private & protected properties and methods.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.8\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-', '00:00:00', 'kA9BTNPFObo', 'video/youtube', 'https://i.ytimg.com/vi/kA9BTNPFObo/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-03-30 05:21:31'),
(515, 515, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'LyyzeYOoH5s', 'PHP - Inheritance Explained - Is Inheritance Good? -  Full PHP 8 Tutorial', 'Learn inheritance by examples not just by theory. Learn when inheritance is a good choice & when inheritance might not be ideal. Learn downsides of inheritance & why composition would be the better choice. Learn how to decide on choosing inheritance vs composition based on the relationship between the two classes.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.9\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-', '00:00:00', 'LyyzeYOoH5s', 'video/youtube', 'https://i.ytimg.com/vi/LyyzeYOoH5s/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-04-12 02:28:25'),
(516, 516, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'UnwaW13xJuw', 'PHP Abstract Classes & Methods - Full PHP 8 Tutorial', 'In the previous lesson we covered inheritance, in this video, you\'ll learn about abstract classes & abstract methods. Abstract classes use inheritance so if you have not watched the last lesson about inheritance please make sure to watch that first since the same rules apply to abstract classes.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.10\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-', '00:00:00', 'UnwaW13xJuw', 'video/youtube', 'https://i.ytimg.com/vi/UnwaW13xJuw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-04-15 08:28:42'),
(517, 517, '2022-10-20 02:08:26', '2022-10-20 02:08:26', '-AJic0FjuAA', 'PHP Interfaces & Polymorphism - Interfaces Explained - Full PHP 8 Tutorial', 'In this video, you will learn interfaces & polymorphism in object-oriented PHP. With simple to understand & practical examples, this video will help you understand what interfaces are, how they should be used & what problems interfaces solve. In addition to learning interfaces & polymorphism, you will also learn what are some of the differences between interfaces and abstract classes.\n\nNOTE\n5:20 - Overriding constants from the interface is now allowed in PHP 8.1, this video uses PHP 8.0 where it was not allowed & resulted in an error. \n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.11\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-', '00:00:00', '-AJic0FjuAA', 'video/youtube', 'https://i.ytimg.com/vi/-AJic0FjuAA/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-04-20 07:01:12'),
(518, 518, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'nCxnzj83poQ', 'What Are PHP Magic Methods & How They Work - Full PHP 8 Tutorial', 'In this video, you\'ll learn about PHP\'s magic methods, how they work & when they get called. Magic methods are exactly what they are called, they are \"magic\" in a way that you don\'t call these methods the way you call regular methods. Instead, these magic methods get triggered automatically after a certain action or event.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.12\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nLesson That Includes Constructors & Destructors - https://youtu.be/6FW72q5fIx8\nResources - https://www.php.net/manual/en/language.oop5.magic.php\n\nCHAPTERS\n00:00 - Magic methods\n00:49 - __get & __set\n05:21 - __isset & __unset\n07:45 - __call & __callStatic\n11:51 - __toString\n13:45 - __invoke\n15:08 - __debugInfo', '00:00:00', 'nCxnzj83poQ', 'video/youtube', 'https://i.ytimg.com/vi/nCxnzj83poQ/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-04-27 06:11:07'),
(519, 519, '2022-10-20 02:08:26', '2022-10-20 02:08:26', '4W5t8g3Rp_0', 'What Is Late Static Binding & How It Works In PHP - Full PHP 8 Tutorial', 'In this video, you\'ll learn what early & late binding are as well as what late static binding is. By the end of this video, you will also know the problem with statics when it comes to inheritance & how late static binding solves that problem. \n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.13\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nLesson About Static Properties & Constants - https://youtu.be/6VVN-2SCx7Q\nResources - https://www.php.net/manual/en/language.oop5.late-static-bindings.php', '00:00:00', '4W5t8g3Rp_0', 'video/youtube', 'https://i.ytimg.com/vi/4W5t8g3Rp_0/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-04-29 06:59:59');
