(520, 520, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'PMruqUC4Qpc', 'PHP Traits - How They Work & Drawbacks - Full PHP 8 Tutorial', 'In this video, you will learn all you need to know about traits in PHP with examples & in-depth explanations. You\'ll learn what problems traits solve as well as the problems it can introduce. \n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.14\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nhttps://www.php.net/manual/en/language.oop5.traits.php\n\nCHAPTERS\n00:00 - Intro\n00:27 - Multiple inheritance problem\n02:02 - Overview of coffee maker example in code\n03:08 - Using interfaces instead of multiple inheritance\n05:43 - Creating & using traits\n08:22 - How do traits work?\n08:39 - Method precedence\n11:02 - Conflict resolution (\"insteadof\" & \"as\" operators)\n13:38 - Changing visibility of trait methods\n16:02 - Composing traits from other traits\n16:46 - Properties within traits\n20:40 - Abstract methods in traits\n23:19 - Static properties & methods in traits\n25:38 - Magic __CLASS__ constant in traits\n26:13 - Personal opinion & downsides of traits\n28:46 - Example comparing inheritance & traits', '00:00:00', 'PMruqUC4Qpc', 'video/youtube', 'https://i.ytimg.com/vi/PMruqUC4Qpc/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-05-10 09:50:27'),
(521, 521, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'zQ4Znj3RT3E', 'PHP Anonymous Classes - Full PHP 8 Tutorial', 'In this lesson, you will learn what anonymous classes are in PHP, how to create & use them. Anonymous classes like anonymous functions are nameless. You are able to create one-off objects using anonymous classes. You can either assign an anonymous class to a variable that will simply give you the object of that anonymous class, or just pass it as an argument since it\'s just an expression.\n\nNote that at 4:54 I copied constructor promoted properties & pasted them into the anonymous class. Promoted properties should not be used inside an anonymous class when you are extending from a base class since those already exist on the base class.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.15\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nAnonymous Classes RFC - https://wiki.php.net/rfc/anonymous_classes', '00:00:00', 'zQ4Znj3RT3E', 'video/youtube', 'https://i.ytimg.com/vi/zQ4Znj3RT3E/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-05-13 10:20:00'),
(522, 522, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'zCGmZb3z-r8', 'PHP Variable Storage & Object Comparison - Zend Value (zval) - Full PHP 8 Tutorial', 'In this lesson, you will learn what happens when two objects are compared for equality with either comparison operator (==) or identity operator (===). You will also get an introduction of PHP\'s internals on what happens when variables are created, a brief introduction to zval (zend value) container, and so on.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.16\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nCHAPTERS\n00:00 - Object Comparison\n04:01 - How variables & objects are stored in PHP & what is zval (zend value) data structure\n07:21 - Circular relations & nested object comparison', '00:00:00', 'zCGmZb3z-r8', 'video/youtube', 'https://i.ytimg.com/vi/zCGmZb3z-r8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-05-18 01:35:11'),
(523, 523, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'hdDD0SNJ-pk', 'PHP DocBlock - Adding Comments to Classes & Methods - Full PHP 8 Tutorial', 'In this lesson, you will learn another type of comment called DocBlock which can be used to provide additional information about a class, method, property, constant, etc.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.17\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nhttps://docs.phpdoc.org/3.0/guide/guides/docblocks.html\n\nCHAPTERS\n00:00 - DocBlock\n00:48 - @param & @return tags\n02:29 - @throws tag\n02:54 - @var tag\n04:56 - @property & @method tags\n07:19 - Personal opinion/preference', '00:00:00', 'hdDD0SNJ-pk', 'video/youtube', 'https://i.ytimg.com/vi/hdDD0SNJ-pk/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-05-21 08:23:16'),
(524, 524, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'vLmIoy6Bnog', 'PHP - Object Cloning & Clone Magic Method - Full PHP 8 Tutorial', 'In this lesson, you will learn how to clone objects & the magic method that gets called after an object has been cloned in PHP.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.18\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nLesson 2.16 Comparing Objects - https://youtu.be/zCGmZb3z-r8', '00:00:00', 'vLmIoy6Bnog', 'video/youtube', 'https://i.ytimg.com/vi/vLmIoy6Bnog/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-05-24 07:40:29'),
(525, 525, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'Jnm2m_Iw5CI', 'PHP Serialize Objects & Serialize Magic Methods - Full PHP 8 Tutorial', 'In this lesson, you will learn what serialization is, how to serialize different types of values including objects, how to unserialize them & how to work with the given magic methods related to serialization. Covers __sleep & __wakeup as well as __serialize & __unserialize magic methods.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.19\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nLesson 2.16 Comparing Objects - https://youtu.be/zCGmZb3z-r8\nLesson 2.18 Object Cloning - https://youtu.be/vLmIoy6Bnog\nObject serialization RFC - https://wiki.php.net/rfc/custom_object_serialization\nDeprecating serializable interface RFC - https://wiki.php.net/rfc/phase_out_serializable\n\nCHAPTERS\n00:00 - Serialization\n01:12 - Serializing objects\n04:07 - Serializing boolean false & return false on failed unserialization\n05:11 - Magic methods intro & Serializable interface\n06:21 - __sleep & __wakeup magic methods\n07:44 - __serialize & __unserialize magic methods', '00:00:00', 'Jnm2m_Iw5CI', 'video/youtube', 'https://i.ytimg.com/vi/Jnm2m_Iw5CI/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-05-29 10:31:57'),
(526, 526, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'XQ5Pd-6Hnjk', 'OOP Error Handling In PHP - Exceptions & Try Catch Finally Blocks - Full PHP 8 Tutorial', 'In the first section of the course, we covered error handling, in this lesson you will learn how to handle exceptions which are the OOP way of handling errors. You\'ll learn how to throw & catch exceptions, how to create custom exceptions. How to use exception handler, different types of exceptions & PHP\'s built-in errors, and so on.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.20\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nLesson 1.7 Float Data Type - https://youtu.be/d3c_OOD4Jzs\nLesson 1.28 Basic Error Handling - https://www.youtube.com/watch?v=rQntgj7yink\nSPL Exceptions - https://www.php.net/manual/en/spl.exceptions.php\nGlobal Exception Handler - https://www.php.net/manual/en/function.set-exception-handler.php\nError Hierarchy - https://www.php.net/manual/en/language.errors.php7.php\n\nCHAPTERS\n00:00 - What are exceptions\n01:15 - Throwing exceptions\n04:34 - Custom exceptions\n07:15 - Catching exceptions (try/catch)\n11:21 - Finally block & how return statements work from try, catch & finally blocks\n14:12 - Global exception handler, error hierarchy & changes in error reporting in PHP 7 & PHP 8\n17:50 - When to use exceptions\n18:49 - Domain-specific exception class with static methods to throw specific exceptions', '00:00:00', 'XQ5Pd-6Hnjk', 'video/youtube', 'https://i.ytimg.com/vi/XQ5Pd-6Hnjk/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-06-01 03:41:52'),
(527, 527, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'hkTQkaFzEEo', 'PHP - DateTime Object - Full PHP 8 Tutorial', 'In this lesson, you will learn how to work with dates & times in Object-Oriented PHP using date classes such as DateTime, DateTimezone, DateInterval, DatePeriod, & DateTimeImmutable. You will learn how to add, subtract, compare & change dates as well as calculate differences. You will learn what to look out for and potential bugs when working with DateTime & DateInterval objects & how to solve such issues.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.21\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nLesson 1.25 Working with dates procedural way using date & time functions - https://youtu.be/Zf9MWSUKpVM\nLesson 2.16 Object Comparison & how objects are stored (zval container) - https://youtu.be/zCGmZb3z-r8\nCarbon PHP Library - https://carbon.nesbot.com/docs/\nDateTime docs - https://www.php.net/manual/en/book.datetime.php\nDocs for strtotime function & differences between dashes, slashes & periods when parsing dates -  https://www.php.net/manual/en/function.strtotime.php\nSupported date & time formats - https://www.php.net/manual/en/datetime.formats.php\nDate interval formats - https://www.php.net/manual/en/dateinterval.format.php\nDate interval construct (duration formats) - https://www.php.net/manual/en/dateinterval.construct.php\nDate period - https://www.php.net/manual/en/class.dateperiod.php\n\nCHAPTERS\n00:00 - Creating datetime objects\n01:21 - Working with timezones & formatting dates - setTimezone(), getTimezone(), format()\n03:43 - Change date & time on datetime objects - setDate(), setTime()\n05:53 - Create datetime objects from specific formats - DateTime::createFromFormat()\n10:28 - Compare dates\n11:43 - Calculate difference between two dates & DateInterval class\n16:03 - Add & subtract dates\n17:26 - Problem with DateTime object when modifying dates & times & how to solve it\n20:47 - Immutable datetime objects\n22:21 - Iterating over dates in a period - DatePeriod class\n24:34 - Intro to Carbon date library', '00:00:00', 'hkTQkaFzEEo', 'video/youtube', 'https://i.ytimg.com/vi/hkTQkaFzEEo/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-06-07 10:23:45'),
(528, 528, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'QFPP9B-Q3zM', 'PHP Iterators & Iterable Type - Iterate Over Objects - Full PHP 8 Tutorial', 'In this lesson, you will learn what iterators are & how to work with them in PHP. It may sound scary but it\'s actually pretty simple. With iterators you can define how you want your objects to be iterated on, by default when you iterate over objects in PHP it will iterate on visible properties on the object but sometimes you may want to iterate on a specific property of the object instead. Learn what Iterator, IteratorAggregate & Traversable interfaces are, what iterable data type is & how to implement a basic collection pattern that you might be familiar with from frameworks like Laravel.\r\n\r\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.22\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\r\n\r\nRESOURCES\r\nhttps://www.php.net/manual/en/language.oop5.iterations.php\r\nhttps://www.php.net/manual/en/language.types.iterable.php\r\nhttps://www.php.net/manual/en/class.iterator.php\r\nhttps://www.php.net/manual/en/spl.iterators.php\r\nhttps://www.php.net/manual/en/class.iteratoraggregate.php\r\n\r\nCHAPTERS\r\n00:00 - Iterating over objects\r\n01:33 - Traversable, Iterator & IteratorAggregate interfaces\r\n02:11 - Implement simple collection class using Iterator interface\r\n07:50 - SPL iterators & refactoring collection to use IteratorAggregate interface\r\n10:26 - Iterable type & type-hinting', '00:00:00', 'QFPP9B-Q3zM', 'video/youtube', 'https://i.ytimg.com/vi/QFPP9B-Q3zM/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-06-10 06:28:52'),
(529, 529, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'CF7Yy5cPFVM', 'PHP Superglobals - Basic Routing Using The Server Info - Full PHP 8 Tutorial', 'In this lesson, you will learn what superglobals are & learn the $_SERVER superglobal, how & when to use it, and so on. We will also build a basic routing using the information we get from the $_SERVER superglobal and we\'ll refactor & improve it in the next lesson where you will learn about $_POST, $_GET & $_REQUEST superglobals.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.23\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nhttps://www.php.net/manual/en/language.variables.superglobals.php\nhttps://www.php.net/manual/en/reserved.variables.server.php\n\nCHAPTERS\n00:00 - Superglobals & $_SERVER superglobal\n02:25 - Building basic routing', '00:00:00', 'CF7Yy5cPFVM', 'video/youtube', 'https://i.ytimg.com/vi/CF7Yy5cPFVM/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-06-14 05:55:06'),
(530, 530, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'JdrvETQCAGw', 'Get & Post Superglobals In PHP - Forms - Post Routes - Full PHP 8 Tutorial', 'In this lesson, you will learn how to access the request data via $_GET & $_POST superglobals as well as the dangers of the $_REQUEST superglobal. We\'ll also improve the basic routing that we built in the previous lesson & add support for POST requests.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.24\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nhttps://www.php.net/manual/en/reserved.variables.get.php\nhttps://www.php.net/manual/en/reserved.variables.post.php\nhttps://www.php.net/manual/en/reserved.variables.request.php\n\nCHAPTERS\n00:00 - $_GET, $_POST & $_REQUEST superglobals\n06:28 - Improving router class to support post requests', '00:00:00', 'JdrvETQCAGw', 'video/youtube', 'https://i.ytimg.com/vi/JdrvETQCAGw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-06-18 03:32:22'),
