(533, 533, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'QiO0uUwOiBg', 'PHP MVC Pattern - View Parameters Exploit - Full PHP 8 Tutorial', 'In this lesson, you will learn what the MVC pattern is, how it works and we will implement the basic parts of the MVC pattern. We\'ll refactor our existing code from previous lessons to use controllers & then implement views. We\'ll explore how an attacker could exploit certain functions/approaches that developers may take to gain access to sensitive information like database credentials & so on.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.27\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nCHAPTERS\n00:00 - What is MVC\n04:30 - Implementing basic MVC (Controllers & Views)\n12:31 - Layout support (exercise)\n14:46 - Pass params from the controller to views using variable variables or extract function\n17:26 - Potential exploit with variable variables & extract function\n19:55 - Overview of Models\n21:02 - Where does validation belong, in Model or Controller?', '00:00:00', 'QiO0uUwOiBg', 'video/youtube', 'https://i.ytimg.com/vi/QiO0uUwOiBg/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-06-28 08:48:39'),
(534, 534, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'W7tj0Qlk3rE', 'HTTP Headers In PHP - Request & Response Headers - Full PHP 8 Tutorial', 'In this lesson, you will learn the basics of HTTP headers, HTTP messages, HTTP response status codes, the structure of request & response, and more. We\'ll send a 404 status header when a non-existing page is visited, you\'ll learn how to redirect users & send appropriate headers to download a file.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.28\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nVideo About Sessions & Cookies - https://youtu.be/6vM-9ou1ARo\nhttps://www.php.net/manual/en/function.header.php\nhttps://developer.mozilla.org/en-US/docs/Web/HTTP/Headers\nhttps://developer.mozilla.org/en-US/docs/Web/HTTP/Status', '00:00:00', 'W7tj0Qlk3rE', 'video/youtube', 'https://i.ytimg.com/vi/W7tj0Qlk3rE/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-07-01 06:10:38'),
(535, 535, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'mSnte-Ovm10', 'Intro To MySQL For PHP - Full PHP 8 Tutorial', 'In this lesson, you will learn the basics of MySQL because you will need MySQL to work on websites, web apps & the project in the third section of this course. This lesson covers just the very basics of MySQL, but that should be enough to get you started & prepared with databases & MySQL.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.29\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nVideo About Setting Up Docker - https://youtu.be/I_9-xWmkh28\nhttps://dev.mysql.com/downloads/workbench/\nhttps://dev.mysql.com/doc/refman/8.0/en/tutorial.html\nhttps://dev.mysql.com/doc/refman/8.0/en/data-types.html\n\nYou can use this source to see the Dockerfile & docker-compose (it\'s from lesson 2.33): https://github.com/ggelashvili/learnphptherightway-project/tree/2.33\n\nCHAPTERS\n00:00 - Intro\n00:59 - Install MySQL with Docker\n03:18 - Show list of databases & create a database\n04:06 - Using MySQL Workbench\n05:42 - Creating tables, running queries, foreign keys, joins, etc', '00:00:00', 'mSnte-Ovm10', 'video/youtube', 'https://i.ytimg.com/vi/mSnte-Ovm10/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-07-08 02:38:42'),
(536, 536, '2022-10-20 02:08:26', '2022-10-20 02:08:26', 'wcD5HlEHrnc', 'PHP PDO Tutorial Part 1 - Prepared Statements - SQL Injection - Full PHP 8 Tutorial', 'In this lesson, you will learn how to connect to the database from PHP using PHP Data Objects or in short PDO. PDO provides data access layer abstraction where common methods can be used to interact with different databases like MySQL, SQLite, and so on. You will learn about prepared statements, what SQL injection is & how it works, how to prevent SQL injection, learn about the difference between binding params by value or by reference, the difference between placeholders & named parameters, emulated prepares & so on.\n\nNOTE: If you have concerns/questions about 15:28 please watch the beginning of Part 2 of the PDO lesson, I address & explain there. This is just a debug query & to save an extra line I decided to pass an integer directly to the query. I don\'t recommend you do that, even though this particular example has no SQL Injection vulnerability, someone might make a mistake & introduce the vulnerability. https://www.youtube.com/watch?v=e6yLUvpcOZo\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.30\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nhttps://www.php.net/manual/en/book.pdo.php\nhttps://www.php.net/manual/en/pdo.connections.php\nhttps://www.php.net/manual/en/pdo.error-handling.php\nhttps://www.php.net/manual/en/class.pdo.php\nhttps://www.php.net/manual/en/class.pdostatement.php\nhttps://www.php.net/manual/en/pdo.constants.php\nhttps://www.php.net/manual/en/ref.pdo-mysql.php\nhttps://github.com/php/php-src/blob/master/ext/pdo/pdo_stmt.c#L319\n\nCHAPTERS\n00:00 - Intro\n01:12 - Install/enable PDO MySQL\n02:45 - PDO connection\n05:52 - Error modes\n06:34 - Run queries & fetch data\n07:36 - Fetch modes\n09:14 - Prepared statements & SQL injection\n10:12 - SQL injection example\n13:43 - Placeholders, named parameters & the difference between them\n18:03 - Bind parameters using bindValue & bindParam\n22:18 - Emulated prepares', '00:00:00', 'wcD5HlEHrnc', 'video/youtube', 'https://i.ytimg.com/vi/wcD5HlEHrnc/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-07-16 05:37:27'),
