(670, 670, '2022-10-20 11:23:08', '2022-10-20 11:23:08', '5jskrkouoA8', 'Anet A8 - 5 essential printable upgrades for beginners', 'UPDATE: Do not use the lead screw caps and the T-braces. instead use the Hulk frame upgrade for frame stiffness. Go watch my video about it here : \nhttps://youtu.be/NIxGJ5ZkCh8\n\nIn this video, I am showing the most essential printable upgrades for your Anet A8 printer when you are just getting started printing and modifying your printer in 2018. All these upgrades do not require any additional hardware to be aquired.\n\n*** Get the Anet A8 here\nAmazon:\nhttps://amzn.to/2E9gEZa\nGearbest:\nhttps://www.gearbest.com/3d-printers-3d-printer-kits/pp_991324.html?wid=1433363&lkid=17621503\n\n*** A note to my my subscribers and viewers\n\nDear subscribers and viewers, you definitely have the most influence on this channel\'s content and I am really happy about any feedback and discussions with you in the comment section down below. Also if you like me to cover a specific topic more in depht, please tell me, so I will put it on my bucket list. This channel is about making you, the subscribers and viewers more succesful in 3d printing. So please consider subscribing to my channel and also hit the bell to get notified every time I post a new video.\n\n*** Links:\n\nModified Fan Duct\nhttps://www.thingiverse.com/thing:2322182\n\nT Corner frame braces for vertical frame stability\nhttps://www.thingiverse.com/thing:1672959\n\nExtruder button with filament guide\nhttps://www.thingiverse.com/thing:2551294\n\nAnti Z-Wobble lead screw support\nhttps://www.thingiverse.com/thing:2121017\n\nx-Axis Leveling Tool\nhttps://www.thingiverse.com/thing:3013108\n\nFront Frame Brace\nhttps://www.thingiverse.com/thing:1857991\n\nRear Frame Brace\nhttps://www.thingiverse.com/thing:1852358\n\nBlue Painters Tape to cover your printbed\nhttps://amzn.to/2EhHTku\n\nThe really wide blue tape, less stripes\nhttps://amzn.to/2IikkMj\n\nTHE PRINTERS I USE: https://kit.co/danielcrosslink/the-3d-printers-i-use\nMY MERCH: https://crosslink.io/shop\n\nBECOME A PATRON: https://www.patreon.com/crosslink\nCHAT ON DISCORD: https://discord.gg/ne3J4Rf\n\nBUSINESS INQUIRIES ONLY (OR IF YOU WANT TO SEND SOMETHING) - DANIEL@CROSSLINK.IO\n\nFOLLOW ME:\nINSTAGRAM - https://instagram.com/danielcrosslink\nTWITTER - https://twitter.com/danielcrosslink\nFACEBOOK - https://facebook.com/danielcrosslink\nWEBSITE: https://crosslink.io\n\nThe Music I use: https://crosslink.io/es, AMAZING for YouTubers!\n\nGEAR USED\nhttps://kit.co/danielcrosslink/my-video-gear\n\nDisclaimer: As an Amazon Associate I earn from qualifying purchases.', '00:00:00', '5jskrkouoA8', 'video/youtube', 'https://i.ytimg.com/vi/5jskrkouoA8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCxytNNPtemfYjvq2TQJC2Fw', '2019-02-13 09:00:36');
