(673, 673, '2022-10-20 11:23:08', '2022-10-20 11:23:08', '38PkynA1uGI', 'Anet A8 (Plus) Marlin 2.0 Installation Upgrade', 'Anet A8 (Plus) Marlin 2.0 Installation Upgrade\n\nIn this video, I show you how to install Marlin 2.0 firmware on the Anet A8 or the Anet A8 plus using Visual Studio Code and Platform IO as well as the new Auto Build Marlin plugin, which makes this a much easier process. Also you will see some troubleshooting tips.\n\nRead the blogpost here, if you prefer a written version: https://www.crosslink.io/2020/03/19/anet-a8-plus-marlin-2-0-installation-upgrade/\n\n*** Get the Anet A8 here\nüõí Amazon: https://geni.us/aneta8\n\n*** Videos referred to in this video:\nShould you upgrade to Marlin 2.0?\nhttps://youtu.be/rjRmBbuN6iA\n\nHow to install a bootloader on the Anet A8 using an Arduino UNO\nhttps://youtu.be/RQIizXtf9oo\n\nHow to install a bootloader on the Anet A8 using a programmer device\nhttps://youtu.be/wRODgnAqp1A\n\nHow to use Mesh Bed Leveling on the Anet A8\nhttps://youtu.be/ADdzKyS-T3w\n\nMy blogpost about memory usage of Marlin on 8Bit boards and how to fix size issues\nhttps://www.crosslink.io/marlin-2-0-memory-usage-by-feature/\n\n*** Programmer devices for flashing a bootloader\nUSBAsp\nhttps://geni.us/usbasp\n\nUSBTinyISP\nhttps://geni.us/usbtinyisp\n\n10 pin to 6 pin adapter\nhttps://geni.us/10to6pinadapter\n\n*** Software links\nMarlin firmware\nhttps://github.com/MarlinFirmware/Marlin\n\nMarlin Default Configuration Files\nhttps://github.com/MarlinFirmware/Configurations\n\nVisual Studio Code\nhttps://visualstudio.microsoft.com/\n\nTHE PRINTERS I USE: https://kit.co/danielcrosslink/the-3d-printers-i-use\nMY MERCH: https://crosslink.io/shop\n\nBECOME A PATRON: https://www.patreon.com/crosslink\nCHAT ON DISCORD: https://discord.gg/ne3J4Rf\n\nBUSINESS INQUIRIES ONLY (OR IF YOU WANT TO SEND SOMETHING) - DANIEL@CROSSLINK.IO\n\nFOLLOW ME:\nINSTAGRAM - https://instagram.com/danielcrosslink\nTWITTER - https://twitter.com/danielcrosslink\nFACEBOOK - https://facebook.com/danielcrosslink\nWEBSITE: https://crosslink.io\n\nThe Music I use: https://crosslink.io/es, AMAZING for YouTubers!\n\nGEAR USED\nhttps://kit.co/danielcrosslink/my-video-gear\n\nDisclaimer: As an Amazon Associate I earn from qualifying purchases.', '00:00:00', '38PkynA1uGI', 'video/youtube', 'https://i.ytimg.com/vi/38PkynA1uGI/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCxytNNPtemfYjvq2TQJC2Fw', '2021-10-03 01:40:37'),
(674, 674, '2022-10-20 11:23:08', '2022-10-20 11:23:08', 'O79skgl8uzc', 'Dial-in, Calibrate, & Upgrade your ANET A8 3D Printer', 'How to dial-in the settings, nozzle and bed temperature, and upgrades to my ANET A8.\n\nZ Axis Fine Tuner Remix\nhttps://www.thingiverse.com/thing:2571816\n\nExtruder Filament Guide\nhttps://www.thingiverse.com/thing:2572454\n\nExtra Short Hesine M505 Cooling Nozzle\nhttps://www.thingiverse.com/thing:2572459\n\nAnet A8 Bed Leveling Knob\nhttps://www.thingiverse.com/thing:2395388\n\nY Axis Pulley Insert\nhttps://www.thingiverse.com/thing:2138421\n\nX Axis Pulley Insert\nhttps://www.thingiverse.com/thing:2250616', '00:00:00', 'O79skgl8uzc', 'video/youtube', 'https://i.ytimg.com/vi/O79skgl8uzc/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCxytNNPtemfYjvq2TQJC2Fw', '2021-10-03 01:52:27'),
(675, 675, '2022-10-20 11:23:08', '2022-10-20 11:23:08', 'N_ZIukfpw5M', 'How I Made Money Running My Automated Ender 3, 3D Printer For Months Non Stop!', 'I wanted to see if my Ender 3 3d printer would handle continuous production, so I designed a small product that I could sell. This video takes a look at my product from a design, production, and financial angle. In my example, you can see some of the pros and cons of using a 3d printer for production.\n\n-----\nEtsy Item Listing: https://www.etsy.com/listing/877571486/sweepy-drink-coaster-oxygen-not-included?ref=SellerDashboard\n\nMake/modify this thing in CAD: https://learn.watchitprint.com/courses/Design-Assemblies-Multi-Body-Part-Workflow-Class-Fusion-360\n\nSLT Files: https://www.myminifactory.com/object/3d-print-128879\n\nBOM (Affiliate): https://www.amazon.com/ideas/amzn1.account.AFVEVXFK3H7YCB4JX637C7NNNYHA/1AWI1HL7M8QYZ\n-----\nTitle: How I Made Money Running My Automated Ender 3, 3D Printer For Months Non Stop!\n#ender3 #3dprinting #Money', '00:00:00', 'N_ZIukfpw5M', 'video/youtube', 'https://i.ytimg.com/vi/N_ZIukfpw5M/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCxytNNPtemfYjvq2TQJC2Fw', '2021-10-03 01:54:53'),
(676, 676, '2022-10-20 11:23:08', '2022-10-20 11:23:08', 'gUr6kaOaRzo', 'How to install a bed leveling sensor on your Anet A8', 'In this video, I show how to install a bed leveling sensor on your Anet A8 3D printer in a few easy steps.\n\n*** Get the Anet A8 here\nAmazon:\nhttps://amzn.to/2E9gEZa\nGearbest:\nhttps://www.gearbest.com/3d-printers-3d-printer-kits/pp_991324.html?wid=1433363&lkid=17621503\n\n*** Links:\n\n3D Print Wiki to start\nhttps://3dprint.wiki/reprap/anet/a8/improvement/autobedleveling\nhttps://3dprint.wiki/reprap/anet/a8\n\n*** Capacitive bed level sensor (LJC18A3-H-Z/BX)\n   eBay: \n   https://www.ebay.com/sch/i.html?_from=R40&_trksid=p2380057.m570.l1313.TR1.TRC0.A0.H0.XLJC18A3-H-Z%2FBX.TRS0&_nkw=LJC18A3-H-Z%2FBX&_sacat=0\n\n   eBay with JST connector for Anet A8:\n   https://www.ebay.com/sch/i.html?_from=R40&_trksid=p2334524.m570.l1313.TR1.TRC0.A0.H0.XLJC18A3-H-Z%2FBX+anet.TRS0&_nkw=LJC18A3-H-Z%2FBX+anet&_sacat=0&LH_TitleDesc=0&_osacat=0&_odkw=LJC18A3-H-Z%2FBX\n\n   Amazon:\n   https://amzn.to/2DQFjAw\n\n*** Sensor holder to print out (Do this before any other mod!)\nFront mounting:\nhttps://www.thingiverse.com/thing:1852762\nBack mounting:\nhttps://www.thingiverse.com/thing:2368157\n\n\n*** Marlin Configuration.h file download:\n   https://1drv.ms/u/s!At2kGv0IrYz9t_MX87qwuUtu4Dz01g\n\n*** Start GCode Sequence for Bed Leveling (do not copy this line)\n\nG21 ;metric values\nG90 ;absolute positioning\nM82 ;set extruder to absolute mode\nM107 ;start with the fan off\nG28 ;move X/Y/Z to min endstops\nG29 ;auto level\nG1 Z15.0 F9000 ;move the platform down 15mm\nG92 E0 ;zero the extruded length\nG1 F200 E3 ;extrude 3mm of feed stock\nG92 E0 ;zero the extruded length again\nG1 F9000\n;Put printing message on LCD screen\nM117 Printing...\n\n*** End of GCode sequence (do not copy this line)\n\nTHE PRINTERS I USE: https://kit.co/danielcrosslink/the-3d-printers-i-use\nMY MERCH: https://crosslink.io/shop\n\nBECOME A PATRON: https://www.patreon.com/crosslink\nCHAT ON DISCORD: https://discord.gg/ne3J4Rf\n\nBUSINESS INQUIRIES ONLY (OR IF YOU WANT TO SEND SOMETHING) - DANIEL@CROSSLINK.IO\n\nFOLLOW ME:\nINSTAGRAM - https://instagram.com/danielcrosslink\nTWITTER - https://twitter.com/danielcrosslink\nFACEBOOK - https://facebook.com/danielcrosslink\nWEBSITE: https://crosslink.io\n\nThe Music I use: https://crosslink.io/es, AMAZING for YouTubers!\n\nGEAR USED\nhttps://kit.co/danielcrosslink/my-video-gear\n\nDisclaimer: As an Amazon Associate I earn from qualifying purchases.', '00:00:00', 'gUr6kaOaRzo', 'video/youtube', 'https://i.ytimg.com/vi/gUr6kaOaRzo/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCxytNNPtemfYjvq2TQJC2Fw', '2021-10-03 01:55:03'),
(677, 677, '2022-10-20 11:23:08', '2022-10-20 11:23:08', 'oWRV4Bbq0Ic', 'ANET A8 Plus Assembly Guide, Setup, Review, Easy Upgrades (STLs Included). Is This Printer Worth It?', 'The ANET A8 Plus is an entry level printer and its smaller predecessor, the A8, had been based on the Prusa i3 machines. The A8 plus adds volume with a build size of 300mm x 300mm x 350mm which is quite generous considering the low cost of this machine. \n\nThe frame is an all metal extrusion construction making it very stable and stiff. It comes with a direct drive extruder, heated print bed, and simple LCD screen. \n\nOverall this kit is fairly simple to assemble, however, it will take you some time to do. Pay close attention to the details while assembling to get the most of out of your printer later. Also, keep a close watch on the quality of parts as you are likely to get some sub-par quality parts in a kit with a price this low. Don\'t expect a turn key printer out of the box, and do expect to have to get creative at times.\n\nMy biggest complaints about this machine is the lack of strain relief, no wire management, and lack of grommets for wires passing through metal enclosures. The heated bed connector and cable is also inadequate for the application. I would be happy to pay more for a printer that addresses these issues. I have tried to rectify some of these problems with my own design files that you can find here:\n\n‚ñ∫ https://www.thingiverse.com/thing:4929130\n\nThat being said, this printer prints surprisingly well if you take good care in setting it up properly. The direct drive extruder meters filament well, and small details come out sharp in fine prints. The simplicity of the machine makes it a good candidate for fun and simple future upgrades and would be a good platform to build your knowledge of 3D printing. \n\nI did not include slicer settings in this video but you should be able to find slicer profiles for A8 machines online quite easily. It is a very popular platform. You can also start with other generic printer profiles from other popular machines like the Creality machines. Select a Creality machine with a direct drive extruder and get that slicer profile... adjust the printer dimensions and you should have something that works nicely.\n\nI would recommend this machine for beginners and advanced users alike. In either case you would be looking for a hobby printer and a project, not a ready to use tool. If you are looking for a more straightforward experience in getting printing, I would suggest the ANET ET5X as it is much easier to assemble and the print quality is also good. The overall machine is more well thought out than the A8 and is only slightly more expensive. \n\nANET A8 Plus. As an Amazon Associate I earn from qualifying purchases (at no extra cost to you):\nhttps://amzn.to/3PP71Bk\n\nIf you have any questions about the assembly, the printer, etc, please post your comments in the comment section down below. I try and get back to everyone. \n\nThanks for watching!\n\n#3DPRINTER #DIY #MAKER\n\n\n****************************************************************\n\nIf you enjoy and have benefited from my content and are feeling generous I would love your support! You can \"buy me a coffee\" here:\n\n‚ñ∫ https://www.paypal.com/donate/?hosted_button_id=V2T6MEFUGP73Y\n\nBy supporting my channel you are encouraging me to continue with this time consuming endeavor. A lot of time goes into design work, building my projects, filming the videos, editing the videos, etc. Plus it all costs money! Your generosity goes a long way in helping me bring you better content as often as I can!\n\nFollow me on Instagram!\n\n‚ñ∫ https://www.instagram.com/embracemaking/\n\nIf you liked this video, perhaps you will also enjoy some channels that I personally find inspiring and interesting...\n\nDIY and MAKER:\n\n‚ñ∫ The Hacksmith\nhttps://www.youtube.com/channel/UCjgpFI5dU-D1-kh9H1muoxQ\n\n‚ñ∫ Adam Savage Tested\nhttps://www.youtube.com/channel/UCiDJtJKMICpb9B1qf7qjEOA\n\n‚ñ∫ Thomas Sanladerer\nhttps://www.youtube.com/user/ThomasSanladerer', '00:00:00', 'oWRV4Bbq0Ic', 'video/youtube', 'https://i.ytimg.com/vi/oWRV4Bbq0Ic/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCxytNNPtemfYjvq2TQJC2Fw', '2021-10-03 01:57:22'),
(678, 678, '2022-10-20 17:38:31', '2022-10-20 17:38:31', 'o4V7p5Nbfho', '# 01 - PHP - MySQL - Sistema de Agenda - Criando o Banco de dados', 'Fala pessoal, beleza!!  Neste curso eu demonstro como usar o PHP com banco de dados MySQL vou criar um sistema do zero de agenda de contatos, tarefas e eventos.   O sistema √© bem b√°sico e a programa√ß√£o √© estruturada pois √© justamente para ser simples e did√°tico para servir de refer√™ncia para iniciantes em programa√ß√£o PHP. \nNesta primeira aula eu fa√ßo uma pequena apresenta√ß√£o do projeto e crio uma parte do banco de dados do sistema.\nValeu pessoa espera que gostem.\n#php #mysql #tutorial #programa√ß√£o #sistema #web #desenvolvimento', '00:00:00', 'o4V7p5Nbfho', 'video/youtube', 'https://i.ytimg.com/vi/o4V7p5Nbfho/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCiBmGa3FBBVX-HdtMUuJ3Uw', '2020-09-15 12:05:29'),
(679, 679, '2022-10-20 17:38:31', '2022-10-20 17:38:31', '4CHhA-DSXgc', '# 02 - PHP - MySQL - Sistema de Agenda - Estruturas de Pastas', 'Nesta aula vou criar a estrutura de pastas que o nosso projeto vai seguir e a p√°gina index do sistema.\n\n#php #mysql #tutorial #programa√ß√£o #sistema #web #desenvolvimento', '00:00:00', '4CHhA-DSXgc', 'video/youtube', 'https://i.ytimg.com/vi/4CHhA-DSXgc/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCiBmGa3FBBVX-HdtMUuJ3Uw', '2020-09-15 12:35:17'),
(680, 680, '2022-10-20 17:38:31', '2022-10-20 17:38:31', 'KW280PFLhBY', '# 03 - PHP - MySQL - Sistema de Agenda - Conex√£o com o Banco', 'Nesta aula vamos criar o arquivo de conex√£o com o banco dados MySQL para o nosso sistema de agenda.\n\n#php #mysql #tutorial #bootstrap #programa√ß√£o #sistema #web #desenvolvimento', '00:00:00', 'KW280PFLhBY', 'video/youtube', 'https://i.ytimg.com/vi/KW280PFLhBY/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCiBmGa3FBBVX-HdtMUuJ3Uw', '2020-09-15 02:13:24'),
