(768, 768, '2022-10-20 19:15:08', '2022-10-20 19:15:08', 'KbuiyYBdH6I', 'Turning Hand Drawn Animations to 60 fps with AI', 'These are the results of testing the deep learning algorithm DAIN (Depth-Aware Video Frame Interpolation) that can detect movement patterns of a video or gif and increase the smoothness.\n\nDAIN code: https://github.com/baowenbo/DAIN\n\nSources:\n0:08 - https://www.pinterest.com/pin/326722147973085971/?nic_v2=1a2ivbD72\n0:24 - https://www.pinterest.com/pin/497999671274134128/?nic_v2=1a2ivbD72\n0:33 - https://www.pinterest.com/pin/203225001922207469/?nic_v2=1a2ivbD72\n0:47 - https://www.youtube.com/watch?v=FZSkFLJx4fE\n1:03 - https://www.pinterest.com/pin/172684966937777167/?nic_v2=1a2ivbD72\n1:19 - http://www.area-visual.com/2017/06/las-ilustraciones-y-animaciones-de-ana.html\n1:27 - https://www.pinterest.com/pin/11892386506206368/?nic_v2=1a2ivbD72\n1:50 - https://www.pinterest.com/pin/373024781629777053/?nic_v2=1a2ivbD72\n1:58 - https://www.pinterest.com/pin/743938432166613284/?nic_v2=1a2ivbD72\n2:14 - https://www.pinterest.com/pin/701998660637095224/?nic_v2=1a2ivbD72\n\n\n\n\n\n\n\n\n\n\n\n\n‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì\nNight Out by LiQWYD https://soundcloud.com/liqwyd\nCreative Commons ‚Äî Attribution 3.0 Unported  ‚Äî CC BY 3.0 \nFree Download / Stream: http://bit.ly/2BLdhW5\nMusic promoted by Audio Library https://youtu.be/tut9O8uaJho\n‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì‚Äì', '00:00:00', 'KbuiyYBdH6I', 'video/youtube', 'https://i.ytimg.com/vi/KbuiyYBdH6I/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC9w_QD38U3r4hRKq9u7f9Vg', '2020-12-28 05:38:21'),
