(780, 780, '2022-10-20 19:19:11', '2022-10-20 19:19:11', '-tyBEsHSv7w', 'Python Django Tutorial: Full-Featured Web App Part 12 - Email and Password Reset', 'In this Python Django Tutorial, we will be learning how we can use email to send a password reset link to a user so that the user can reset their password. Users will be able to fill out a form with their email and have a unique token sent to them, and if their token is verified then they will be able to create a new password. Let\'s get started...\n\nThe code for this series can be found at:\nhttps://github.com/CoreyMSchafer/code_snippets/tree/master/Django_Blog\n\nLocalhost Email Setup:\nhttps://docs.djangoproject.com/en/2.1/topics/email/#configuring-email-for-development\n\n\n‚úÖ Support My Channel Through Patreon:\nhttps://www.patreon.com/coreyms\n\n‚úÖ Become a Channel Member:\nhttps://www.youtube.com/channel/UCCezIgC97PvUuR4_gbFUs5g/join\n\n‚úÖ One-Time Contribution Through PayPal:\nhttps://goo.gl/649HFY\n\n‚úÖ Cryptocurrency Donations:\nBitcoin Wallet - 3MPH8oY2EAgbLVy7RBMinwcBntggi7qeG3\nEthereum Wallet - 0x151649418616068fB46C3598083817101d3bCD33\nLitecoin Wallet - MPvEBY5fxGkmPQgocfJbxP6EmTo5UUXMot\n\n‚úÖ Corey\'s Public Amazon Wishlist\nhttp://a.co/inIyro1\n\n‚úÖ Equipment I Use and Books I Recommend:\nhttps://www.amazon.com/shop/coreyschafer\n\n‚ñ∂Ô∏è You Can Find Me On:\nMy Website - http://coreyms.com/\nMy Second Channel - https://www.youtube.com/c/coreymschafer\nFacebook - https://www.facebook.com/CoreyMSchafer\nTwitter - https://twitter.com/CoreyMSchafer\nInstagram - https://www.instagram.com/coreymschafer/\n\n#Python #Django', '00:00:00', '-tyBEsHSv7w', 'video/youtube', 'https://i.ytimg.com/vi/-tyBEsHSv7w/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCCezIgC97PvUuR4_gbFUs5g', '2018-08-31 05:43:16'),
(781, 781, '2022-10-20 19:19:11', '2022-10-20 19:19:11', 'Sa_kQheCnds', 'Python Django Tutorial: Deploying Your Application (Option #1) - Deploy to a Linux Server', 'In this Python Django Tutorial, we will be learning how to deploy our application to a Linux Server from scratch using Linode.\n\nIf you would like $20 of free credit towards a Linode account, then you can use my link here to sign up: \nhttps://linode.com/coreyschafer\n\nWe will be covering the entire deployment of a Django application. This includes spinning up a new Linux Server and tightening its security with SSH keys and firewalls. Then we will install Apache and Mod_WSGI so that we can get our Django App running. Let\'s get started...\n\nTo skip the server setup, jump to 29:11\n\nHow to Run Linux/Bash on Windows: https://youtu.be/xzgwDbe7foQ\n\nSSH Key-Based Authentication Tutorial: https://youtu.be/vpk_1gldOAE\n\nSSH Keys on Windows: https://www.linode.com/docs/security/authentication/use-public-key-authentication-with-ssh/#windows\n\nApache config used in this video: https://github.com/CoreyMSchafer/code_snippets/blob/master/Django_Blog/snippets/django_project.conf\n\n\n‚úÖ Support My Channel Through Patreon:\nhttps://www.patreon.com/coreyms\n\n‚úÖ Become a Channel Member:\nhttps://www.youtube.com/channel/UCCezIgC97PvUuR4_gbFUs5g/join\n\n‚úÖ One-Time Contribution Through PayPal:\nhttps://goo.gl/649HFY\n\n‚úÖ Cryptocurrency Donations:\nBitcoin Wallet - 3MPH8oY2EAgbLVy7RBMinwcBntggi7qeG3\nEthereum Wallet - 0x151649418616068fB46C3598083817101d3bCD33\nLitecoin Wallet - MPvEBY5fxGkmPQgocfJbxP6EmTo5UUXMot\n\n‚úÖ Corey\'s Public Amazon Wishlist\nhttp://a.co/inIyro1\n\n‚úÖ Equipment I Use and Books I Recommend:\nhttps://www.amazon.com/shop/coreyschafer\n\n‚ñ∂Ô∏è You Can Find Me On:\nMy Website - http://coreyms.com/\nMy Second Channel - https://www.youtube.com/c/coreymschafer\nFacebook - https://www.facebook.com/CoreyMSchafer\nTwitter - https://twitter.com/CoreyMSchafer\nInstagram - https://www.instagram