(909, 909, '2022-10-21 12:41:46', '2022-10-21 12:41:46', 'mqbQmNnIwtg', 'Curso de Desenvolvimento Web com PHP e MySQL Aula 28 parte4 projeto final part1', 'Ol√° galera!\n\nEssa √© a primeira v√≠deo aula da quarta e √∫ltima parte deste curso.\nSer√° iniciado a confec√ß√£o do nosso projeto final: o aplicativo \'cadCliente\'.\n\nSeguem abaixo os scripts para cria√ß√£o e inser√ß√£o de alguns dados iniciais na base cadCliente. Qualquer d√∫vida postem ai. Lembrando que o banco deve ser criado primeiro para depois rodar este script. Pode ser executado no terminal de comandos logado como root ou no phpmyadmin pelo navegador. \n\nN√£o esque√ßam tamb√©m de rodar este comando ap√≥s criar a base \'cadCliente\': \n\nGRANT ALL ON cadCliente.* TO php_mysql@localhost IDENTIFIED BY \'12345\'; \n\nPara que o usu√°rio \'php_mysql\' tenha todos os privil√©gios com a base de dados cadCliente. \n\nAbaixo o script para criar as tabelas e popular as mesmas:\n--\n-- Banco de Dados: `cadCliente`\n--\n\n-- --------------------------------------------------------\n\n--\n-- Estrutura da tabela `cliente`\n--\n\nCREATE TABLE IF NOT EXISTS `cliente` (\n  `idCliente` int(11) NOT NULL AUTO_INCREMENT,\n  `nome` varchar(155) NOT NULL,\n  `endereco` varchar(255) NOT NULL,\n  `cep` char(10) NOT NULL,\n  `cidade` varchar(155) NOT NULL,\n  `uf` char(2) NOT NULL,\n  `ddd` char(2) NOT NULL,\n  `fone` varchar(10) NOT NULL,\n  `rg` varchar(100) NOT NULL,\n  `cpf` char(14) NOT NULL,\n  `email` varchar(155) NOT NULL,\n  `ocupacao` varchar(155) NOT NULL,\n  `sexo` char(1) NOT NULL,\n  `idade` char(10) NOT NULL,\n  `data_cad` date NOT NULL,\n  PRIMARY KEY (`idCliente`)\n) ENGINE=InnoDB  DEFAULT CHARSET=latin1 AUTO_INCREMENT=2 ;\n\n--\n-- Extraindo dados da tabela `cliente`\n--\n\nINSERT INTO `cliente` (`idCliente`, `nome`, `endereco`, `cep`, `cidade`, `uf`, `ddd`, `fone`, `rg`, `cpf`, `email`, `ocupacao`, `sexo`, `idade`, `data_cad`) VALUES\n(1, \'Fulano de Tal\', \'Rua dos Fulanos\', \'00.000-000\', \'Fulanolandia\', \'FL\', \'00\', \'0000-0000\', \'000 000 SSP/FL\', \'000.000.000-00\', \'fulano@fulanol.com\', \'√É¬° toa\', \'m\', \'26\', \'2014-10-10\');\n\n-- --------------------------------------------------------\n\n--\n-- Estrutura da tabela `usuario`\n--\n\nCREATE TABLE IF NOT EXISTS `usuario` (\n  `idUsuario` int(11) NOT NULL AUTO_INCREMENT,\n  `nome` varchar(155) NOT NULL,\n  `login` varchar(55) NOT NULL,\n  `senha` varchar(32) NOT NULL,\n  `tipo` char(2) NOT NULL,\n  `data_cad` date NOT NULL,\n  PRIMARY KEY (`idUsuario`)\n) ENGINE=InnoDB  DEFAULT CHARSET=latin1 AUTO_INCREMENT=3 ;\n\n--\n-- Extraindo dados da tabela `usuario`\n--\n\nINSERT INTO `usuario` (`idUsuario`, `nome`, `login`, `senha`, `tipo`, `data_cad`) VALUES\n(1, \'Administrador\', \'admin\', \'21232f297a57a5a743894a0e4a801fc3\', \'ad\', \'2014-10-10\'),\n(2, \'Usuario Comun\', \'usuario\', \'f8032d5cae3de20fcec887f395ec9a6a\', \'us\', \'2014-10-10\');\n\n-- --------------------------------------------------------', '00:00:00', 'mqbQmNnIwtg', 'video/youtube', 'https://i.ytimg.com/vi/mqbQmNnIwtg/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCxf6zVBRehIOAalsp-OJA8A', '2015-04-15 06:03:12'),
