(1002, 1002, '2022-10-24 16:58:26', '2022-10-24 16:58:26', 'heeXwJfadYM', 'OS MELHORES DONUTS DO MUNDO - MEGA MACIO - MUITO F√ÅCIL DE FAZER ROSQUINHA OU RECHEADO - DIKA DA NAKA', 'Oi meus queridos, tudo bem? ;) Hoje eu te ensino passo a passo todos os detalhes para fazer os famosos Donuts ou Rosquinhas americanas. Super f√°cil, a massa fica super fofinha, macia e ficam lindos. Perfeitos para fazer e vender. \n\nEspero muito que voc√™s gostem. \n\nBeijinhos ;)!!‚ù§üíã \n\n-----------------------------------------------------------------------------\n\nSe voc√™ gostou dessa receita, deixe seu like e se inscreva no nosso canal!\n-----------------------------------------------------------------------------\n\n\nContato/ parcerias pelo email: dikadanaka@gmail.com\n\nSite: http://www.dikadanaka.com.br/\n\nInstagram Dika da Naka: http://www.instagram.com/dikadanaka/\n\nTwitter: https://twitter.com/NakaDika\n\nFacebook: http://www.facebook.com/dikanaka\n\nPinterest: https://br.pinterest.com/dikadanaka/\n\n-----------------------------------------------------------------------------\n\nIngredientes\n1 envelope de fermento biol√≥gico seco ( 10 g)\n1 x√≠cara (ch√°) de leite morno ( 240 ml)\n3 gemas\n1/3 x√≠cara (ch√°) de a√ß√∫car ( 75 g)\n3 colheres (sopa) de manteiga ( 60 g)\n1 colher (ch√°) de ess√™ncia de baunilha ( 5 ml)\n1 colher (ch√°) de sal\n3 e ¬Ω x√≠caras (ch√°) de farinha de trigo ( 500 g)\n\nPara a cobertura de chocolate:\n1 barra de chocolate branco ( 100 g)\n1 barra de chocolate ao leite ( 100 g)\nCorante para chocolate na cor desejada (opcional)\nConfeitos coloridos a gosto\n\n-----------------------------------------------------------------------------\n\n\nVeja mais detalhes da receita:\nSite: http://www.dikadanaka.com.br/', '00:00:00', 'heeXwJfadYM', 'video/youtube', 'https://i.ytimg.com/vi/heeXwJfadYM/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-10-24 04:55:35'),
(1003, 1003, '2022-10-24 16:58:26', '2022-10-24 16:58:26', 'oM5HEEyUZ4I', 'MANUAL DO DONUTS PARA VENDER - Decorado e Recheado!', 'TUDO o que voc√™ precisa saber para vender Donuts lindos e deliciosos por a√≠!\n\n\n‚úâ Anuncie no Canal da T√°bata! comercial@tabataromero.com.br\n\n‚Ä∫ Use #docesconte em seus posts!\n\n‚Ä∫ INSTAGRAM: @tabataromeroo | https://instagram.com/tabataromeroo/\n\n‚Ä∫ GRUPO NO FACEBOOK: http://bit.ly/GrupoDocesConte\n\n‚Ä∫ FANPAGE: https://www.facebook.com/DocesConte\n\nCurta o v√≠deo, compartilhe e se inscreva!\nJ√° somos mais de 372 mil inscritos ;)\n\n‚Ä∫ INGREDIENTES:\n500 g de Farinha de Trigo \n80 g de A√ß√∫car \n5 g de Sal \n40 g de Manteiga (ou margarina)\n50 g de Ovo (1 ovo grande)\n15 g de Fermento Biol√≥gico Seco (ou 45 g de fermento fresco)\n250 ml de √Ågua (aprox.)\n\n\nMUSIC:\nArtist: Nicolai Heidlas\nTitle: New Places', '00:00:00', 'oM5HEEyUZ4I', 'video/youtube', 'https://i.ytimg.com/vi/oM5HEEyUZ4I/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-10-24 04:55:45'),
(1004, 1004, '2022-10-24 16:58:26', '2022-10-24 16:58:26', 'kkdhFBl6PWQ', 'PROVANDO O DUNKIN DONUTS DOS ESTADOS UNIDOS A ROSQUINHA MAIS FAMOSA DOS EUA', 'Eu e a produ√ß√£o provamos todos os donuts / Rosquinhas do Dunkin Donuts dos Estados Unidos. Os Donuts s√£o muito famosos aqui nos Eua e √© super comum as pessoas pararem nesse fastfood para comer rosquinhas. Inclusive nos Simpsons voc√™ sempre v√™ o Homer comendo uma rosquinha. \nmas e ai qual √© o donut que voc√™ acha que seria o melhor?\n\nMeu instagram : @fernandolealoficia\nMEU CONTATO PROFISSIONAL : contatofeleal@gmail.com', '00:00:00', 'kkdhFBl6PWQ', 'video/youtube', 'https://i.ytimg.com/vi/kkdhFBl6PWQ/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-10-24 04:55:52'),
(1005, 1005, '2022-10-24 16:58:26', '2022-10-24 16:58:26', '-3HoYSDLMCo', 'O Sonho acabou?!', '#nossacozinha Donuts \n\npreparo: dia 1 -  2 horas e meia + 8 horas de descanso durante a noite\n                 dia 2 -  3 a 5 horas \nrendimento: 10 a 12 donuts\n\n‚Ä¢ 250  gramas de farinha de trigo branca (mais farinha extra para polvilhar a bancada) \n‚Ä¢ 30 gramas de a√ß√∫car branco refinado \n‚Ä¢ 5 gramas de sal marinho * ou sal fino (1 colher de ch√° gordinha ) \n‚Ä¢ raspas da pele de 1 lim√£o siciliano\n‚Ä¢  75 gramas ou 6 colheres cheias de sopa de √°gua morna\n‚Ä¢ 2  ovos de galinha feliz\n‚Ä¢ 8  gramas de fermento fresco \n‚Ä¢ 65 gramas de manteiga em ponto de pomada (macia)\n\nPARA FINALIZAR\n‚Ä¢ 2 litros de √≥leo vegetal, milho, soja, canola ou girassol \n‚Ä¢ 200 gramas de a√ß√∫car \n\nMODO DE FAZER\nEm uma tigela grande, junte a farinha, o ovo, a √°gua morna, o a√ß√∫car, as raspas de lim√£o, o sal e o fermento. Trabalhe a massa com as m√£os amassando dentro da tigela at√© incorporar todos os ingredientes.  \nRetire a massa da tigela, coloque sobre uma superf√≠cie polvilhada com farinha e adicione um pouco  mais de farinha sobre a massa. Trabalhe com as m√£os at√© incorporar a farinha e deixe descansar por 5 minutos.  \nAdicione a manteiga amaciada aos poucos: divida a manteiga em 3 ou 4 partes, incorpore a primeira parte trabalhando com as m√£os e siga adicionando as partes restantes, sempre incorporando bem √† massa antes de acrescentar a pr√≥xima parte de manteiga. Polvilhe com farinha se necess√°rio.\n\n1¬™ fermenta√ß√£o:\nMolde a massa em formato de bola, coloque dentro de uma tigela polvilhada com farinha e cubra com um pano. Deixe crescer fora da geladeira por aproximadamente 2 horas em temperatura aproximada de 23 graus ou at√© que dobre de volume. Se a temperatura do ambiente em que a massa estiver descansando estiver muito alta (dia mais quente) esse tempo deve ser menor, o importante √© que a massa dobre de volume. \nRetire o pano da tigela e d√™ um soco leve e  gentil sobre a massa, achatando-a um pouco. O objetivo desse passo √© retirar o g√°s carb√¥nico que se formou desse descanso, onde houve fermenta√ß√£o.\n\n2¬™ fermenta√ß√£o (essa fermenta√ß√£o √© opcional, voc√™ pode pular da 1¬™ para a 3¬™ fermenta√ß√£o mas recomendamos fazer as 3):\nAinda com a massa na mesma tigela, cubra-a novamente com o pano e deixe na geladeira durante a noite (aproximadamente 8 horas). Essa fermenta√ß√£o ser√° mais lenta, ir√° formar mais g√°s carb√¥nico e ir√° trazer textura e complexidade de sabores √† massa.\n\n3¬™ fermenta√ß√£o:\nUnte uma assadeira grande com √≥leo e reserve.\nRetire a massa da tigela e coloque sobre uma superf√≠cie polvilhada com farinha. Com as m√£os, molde a massa em formato de cilindro e corte em 10 ou 12 partes iguais de 40 a 50 gramas cada (tamanho de uma mini mexerica). \nBoleie cada parte at√© que vire uma bolinha lisa e sem emendas. D√™ uma amassadinha em cima e esfregue gentilmente a base da bolinha em uma superf√≠cie polvilhada com farinha, fazendo c√≠rculos. Transfira as bolinhas, uma a uma, para a assadeira untada deixando no m√≠nimo 5 cm de espa√ßo entre elas (as bolinhas ir√£o aumentar de volume e √© importante deixar espa√ßo para que n√£o grudem umas nas outras). Cubra a assadeira com um pano √∫mido e deixe fermentar por 2 a 4 horas em temperatura ambiente ou at√© que dobrem de volume.\nPara fritar:\nAque√ßa o √≥leo a 165 graus e frite cada lado por 2 a 3 minutos (tenha cuidado na hora de fritar pois o √≥leo estar√° muito quente). N√£o frite com o √≥leo frio, deve estar bem quente, e n√£o coloque mais de 3 unidades para fritar por vez pois pode abaixar a temperatura do √≥leo e tamb√©m fazer com que os donuts grudem uns nos outros por falta de espa√ßo. \nQuando um donut estiver pronto, retire do √≥leo com a escumadeira e transfira para uma assadeira forrada com papel toalha. Imediatamente coloque outro donut para fritar na panela, dessa forma a temperatura do √≥leo ser√° mantida pois sempre haver√° o mesmo volume (3 unidades)  dentro da panela. \n\nPARA MONTAR\nEnvolva os donuts em a√ß√∫car refinado e recheie com creme de confeiteiro. Para rechear utilize um saco de confeiteiro com bico liso. Coloque o creme de confeiteiro no saco, insira o bico pela lateral do bolinho e recheie deixando vazar um pouco pra fora. Coloque uma colher de ch√° da gel√©ia de sua prefer√™ncia por cima do creme. A gel√©ia √© opcional mas recomendamos pois traz acidez e complexidade de sabores.\nA montagem √© feita apenas da hora de servir, os bolinhos podem ser guardados sem o a√ß√∫car e o recheio e montados depois, se necess√°rio.\n\nRealiza√ß√£o: Play9\nCozinheira, roteirista, produtora: Paola Carosella \nDire√ß√£o geral, comunica√ß√£o, assistente de produ√ß√£o e muito mais: Samantha Avelino \nDire√ß√£o de Fotografia: Barbara Hauret \nDire√ß√£o de Arte: Juliana Ayres\nAssistente de c√¢mera e som: Mariana Angelito\nAssistente de cozinha e sorriso contagiante: Lucileide Batista\nBeleza: Carolina Mel', '00:00:00', '-3HoYSDLMCo', 'video/youtube', 'https://i.ytimg.com/vi/-3HoYSDLMCo/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-10-24 04:56:07'),
