(1146, 1146, '2022-10-26 11:04:46', '2022-10-26 11:04:46', 'akyY7xaZHvQ', '#34 Python e Django - DataTables para visualiza√ß√£o de tabelas com filtros, pagina√ß√£o e ordena√ß√£o', '#34 Python e Django - Plugin DataTable com textos em portugu√™s para visualiza√ß√£o de tabelas com filtros, pagina√ß√£o e ordena√ß√£o\n\nAgora de microfone novo!\n\nC√≥digo da tradu√ß√£o do DataTables para o portugu√™s do Brasil:\n\n$(\'#tabela-listar\').DataTable({\n        responsive: true,\n        // \"bSort\": false,\n        \"aaSorting\": [],\n        \"pageLength\": 50,\n        \"language\": {\n            \"decimal\": \"\",\n            \"emptyTable\": \"Sem dados dispon√≠veis\",\n            \"info\": \"Mostrando de _START_ at√© _END_ de _TOTAL_ registos\",\n            \"infoEmpty\": \"Mostrando de 0 at√© 0 de 0 registos\",\n            \"infoFiltered\": \"(filtrado de _MAX_ registos no total)\",\n            \"infoPostFix\": \"\",\n            \"thousands\": \",\",\n            \"lengthMenu\": \"Mostrar _MENU_ registos\",\n            \"loadingRecords\": \"A carregar dados...\",\n            \"processing\": \"A processar...\",\n            \"search\": \"Procurar:\",\n            \"zeroRecords\": \"N√£o foram encontrados resultados\",\n            \"paginate\": {\n                \"first\": \"Primeiro\",\n                \"last\": \"√öltimo\",\n                \"next\": \"Seguinte\",\n                \"previous\": \"Anterior\"\n            },\n            \"aria\": {\n                \"sortAscending\": \": ordem crescente\",\n                \"sortDescending\": \": ordem decrescente\"\n            }\n        }\n    });', '00:00:00', 'akyY7xaZHvQ', 'video/youtube', 'https://i.ytimg.com/vi/akyY7xaZHvQ/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCZINSvFu7-GQYyf1xlJTqpw', '2020-12-14 11:29:41'),
(1147, 1147, '2022-10-26 11:04:46', '2022-10-26 11:04:46', '7IMDEU86AaI', '#35 Python e Django - Como criar rapidamente uma pagina√ß√£o em uma ListView', '#35 Python e Django - Pagina√ß√£o de uma ListView\n\nEntendendo alguns m√©todos l√° no template:\nhttps://docs.djangoproject.com/en/3.1/ref/paginator/#methods\n\npage_obj.has_next\nRetorna True se tem uma p√°gina depois da atual.\n\npage_obj.has_previous\nRetorna True se tem uma p√°gina antes da atual.\n\npage_obj.next_page_number\nRetorna o n√∫mero da pr√≥xima p√°gina.\n\npage_obj.previous_page_number\nRetorna o n√∫mero da p√°gina anterior.\n\nE alguns atributos:\nhttps://docs.djangoproject.com/en/3.1/ref/paginator/#id2\n\npage_obj.number\nRetorna o n√∫mero da p√°gina atual.\n\npage_obj.paginator.num_pages\nRetorna o total de p√°ginas.\n\n---------------------------------------------------\n\nC√≥digo da pagina√ß√£o do v√≠deo:\nhttps://github.com/rafaelzottesso/Curso-Django-2-Python-3/blob/master/cadastros/templates/cadastros/listas/cidades.html\n\n---------------------------------------------------\n\nPara aparecer os n√∫meros √© necess√°rio implementar \"na m√£o\". No Stackoverflow tem um t√≥pico falando disso: https://stackoverflow.com/questions/30864011/display-only-some-of-the-page-numbers-by-django-pagination', '00:00:00', '7IMDEU86AaI', 'video/youtube', 'https://i.ytimg.com/vi/7IMDEU86AaI/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCZINSvFu7-GQYyf1xlJTqpw', '2021-05-11 03:07:19'),
