(1394, 1394, '2022-11-02 13:18:54', '2022-11-02 13:18:54', 'YGezL7U2MTA', 'Air Pump for Laser Engraver - Best Way To Clean Up Engraved WoodÔºü', 'In the process of engraving and cutting wood, there is often burn marks on the surface of the wood, which affects the effect of our engraving and cutting. This video introduces the new partner of Ortur laser master-the air assist pump, which can keep the surface clean after cutting. \n\nThe video includes three steps:\nStep#1 Comparison of engraving results with an air pump\nStep#2 Air Assist Set Up and review\nStep#3 DIY Easter engraving programs \n\nTimestamps:\n00:00-00:13 Video introduction\n00:13-00:20 Air pump introduction\n00:20-00:30 Air pump display\n00:31-01:01 Comparison of engraving results\n01:01-01:32 Air assist pump assembly\n01:33-01:42 Engraving on banana\n01:42-02:11 Engraving easter bunny\n02:11-03:59 Cutting easter box\n04:00-07:12 Painting on the box\n07:13-07:29 DIY Programs Show\n\nAir assist pump: https://bit.ly/3vt7mke\n#airassitpump #airassit #ortur', '00:00:00', 'YGezL7U2MTA', 'video/youtube', 'https://i.ytimg.com/vi/YGezL7U2MTA/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-02 01:12:37');
