(1395, 1395, '2022-11-02 13:18:54', '2022-11-02 13:18:54', 'v0UIGNInMd0', '45$ Air Assist Laser cutter Upgrade - Effective and Quiet | Easy Installation | xTool D1', 'DIY effective air assist upgrade for the xTool D1 laser cutter/engraver for less than 45$. It requires zero modifications to the lasercutter and is surprisingly quiet. The nozzles aims a jet of air exactly at the point being cut by the laser, so you don\'t need a huge air compressor to get clean cuts. It\'s just a 30L/min pump I bought on AliExpress (non-affiliate link below). Everything you need to make your own + extra explanations can be found in my instructable (free & no login required):\n\nhttps://www.instructables.com/DIY-Cheap-and-Quiet-Air-Assist-for-Laser-Cutting/\n\n\nDirect links to products I used & file downloads can be found below this comment I added:\n\n**\nPeople were pretty offended by my video claiming I stole GeeksAtLarge\'s idea. Before designing my air assist I looked at the work of many other creators for inspiration, and since nothing fit what I wanted perfectly, I made my own version. There are fundamental differences (and similarities) between my work and others\'.  I also gave credits on my instructable article (link below) before posting this video. \nI appreciate GeeksAtLarge\'s air assist design, as well as others here on YouTube and Thingiverse. Thanks to all of you who have been sharing your designs online. I don\'t claim to work in the vacuum of space - I took inspiration from many projects before making my own, and I appreciate them. If you look around you\'ll see that GeeksAtLarge is not that different from many older versions either. I\'m not saying he stole his design, but he found inspiration in other people\'s work, just like I did.\nAs I saw it when posting the video, I thought the existing models can be improved, at least for my needs, and so I made my take on the existing air assist projects by modifying them. I also tried to show how I design my projects since I thought it might be interesting to some people. Finally, my video is about the air assist design but also my choices for the pump, how I assembled everything, and how it all performs.\n \nOne more Important note - I\'m not making any money out of this project, as some people claimed. ** \n\n\nPump (I picked the YYAP3000, non-affiliate link):\nhttps://www.aliexpress.com/item/32875644223.html?spm=a2g0o.order_list.0.0.73261802GTiKY1 \n\nPlastic tube link:\nhttps://s.click.aliexpress.com/e/_DnEtJdh\n\nIf you need someone to print the nozzle for you, you can either download the STL\'s from my instructable (link above) and look for someone to print for your, or use this website to find someone to print for you (make sure you get the nozzle printed in a resin printer! It\'s best to print tube holder in a FDM printer):\n\nNozzle for 16mm laser module: https://cubee3d.com/market-place/13100\nNozzle for 14mm laser module: https://cubee3d.com/market-place/13131\nNozzle for 13mm laser module: https://cubee3d.com/market-place/13147\n\nIf you like my project feel free to subscribe :) I share 100% original stuff and only once in a while, so you won\'t get cluttered with spam.\n\nVisit my website at nirlivne.com to see more about me :)\n\n\nMusic by @Holizna - Thank you for sharing your awesome music!', '00:00:00', 'v0UIGNInMd0', 'video/youtube', 'https://i.ytimg.com/vi/v0UIGNInMd0/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-02 01:12:45'),
(1396, 1396, '2022-11-02 13:18:54', '2022-11-02 13:18:54', '_LP4dUq7KR0', '#PROJETO CNC LASER 40W CASEIRA - PARTE 02', 'FALA GALERA! NESTE VIDEO MOSTRO UM POUCO DO MEU PROJETO EM ANDAMENTO QUE √â UMA CNC LASER CASEIRA, FEITA COM PE√áAS COMPRADAS NA SHOPPE, MERCADO LIVRE E ALIEXPRESS.\nNESTE  V√çDEO √â UM TESTE  B√ÅSICO DA UNIDADE OPTICA LASER 40W\n\nESPECIFICA√á√ïES:\n\n√ÅREA √öTIL APROX. 700 X 900MM\n2 MOTORES NEMA 17 DE 4.2 KG\nPE√áAS PL√ÅSTICAS IMPRESSAS EM ABS E PLA 3D\n1 FONTE CHAVEADA 20AMP\n1 M√ìDULO LASER DE 40W CONSUMO E 5W √ìPTICO\n1 PLACA ARDUINO UNO\n1PLACA SHILED 3.0\n2 DRIVERS DVR 8825\n1 BOT√ÉO LIGA/DESLIGA', '00:00:00', '_LP4dUq7KR0', 'video/youtube', 'https://i.ytimg.com/vi/_LP4dUq7KR0/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-02 01:13:02'),
(1397, 1397, '2022-11-02 13:18:54', '2022-11-02 13:18:54', 'rJ9VbsWvrFQ', 'M√ÅQUINA LASER CASEIRA - CONTROLADA POR ARDUINO', 'Ol√°, pessoal! \nNeste v√≠deo vamos mostrar algumas etapas da produ√ß√£o da nossa m√°quina laser caseira controlada por arduino. Essa m√°quina ser√° utilizada para corte, grava√ß√£o... corte e grava√ß√£o em MDF, metal, madeira, couro, EVA, alum√≠nio, cuias, chaveiros, squeeze, ...\n\nEste √© um projeto inicial que est√° sofrendo e ainda vai sofrer algumas altera√ß√µes\n\nSe inscreva no canal e vem acompanhar a gente nessa estrada do empreendedorismo no ramo de personalizados.\n\nNossa loja de materiais para personalizados: https://shopee.com.br/gislainefgmix?categoryId=100630&itemId=12274980975\n\nVenha participar do nosso grupo no facebook: https://www.facebook.com/groups/1025458231730982\n\nInstagram: https://instagram.com/gislainedesouzadeoliveira', '00:00:00', 'rJ9VbsWvrFQ', 'video/youtube', 'https://i.ytimg.com/vi/rJ9VbsWvrFQ/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-02 01:13:14'),
(1398, 1398, '2022-11-02 13:18:54', '2022-11-02 13:18:54', 'cobIQ437swo', 'AMAZING POWER 130W laser Cuts 12mm thick in one pass Atomstack net X20 PRO', 'Hi guys, here is the review of the Atomstack model X20 PRO. A truly performing machine that allows us to cut a 12 mm multilayer with a single pass.\n\n\nüõíLINK ATOMSTACK X20 PRO from Atomstack: https://shrsl.com/3n0eu\nSUPER COUPON -100‚Ç¨  \n\nONLY LASER MODULE: https://shrsl.com/3kbhk\n\nüõíLINK  Honeycomb Working Table: https://shrsl.com/3k55q\n\nA truly extraordinary laser machine, robust, very powerful, easy to install that allows you to make the first engraving or cutting in a few minutes. It can also be controlled from the Android App if you don\'t have a PC or Mac for cable management. I have never tried such a powerful laser and I assure you, it makes a difference. You can reduce time and make cuts or engravings at a higher speed, thanks to the very high power of the laser. IT WILL NOT BE POSSIBLE TO CUT METALS, but only engrave them with some precautions\n\nüõéüõé SOCIAL \nüëâüëâüëâüëâüëâ  TELEGRAM: https://bit.ly/2V9CWVY  (PER I SUPER COUPON SCONTO)\nüëâ SEGUIMI SU TIKTOK: https://bit.ly/3KMkreG\nüëâ ISCRIVITI AL MIO CANALE !! http://bit.ly/2Kn6yco\nüëâ INSTAGRAM: https://bit.ly/3kPlAon\nüëâ FACEBOOK PAGE: https://goo.gl/s6Utqw\n„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è\n LA MIA ATTREZZATURA USATA NEL MIO LABORATORIO  \nüëâ  my video making equipment: https://amzn.to/34LvVM1\nüëâ  my tin soldering equipment: https://amzn.to/33RlBmB\nüëâ  My power tools: https://amzn.to/3711O6d\n„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è„Ä∞Ô∏è\n\n#atomstack #laser #x20pro', '00:00:00', 'cobIQ437swo', 'video/youtube', 'https://i.ytimg.com/vi/cobIQ437swo/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-02 01