(1400, 1400, '2022-11-02 13:18:54', '2022-11-02 13:18:54', '-Vd3VY4L-wA', 'Aquarium air pump for air assist laser engraving - is it better than vacuum cleaner?', 'Ortur Aufero 2 with LF laser module arrives with air assist nozzle. In the review video I could test it only with vacuum cleaner, but several comments suggested me to test it with aquarium air compressor. In this video I am testing ACO-318 45W air compressor from Banggood. The testing will cover laser engraving and cutting. \n\nAir pump presented in the video: https://www.banggood.com/custlink/DD3dN2MrJp\nSpring sale from 3.9 to 3.26: \nSaving Tips  https://ban.ggood.vip/11ia3\nSaver Deposit Sale  https://ban.ggood.vip/11ia4\nSpring Trendy Sale  https://ban.ggood.vip/11ia5\nYour Exclusive Benefits  https://ban.ggood.vip/11ia8\n\nOrtur Aufero 2 laser engraver review video: https://youtu.be/y_b4poZoovo\n\nList of all laser engraver related videos:\nhttps://www.mytechfun.com/videos/laser_engraving\n\nContents:\n0:00 Introduction\n1:29 Unboxing\n3:00 Airflow comparison (vacuum cleaner)\n3:38 Airflow comparison (air pump)\n4:39 Noise measuring\n5:05 Engraving (with and without air assist)\n6:19 Cutting (with and without air assist)\n7:46 Conclusions\n\n#laserengraving #aircompressor #airassist', '00:00:00', '-Vd3VY4L-wA', 'video/youtube', 'https://i.ytimg.com/vi/-Vd3VY4L-wA/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-02 01:14:04'),
(1401, 1401, '2022-11-02 13:18:54', '2022-11-02 13:18:54', 'wjH48V3uANE', 'DIY Laser Cutter Air-Assist & Enclosure', 'Ever since I mounted a 10W Endurance Laser onto my CR-10, I knew I needed to build an enclosure to capture and exhaust all the smoke outside. While I was at I also decided to add an air-assist to get cleaner cuts.\n\nThe Laser I\'m using is the 10W model from Endurance Lasers, the review of which you can check out here: https://youtu.be/R9OHYq-Ws-w\nEndurance Lasers Website: http://endurancelasers.com/\n\nExhaust fan on Aliexpress: http://s.click.aliexpress.com/e/cVzMfvUU\nDucting on Aliexpress: http://s.click.aliexpress.com/e/c7yVlmgY\n\nSupport me (for free) while shopping online (affiliate links):\n-----------------------------------------------------------------------------------------------------------------\nAliexpress: http://s.click.aliexpress.com/e/b3a0ISl6\nGearBest: https://www.gearbest.com/?lkid=11143361\nBanggood: https://www.banggood.com/custlink/D3G3GMUOYL\nAmazon (US): https://amzn.to/2pJVveJ\nAmazon (DE): https://amzn.to/2pK1YFx\neBay.com: http://ebay.us/xd6vPa\neBay.de: http://ebay.us/AwHtLQ\n-----------------------------------------------------------------------------------------------------------------\n\nMy links:\n-----------------------------------------------------------------------------------------------------------------\nInstagram: https://instagram.com/datulabtech/\nWebsite: https://datulab.tech\nStore: https://store.datulab.tech\nThingiverse: https://www.thingiverse.com/DatulabTech\nGithub: https://github.com/datulab\nE-Mail: info@datulab.tech\n-----------------------------------------------------------------------------------------------------------------', '00:00:00', 'wjH48V3uANE', 'video/youtube', 'https://i.ytimg.com/vi/wjH48V3uANE/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-02 01:14:20'),
(1402, 1402, '2022-11-02 13:18:54', '2022-11-02 13:18:54', '-JBIMSJ--v8', 'DIY Homemade Laser Cutter', 'The full documentation for my latest Laser builds can be found here:\nhttps://www.furtherfabrication.com/resources?category=Laser\r\n\nIn this video I share my process of designing and building a co2 laser cutter using a combination of \'V\' & \'T\' slotted aluminium profile 3d printed parts. I wanted a larger cutting area than my old K40 chinese laser cutter had, and I\'m a sucker for a challenge.\n\n\nFAQ:\nCost:\n Total cost of the build was around NZD$3000 (US$2k)\nElectronics:\n AWC608 DSP controller - I purchased mine from lightobject though in hindsight i\'d buy something directly out of China in the future.\nLaser Tube:\n Bought from Aliexpress, though you may have better options depending on your location.\n\n\n\nInstagram:\nhttps://www.instagram.com/further_fabrication/\n\nWebsite:\nfurtherfabrication.com\n\nMusic used:\nFREI - Moody\nLiam.M - Medicine\nLiam.M - Voyager', '00:00:00', '-JBIMSJ--v8', 'video/youtube', 'https://i.ytimg.com/vi/-JBIMSJ--v8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-02 01:14:39'),
(1403, 1403, '2022-11-02 13:18:54', '2022-11-02 13:18:54', 'KJJUY1hU7cY', 'Automating my air compressor with Arduino!', 'Let me know what you want to see next! \n\nSchematic: \nhttps://i.imgur.com/7ZATpv7.png\n\nCode: \nhttps://drive.google.com/file/d/1fwcnpedsSIdMCc7rtPDrYUyyPUKk-xNH/view?usp=sharing', '00:00:00', 'KJJUY1hU7cY', 'video/youtube', 'https://i.ytimg.com/vi/KJJUY1hU7cY/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-02 01:14:47'),
(1404, 1404, '2022-11-02 13:18:54', '2022-11-02 13:18:54', 'QtEF6c1t2tM', 'I Built A Laser Cutter! (For Under $700!)', 'So, laser cutters are pretty cool. I\'ve Wanted one for quite a while, the only thing stopping me from getting one being the cost. A few Months ago, however, I realized that building one from scratch was less difficult than I thought, So I decided to try and build one cheaply to save some money.\n\nI spent A lot of time on this project and the video for it, so Subscribing would be greatly appreciated if you liked the video and want to support me.\n\nThank you all for watching!\n\nInkscape Link - https://inkscape.org/release/inkscape-1.2/\nLaserWeb Link (What I Use Now) - https://laserweb.yurl.ch/\nMarlaser - https://github.com/mentaldemise/MarLaser\n#lasercutting \n\nMusic:\n--------------------------------------------------------------------\nMusic from Uppbeat (free for Creators!):\nhttps://uppbeat.io/t/soundroll/good-thing\nLicense code: VVB3NEX91JYKMMR8\n--------------------------------------------------------------------\nMusic from Uppbeat (free for Creators!):\nhttps://uppbeat.io/t/barry-dallas/turn-it-up\nLicense code: JU1ST2XGWPTQVUYK\n--------------------------------------------------------------------\nMusic from Uppbeat (free for Creators!):\nhttps://uppbeat.io/t/all-good-folks/free-flowin\nLicense code: FVRUDUODGR9QKDBN\n--------------------------------------------------------------------\nMusic from Uppbeat (free for Creators!):\nhttps://uppbeat.io/t/soundroll/get-the-funk-in\nLicense code: BX9ODET4GAJAKJ01\n--------------------------------------------------------------------\nMusic from Uppbeat (free for Creators!):\nhttps://uppbeat.io/t/noise-cake/chunky-nuts\nLicense code: S6OWGAUSL8P0BQAF', '00:00:00', 'QtEF6c1t2tM', 'video/youtube', 'https://i.ytimg.com/vi/QtEF6c1t2tM/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-02 01:14:54'),
(1405, 1405, '2022-11-02 13:18:54', '2022-11-02 13:18:54', 'Jp7AusZCoTM', 'CO2 Laser Air assist verus Air Compressor', 'I compare a typical air assist that comes with a CO2 laser etcher/cutter with an air compressor.  I show the difference in scorching left behind as well as any differences in the ability to cut 1/4 ply.', '00:00:00', 'Jp7AusZCoTM', 'video/youtube', 'https://i.ytimg.com/vi/Jp7AusZCoTM/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-02 01:15:00'),
