(1408, 1408, '2022-11-02 13:18:54', '2022-11-02 13:18:54', 'g9sorWeowQ8', 'Laser cutter compressor fix', 'Another jolly old how to fix video.\nThis time one of my laser cutter compressors failed. They are used in laser cutters to cool the work and literally blow out the fire. If you dont run one whilst cutting or it fails the work is likely to catch fire. \nSo a pretty important bit of kit.\nEnjoy', '00:00:00', 'g9sorWeowQ8', 'video/youtube', 'https://i.ytimg.com/vi/g9sorWeowQ8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-02 01:15:43'),
