(1439, 1439, '2022-11-04 00:14:54', '2022-11-04 00:14:54', 's5VxHQUhSdU', 'DIY: Sheep Garden Planter - Scroll Saw / Jigsaw Project', 'In this video, I build a planter that looks like a cute little sheep. I use my handy dandy scroll saw, but if you decide to make this little guy, you can easily use a jigsaw. There are no tight curves that a jigsaw can\'t handle.\n\n\nYou can find more detailed plans here - https://diyuniquelyyvette.wordpress.com/2021/06/30/sheep-garden-planter/\n\nTools Used:\nScroll Saw - https://amzn.to/2PwcJhX\nScrew driver\nPower Drill\nOrbital Sander - https://amzn.to/3sUJ5B3\nRotary Tool\n\nMaterials:\nWhite paint\nBlack buttons - https://amzn.to/3utXpkK\nCarbon Paper\nBlack paint pen - https://amzn.to/3cVdKZA\nScrews\n\nMusic:\nWater lily - The 126ers (Youtube Audio Library)\n\nWhere to find me:\nInstagram: https://www.instagram.com/uniquelyyvette/\n\n\n#rustic\n#farmhouse\n#home decor', '00:00:00', 's5VxHQUhSdU', 'video/youtube', 'https://i.ytimg.com/vi/s5VxHQUhSdU/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-04 12:08:47'),
(1440, 1440, '2022-11-04 00:14:54', '2022-11-04 00:14:54', 'oJtEN_rttbQ', 'Cat Planter', 'This week\'s video is a special one. I am participating in MakersCare 2016!\n\nGet involved in MAKERS CARE 2016 ‚ñ∫‚ñ∫ http://www.MakersCare.org/ \n\nI am doing this with the help of Steve Ramsey and his channel WOODWORKING FOR MERE MORTALS and Microjig this year to raise money for the Make-A-Wish Foundation to help grant wishes to children facing life-threatening medical conditions. To participate, create an animal out of whatever you like and post a pic of it on the Makers Care website. Get creative! While there please consider making a donation. \n\nPlease visit Steve Ramsey\'s YouTube channel https://www.youtube.com/user/stevinmarin\nhttp://woodworking.formeremortals.net\n\nSpecial thank you this week to my wife Dee for her painting help and the flower for my planter!\n\nMusic created by Me using Garageband\n\nAlways make sure you follow all safety guidelines and always use your tools guards.', '00:00:00', 'oJtEN_rttbQ', 'video/youtube', 'https://i.ytimg.com/vi/oJtEN_rttbQ/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-04 12:08:58'),
