(1493, 1493, '2022-11-04 12:16:50', '2022-11-04 12:16:50', '-pGyaIkCts0', 'DIY Diode laser Engraving Machine using Arduino | 5.5W CNC Laser Engraver/Cutter | Sculpfun S9', 'In this video we will be making a DIY laser Engraver using Arduino.  \nJLCPCB - PCBA from $0(Free Setup, Free Stencil), Register To Get Coupons Here:https://jlcpcb.com/IYB\n\nRequired Parts  - \n1. 2020 and 2040 Aluminium profile\n2. Neema 17 stepper motors\n3. MGN12H linear rails\n4. 5.5W Laser module\n5. M3 t-nuts and bolts\n6. M3 threaded brass inserts\n7. M4 t-nuts and bolts\n8. M5 nuts and bolts\n9. Arduino Uno\n10. CNC Grbl Shield\n11. DVR8825 stepper motor drivers\n12. GT2 timing belt, GT2 pulley(20 teeth) and idler pulley\n13. 2020 Aluminum Profile Corner Angle Bracket\n14. 3d printed parts\n15. 3mm Nylon Zip ties\n16. POM Wheels with 625zz\n17. Rubber feets\n\nLink to circuit diagram, gerber files and STL\'s - https://drive.google.com/drive/folders/1DyZ98v_PIQ7_Bw4f-NIXZyek-xcQtFoQ?usp=sharing\n\nCable chain - https://www.thingiverse.com/thing:1167746/files\n\nGRBL firmware - https://github.com/grbl/grbl\n\nLightburn - https://lightburnsoftware.com\n\nFor more information comment below.\n\nPurchase¬†links:¬†(SCULPFUN¬†S9¬†laser¬†module)\nTOMTOP:¬†https://www.tomtop.com/p-os5959.html\nBanggood (Global delivery):¬†https://www.banggood.com/search/sculpfun-s9-model.html?from=nav\nAliexpress (Global delivery):¬†http://mtw.so/6nERDY\nAmazon¬† (Overseas warehouse Fast delivery ):¬†http://mtw.so/616JFN\nAlibaba.com¬† (Low batch price ):¬†http://mtw.so/5LnTuC\nGeek buyingÔºàEUÔºâÔºöhttps://www.geekbuying.com/item/Sculpfun-S9-Multi-Functional-Laser-Module-Set-494880.html\nGeek buyingÔºàUSÔºâÔºöhttps://www.geekbuying.com/item/Sculpfun-S9-Multi-Functional-Laser-Module-Set-481733.html\n\nPurchase links: (SCULPFUN S9)\nBanggood (Global delivery):¬†https://ban.ggood.vip/107tM\nAliexpress (Global delivery):http://mtw.so/68Cq6C\nAmazon¬† (Overseas warehouse Fast delivery ):http://mtw.so/5Exc1t\nAmazon (For Europe): https://www.amazon.de/dp/B09YRPJN2D?ref=myi_title_dp&th=1TOMTOP:¬†https://www.tomtop.com/p-os5916us.html\nGeek buyingÔºàEUÔºâÔºöhttps://www.geekbuying.com/item/Sculpfun-S9-Laser-Engraver-481991.html\nGeek buyingÔºàUSÔºâÔºöhttps://www.geekbuying.com/item/Sculpfun-S9-Laser-Engraver-481992.html Alibaba.com¬† (Low batch price ):http://mtw.so/5UGFjw\n\n---------------------------------------------------------------------------\nMusic by INOSSI\nListen: https://spoti.fi/2EzvEA6\nWatch: https://youtu.be/aGKJB1TpY9E\n---------------------------------------------------------------------------\n#Arduino #grbl  #laser', '00:00:00', '-pGyaIkCts0', 'video/youtube', 'https://i.ytimg.com/vi/-pGyaIkCts0/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-10-31 02:16:18'),
