(1507, 1507, '2022-11-04 12:16:50', '2022-11-04 12:16:50', 'Jp7AusZCoTM', 'CO2 Laser Air assist verus Air Compressor', 'I compare a typical air assist that comes with a CO2 laser etcher/cutter with an air compressor.  I show the difference in scorching left behind as well as any differences in the ability to cut 1/4 ply.', '00:00:00', 'Jp7AusZCoTM', 'video/youtube', 'https://i.ytimg.com/vi/Jp7AusZCoTM/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-02 01:15:00'),
