(1509, 1509, '2022-11-04 12:16:50', '2022-11-04 12:16:50', 'i7qELVhl7cw', 'How to Make a DIY CNC Laser Engraver at Home', 'Learn- How to make a Laser Engraver at home\nInternational Links-\n(1)250 MW Laserhttps://www.banggood.in/EleksMaker-Laser-Module-Red-Laser-Line-Generator-Diode-Engraving-Machine-Parts-p-955966.html?gmcCountry=IN&currency=INR&createTmp=1&utm_source=googleshopping&utm_medium=cpc_bgcs&utm_content=garman&utm_campaign=pla-ing-rm-all-purchase-pc&ad_id=343859160143&gclid=CjwKCAiA5o3vBRBUEiwA9PVzaheAMb4HMGuN0wWNr7_NvCKbbm3cfImpWpYAQD0u3GWopTEpIrTnURoCqaMQAvD_BwE&cur_warehouse=CN\n(2)Arduino UNOhttps://www.amazon.in/Uno-ATmega328P-Compatible-ATMEGA16U2-Arduino/dp/B015C7SC5U/ref=sr_1_2?keywords=uno+arduino&qid=1575211141&sr=8-2\n(3)CNC Shieldhttps://www.amazon.in/Shield-A4988-DRV8825-Driver-Expansion/dp/B077TDDZ4V/ref=sr_1_2?keywords=CNC+SHIELD&qid=1575211192&sr=8-2\n(4)A4988 Driver X2https://www.amazon.in/Shield-Expansion-Stepper-Heatsink-Arduino/dp/B06XHKSVTG/ref=sr_1_25?keywords=a4988+driver&qid=1575211208&sr=8-25\n(5)12 Volt SMPShttps://www.amazon.in/SunRobotics-Industrial-Application-Printer-Projects/dp/B077L1Q6XP/ref=sr_1_1?keywords=12+VOLT+SMPS&qid=1575211269&sr=8-1\n(6)10K 47E Resistance(Local Store)\n(7)IRFZ44N Mosfet(Local Store)\n(8)Old DVD Writter(Local Store)\n(9)ACP Sheet(Local Store)\nCode,Diagram\nhttps://www.mediafire.com/folder/46brr4xaq0usr/', '00:00:00', 'i7qELVhl7cw', 'video/youtube', 'https://i.ytimg.com/vi/i7qELVhl7cw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-02 01:15:32'),
(1510, 1510, '2022-11-04 12:16:50', '2022-11-04 12:16:50', 'g9sorWeowQ8', 'Laser cutter compressor fix', 'Another jolly old how to fix video.\nThis time one of my laser cutter compressors failed. They are used in laser cutters to cool the work and literally blow out the fire. If you dont run one whilst cutting or it fails the work is likely to catch fire. \nSo a pretty important bit of kit.\nEnjoy', '00:00:00', 'g9sorWeowQ8', 'video/youtube', 'https://i.ytimg.com/vi/g9sorWeowQ8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-02 01:15:43'),
