(1695, 1695, '2022-11-04 17:08:25', '2022-11-04 17:08:25', 'Ru4rhdbCMVA', '‚òëÔ∏è 05 PASSOS simples para come√ßar a INSTALAR AR CONDICIONADO', '‚ö°Ô∏è AULA GRATUITA: Como Fazer Uma Instala√ß√£o El√©trica Completa do Zero, Com Facilidade, Mesmo que Voc√™ N√£o Seja Um Eletricista Profissional: \n‚ûΩ https://engehall.com.br/aula?utm_source=ORGANICO&utm_campaign=YOUTUBE&utm_medium=CANAL_ENGEHALLELETRICA&utm_term=DESCRICAO_VIDEO&utm_content=yt1-vd603\n------\n\n\n‚úÖ Gostou desse v√≠deo?\n- - - - - - - - - - - - - - - - - - - - - - - - - - - - -\n‚úçÔ∏è Deixe seu coment√°rio \nüì¢ Compartilhe com os amigos\nüïµ Siga nossas redes ‚ûΩ https://engehall.com.br/links\n- - - - - - - - - - - - - - - - - - - - - - - - - - - - -\n\n05 PASSOS simples para come√ßar a INSTALAR AR CONDICIONADO\n\nO primeiro passo ent√£o √© preparar as infra estrutura de refrigera√ß√£o, que basicamente √© cortar e isolar os tubos de cobre. Aqui estamos usando o cortador de tubos para cortar peda√ßos de 3 metros que ser√° respons√°vel por interligar a evaporadora a condensadora.\n\nO segundo passo, que √© furar a parede do lado de fora para colocar o suporte da condensadora do ar, s√£o duas m√£os francesas que v√£o aqui e ele usa chumbador parabolt para fix√°-las na parede.\n\nJ√° do lado de dentro do quarto eles fazem um furo a 20 cent√≠metros do teto para colocar o parafuso superior do suporte da evaporadora.\n\nPor fim ele coloca as 4 buchas na parede, notem que eles tamb√©m usam buchas com abas, mesma prefer√™ncia nossa, e por fim eles apertam os 4 parafusos philips da estrutura de fixa√ß√£o da evaporadora interna.\n\nO Jo√£o vai vazar essa parede para passar a tubula√ß√£o de cobre a mangueira do dreno e mais o cabo de comando que interliga as duas m√°quinas. Pra isso ele usa uma serra copo com v√≠deo e faz um furo inclinado pra baixo, isso evita uma poss√≠vel entrada de √°gua da chuva de fora pra dentro, se voc√™ furar reto vai ter infiltra√ß√£o.\n\nEntramos ent√£o no terceiro passo, que √© a conex√£o dos tubos de cobre na evaporadora por meio das flanges. Primeiro eles passam o cabo de comando, que nada mais √© do que um cabo PP que vai interligar a evaporadora na condensadora atrav√©s do furo que fizemos na parede.\n\nAgora eles est√£o se preparando para abrir o flange da tubula√ß√£o para fazer a conex√£o da linha de g√°s. Primeiro o Luis pega o escariador de tubos e passa por dentro do tubo de cobre, depois ele bate para eliminar o excesso de material. Em seguida ele pega o cortador de tubos e abre a ponta do tubo da evaporadora. Esse tubo vem amassado na ponta porque a m√°quina j√° vem pressurizada, escutem s√≥ o barulho da despressuriza√ß√£o depois que corta e quebra essa ponta de tubo. Em seguida eles abrem as porcas do tubo e as retiram para fazer a nova flange na ponta dos tubos que cortamos no inicio do v√≠deo.\n\nPrimeiro colocamos a porca no tubo, depois colocam a base do flangeador e posteriormente encaixam o flangeador na base e apertam. E fica feito assim a flange, sem rebarba, bem lisa e principalmente sem falhas, isso ajuda a garantir a veda√ß√£o do g√°s. \n\nFeito as flanges, hora ent√£o de conectar os tubos de cobre a evaporadora, para isso eles usam um alicate de press√£o e uma chave de boca regul√°vel. √â recomendado ter um cuidado para encaixar a flange no bico da evaporadora. Por fim √© s√≥ apertar as pe√ßas novamente com o aux√≠lio do alicate de press√£o e a chave de boca regul√°vel, simples assim. \n\nO quarto passo √© isolar tudo. Essa parte aqui pessoal fica dentro da m√°quina e como voc√™s sabem que a tubula√ß√£o trabalha extremamente fria, √© obrigat√≥rio uma boa isola√ß√£o para evitar a condensa√ß√£o do tubo e que tenha um vazamento da m√°quina na parede, pra isso a m√°quina j√° vem com uma manta t√©rmica que a gente junta com a espuma dos cabos e come√ßamos a prender com a fita pl√°stica conhecida como silver tape a√≠ pela galera da √°rea. \n\nE como acabamento final eles usam uma fita de pvc com prote√ß√£o UV que serve para proteger o material isolante contra os raios solares. Infelizmente se n√£o usar essa fita pvc sobre a capa isolante o material n√£o vai durar nem 2 anos exposto e isso acaba impactando tamb√©m na garantia do servi√ßo e do material para o cliente n√©!\n\nO quinto passo √© colocar a m√°quina na parede. Notem que eles j√° conectaram uma mangueira cristal no dreno da evaporadora tamb√©m, e junto com a tubula√ß√£o passa um cabo pp para fazer a conex√£o el√©trica dos comandos entre as duas partes do ar condicionado.', '00:00:00', 'Ru4rhdbCMVA', 'video/youtube', 'https://i.ytimg.com/vi/Ru4rhdbCMVA/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCcBDopOxPrAsnEsaapgigmg', '2022-10-25 04:39:33'),
