(1966, 1966, '2022-11-09 12:18:29', '2022-11-09 12:18:29', '8XZQhLRQTDw', 'Room Blender Tutorial With Commentary', 'New commentary tutorial! After a lot of feedback, I\'m trying a new thing. I take some of my most popular scene as a base, and create a short version with a commentary, so you can have easier time recreating the original larger scene with similar techniques. Please, let me know, how you like this one :)\nInterested in making illustrations like this? I made a course with a detailed explanation of my workflow and all the tricks. And you can use the SUSHIMASTER code at the checkout to get a discount.\nGet yours here: https://polygonrunway.com\n\nFree  scene download on Gumroad: https://gum.co/living-room\nOriginal recording studio timelapse: https://youtu.be/QkCrhycrJi8\nIsocam Addon: https://www.dropbox.com/s/m642luyqwnnkl6t/isocam.zip?dl=0\n\nWall art: https://www.pexels.com/photo/abstract-abstract-painting-art-contemporary-art-1572386/\nSpring Character by Julien Kaspar: https://www.artstation.com/artwork/L2enbr\nFloor textures: https://www.3dassets.one/#tags=planks&order=latest\nWood textures: https://www.3dassets.one/#tags=wood&order=latest\n\nBecome a 3D illustrator: https://polygonrunway.com\n\nFollow me on Instagram: https://www.instagram.com/polygonrunway/ for more 3D modeling and rendering process videos and low poly 3d illustration tutorials in Blender.\n\n#blender3dtutorial #blender3d', '00:00:00', '8XZQhLRQTDw', 'video/youtube', 'https://i.ytimg.com/vi/8XZQhLRQTDw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-02 08:26:52'),
