(1968, 1968, '2022-11-09 12:18:29', '2022-11-09 12:18:29', 'GlkbeIv6kBM', 'Tutorial - Beautiful Water Feature Fluid Simulation in Blender and Mantaflow', 'Support me on Patreon to receive the fountain starter file, if you want to skip straight to the fun part: https://www.patreon.com/posts/36919800\n\nI really enjoyed playing with the new Mantaflow fluid simulation solver in Blender 2.82. As someone who has been using Blender for fluid simulation for years now, I have wished for this update for a long time. Let\'s hope they soon update Bullet Physics in the rigid body physics, to support GPU acceleration, or at least multithreading‚Ä¶ We can only dream.\n\nMy second Blender 2.8 tutorial, again in blender 2.82. This should apply to any version of Blender from 2.82 onwards, but from my understanding, this new fluid simulation tool is only available from 2.82, so you won\'t be able to do it with earlier versions. \n\nNew material links! For a while, the materials couldn‚Äôt be downloaded because Syncretic 3D took down the mentioned videos. But, he has very kindly allowed me to share the materials with you. Download them at the updated google drive links below.\n\nLinks:\nReference Image - https://imgur.com/a/XtTwu9q\nHDR Map  - http://www.hdrlabs.com/sibl/archive.html\nConcrete material, new link - https://drive.google.com/file/d/1wjlOm87irl2LdHduZkyBz9uJ2P-TZzFS/view?usp=sharing\nGranite material, new link - https://drive.google.com/file/d/17qkHVHro14E8eFclf_kcp3OXE3yp0PQo/view?usp=sharing\n\nOld broken links for materials:\nGranite Material - https://www.youtube.com/watch?v=WkqFS78yS8M\nCement Material - https://www.youtube.com/watch?v=J-a2HYlu6nM\n\nTime codes:\n00:00 - Hello\n01:25 - Modelling\n21:15 - Materials\n28:10 - Image based HDI hack\n32:25 - New fluid simulation solver!\n45:03 - Easy camera movement trick\n55:55 - Compositing\n\n- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - \n\nPatreon      - https://www.patreon.com/MobyMotion\nBlog            - http://www.mobymotionblog.com\nTwitter       - https://twitter.com/MobyMotion\nGoogle+     - https://plus.google.com/+MobyMotion/posts\nTumblr       - http://mobymotion.tumblr.com\nInstagram  - http://www.instagram.com/mobymotion\nComputer  - http://www.mobymotionblog.com/my-rig\n\nBlender       - http://www.blender.org\nLuxrender   - http://www.luxrender.net/\nSheep it!     - https://www.sheepit-renderfarm.com\nHDR Maps  - http://www.hdrlabs.com/sibl/archive.html', '00:00:00', 'GlkbeIv6kBM', 'video/youtube', 'https://i.ytimg.com/vi/GlkbeIv6kBM/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-03 06:50:46'),
(1969, 1969, '2022-11-09 12:18:29', '2022-11-09 12:18:29', '7SryYK0fYv8', 'Create the Light Speed Star Wars Effect in Blender & Eevee (Blender Tutorial)', 'In this Blender 2.82 tutorial i will show you an easy to create the light speed animation in blender using the Eevee render engine, Enjoy and may the 4th be with you!\n\nSketchfab - https://bit.ly/SKFB_Ducky3D\n\n100 Loops Pack - https://gum.co/ONNriz\n\nPatreon - https://www.patreon.com/join/2935057\n\nInstagram - https://www.instagram.com/ducky3d/\n\nwebsite -  www.ducky3d.com', '00:00:00', '7SryYK0fYv8', 'video/youtube', 'https://i.ytimg.com/vi/7SryYK0fYv8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-03 10:36:48'),
(1970, 1970, '2022-11-09 12:18:29', '2022-11-09 12:18:29', 'YDu6y_2jFg0', 'Blender Character Animation: Shape Keys', 'I apologize for the music being too loud, I\'ve been notified in the comments below and will fix the issue for future videos. CC text works if you\'re struggling to hear.\n\nFollow along with me and learn how to use shape keys in your blender character animations with this Blender 2.8 Character Animation: Shape Keys tutorial.\n\nSubscribe for more Blender 3D tutorials and content. Let me know what you would like to see next in the comments below!\n\nPatreon: https://www.patreon.com/southernshotty\nInstagram: https://www.instagram.com/southernshotty/\n\nTag me in your artwork on Instagram for a chance to be featured at the end of the next video\n\nTo contact or learn more, visit http://www.Remmmark.com', '00:00:00', 'YDu6y_2jFg0', 'video/youtube', 'https://i.ytimg.com/vi/YDu6y_2jFg0/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-03 07:42:06'),
(1971, 1971, '2022-11-09 12:18:29', '2022-11-09 12:18:29', 'px0sJElIUGc', 'Blender Beginner Modelling Chair Tutorial - Part 2: Edge Flow', 'Blender chair modelling tutorial series continues! In this part we learn how to tighten edges with edge loops, and then direct the flow of topology in the direction we want it to.\n\nJoin the free newsletter to get a Blender Keyboard Shortcut PDF: https://mailchi.mp/ef5b15a32043/subscribe-to-the-newsletter\n\n-----------------------------------------------\n\nFollow me:\n\nTwitter: https://twitter.com/andrewpprice\nInstagram: http://instagram.com/andrewpprice\nFacebook: http://facebook.com/blenderguru\nArtStation: http://artstation.com/artist/andrewprice\n\nBlender Guru: http://www.blenderguru.com\nPoliigon: http://www.poliigon.com', '00:00:00', 'px0sJElIUGc', 'video/youtube', 'https://i.ytimg.com/vi/px0sJElIUGc/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-04 02:16:42'),
(1972, 1972, '2022-11-09 12:18:29', '2022-11-09 12:18:29', 'CuQzPDs99yM', 'Retopology for Beginners in Blender 2.8 - Retopo the Correct Way', 'Retopology in Blender 2.8 - full 4 hour series on retopo in Blender\nhttps://flippednormals.com/downloads/retopology-in-blender-2-8/\n\nIn this Blender 2.8 tutorial, we\'ll teach you how to retopo using vanilla Blender 2.80 without addons. The techniques taught can be used to make topology for any character or 3d model. #b3d #blender \n\n05:31 - Retopo Settings for Blender 2.8 \n24:23 - Retopology Demo\n\nTL;DR\nEnable the F2 addon\nSnapping - enable \'Project Onto Self\' and \'Project Individual Elements\'\nEnable Backface culling\nObject Context - Viewport Display - enable \'In front\'\nMaterial - Viewport Display - Give it a color\n\n-Modifiers:\nShrinkWrap - Select target object - otherwise default settings\nMirror - Enable \'clipping\'\nSubdivision Surface - Use for sanity checking ONLY.\n\n-Modeling Tools:\nExtrude Edge - Ctrl RMB\nExtrude - E\nLoop Cut - Ctrl R \nF2 - F (while a point selected) \nBridge - F\nSlide - GG \nMerge Verts - Alt M\nSelect tool - W\nGridFill\nProportional Editing (soft select) - O\n\nSupport us by checking out our merch!\nhttps://teespring.com/stores/flippednormals\n\nSubscribe now!\nhttps://www.youtube.com/c/FlippedNormals?sub_confirmation=1\n\nWebsite - https://flippednormals.com/\nInstagram - https://www.instagram.com/flippednormals/\nTwitter - https://twitter.com/flippednormals\nFacebook - https://www.facebook.com/flippednormals\n\nOur episodes are also available on all major podcast services!', '00:00:00', 'CuQzPDs99yM', 'video/youtube', 'https://i.ytimg.com/vi/CuQzPDs99yM/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-04 02:36:40'),
(1973, 1973, '2022-11-09 12:18:29', '2022-11-09 12:18:29', 'VnFQdIRbd6U', 'How to Create a Planet in Eevee (Blender 2.80)', 'Hello everyone! In this tutorial we will be creating a planet using the new render engine Eevee! You will learn how to texture, create cracks and an atmosphere all in Blender. \n\nTextures - https://www.solarsystemscope.com/textures/\nDownload Blender 2.80 - https://builder.blender.org/download/\n\nCome join the Discord!\nhttps://discord.gg/2YcMjXK\n\nSubscribe for more Blender Tutorials! youtube.com/blendermadeeasy?sub_confirmation=1\n\nCheck out my latest course on Interior Rendering in Blender!\nhttps://www.udemy.com/modern-interior-blender\n\nDo you want to learn how to create a realistic modern house in Blender?\nCheck out my course on it!\nhttps://www.udemy.com/blendermadeeasy-modernhouse\n\nDownload Blender\nBlender.org\nCome follow me on social media!\nUdemy Page - https://www.udemy.com/user/stephen-pearson-3/\nInstagram - https://youtu.be/2qebTSTjdg4\nTwitter - https://twitter.com/BlenderMadeEasy\nFacebook -https://www.facebook.com/pages/Blender-Made-Easy/654488747984849\nWebsite - www.blendermadeeasy.com\nGaming Channel - www.youtube.com/therealsyberius\n\nMake sure you leave a like and subscribe! :)\n\nReplay the Video!\nhttps://youtu.be/VnFQdIRbd6U', '00:00:00', 'VnFQdIRbd6U', 'video/youtube', 'https://i.ytimg.com/vi/VnFQdIRbd6U/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-04 03:02:52'),
(1974, 1974, '2022-11-09 12:18:29', '2022-11-09 12:18:29', 'doNVizFGGVQ', 'Blender -Simple Holographic Earth in EEVEE  [Blender 2.8]', 'This video shows you how to create a holographic Earth using transparency in eevee.  We cover alpha, textures, rendering with transparency, bloom, clipping, and reflections.\n\nHere are the texture links that currently work.  Thanks!\n\n https://visibleearth.nasa.gov/view.php?id=73934 \n\nAnd this:\n\nhttp://www.shadedrelief.com/natural3/pages/extra.html\n\n- üì≤üëçGrab a free CG Animation Time Saver eBook here, learn about the industry and get lots of shortcuts and links: https://www.virtualtweakers.com/freebook\n\nFollow me on Instagram:\nhttps://www.instagram.com/kevbingecg/\n\nIf you want to learn animation, vfx, industry info, here\'s a decent article:  https://www.virtualtweakers.com/how-to-learn-animation/', '00:00:00', 'doNVizFGGVQ', 'video/youtube', 'https://i.ytimg.com/vi/doNVizFGGVQ/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-05 06:40:24'),
