(1977, 1977, '2022-11-09 12:18:29', '2022-11-09 12:18:29', '6hf2yJ8CiW4', 'EASILY MAKE 3D MODELS  FROM SCRATCH!  - WITH THIS FREE OPEN SOURCE TOOLü§©', 'In the wake of creating instant 3D models, this amazing 3D tool seems to have been around for a while now, and with a free and opensource tool like Dust 3D the approach which it comes with shares an interesting viewpoint which breaks out of the traditional method of 3D model creation, rigging, and animation.\n---------------------------------------------------------------------------------------------------\n**Support Me: https://www.patreon.com/asknk  **\n**Discord: https://discord.gg/G2kmTjUFGm **\n** Follow Me: IG- @anselemnkoro / Twtr: @anselemnkoro *\n---------------------------------------------------------------------------------------------------\nGET DUST 3D\nhttps://dust3d.org/\nGet BLENDER Addons: https://bit.ly/3jbu8s7\nGET CAR TRAFFIQ ADDON!\nhttps://youtu.be/Ekv2QgczoGE\nhttps://blendermarket.com/products/car-library-traffiq-vehicles-for-blender?ref=110\n\nGET TRUE TERRAIN:\nhttps://blendermarket.com/products/true-terrain-?ref=110\n\nBlender-Animation and Simulation Made Easy:\nhttps://www.yiihuu.cc/c/8266_3152_547\n\n3D Character Creation For Game:\nhttps://www.yiihuu.cc/c/8248_3152_545\n\nAAA Character Creation for blender: \n https://www.yiihuu.cc/c/8279_3152_833\n\nNote: The Coupon can only be used on the PC and all Yiihuu products are available.\nCoupon codeÔºöYHAK10 \n\nBLENDER 2.9x - NEW FEATURE - 2D FROM 3D!\nhttps://youtu.be/lriYv4P4TcE\n\nGET 3D UPDATES HERE:\nhttps://youtu.be/riR8Rcku4HA\n\nIf you want to help me create more videos, you can by supporting me with anything on patreon.\nPatreon:  \nhttps://www.patreon.com/asknk\n\nGumroad:\nhttps://gumroad.com/asknk\n#3d\n#node\n#dust3d\n#rigging\n#animation\n#blender\n\n\ngame development,3d printing,open source,dust3d tutorial,dust3d character,3d character design,3d character creator,3d character modeling,blender 3d', '00:00:00', '6hf2yJ8CiW