(1979, 1979, '2022-11-09 12:18:29', '2022-11-09 12:18:29', 'd5F61zXTdD8', 'Particle Nodes are in Blender master! (Blender 2.91 alpha)', 'We finally have functional particles in the Blender master branch! They\'re a work in progress, and there\'s not a lot of features yet, but in this video I\'ll show the basic process of setting up your first particle node system :)\n\n\n--------------------------\n\nThis channel is a \"behind the scenes\" look for my Songs For Humanity Project, with occasional random videos about whatever happens to interest me :)\n\nThe Songs For Humanity channel: https://www.youtube.com/channel/UCQftU43KZdsvwDlMHSGhLtA\n\nMore about the SFH project: https://www.reddit.com/r/SongsForHumanity/comments/9isykr/what_is_songs_for_humanity/\n\nOriginal SFH music on Soundcloud (CC0): https://soundcloud.com/projectsfh', '00:00:00', 'd5F61zXTdD8', 'video/youtube', 'https://i.ytimg.com/vi/d5F61zXTdD8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-09 01:18:35'),
(1980, 1980, '2022-11-09 12:18:29', '2022-11-09 12:18:29', 'mlCwT5dgEXM', 'Make a Realistic Flamethrower in Blender - Iridesium', 'Join Iridesium Community: https://discord.gg/PdjBDKw \n\nTime for another hot new video! Get out your heat resistant suits because in this tutorial we will be simulating a flamethrower and creating a realistic fire shader.\n\nAt 2:32 I change the Normal Velocity to 0. I accidentally cut that out of the video. \n\n0:00 - Epic Intro\n1:27 - Floor and Emitter\n2:21 - Particle Settings\n3:50 - Smoke Domain Settings\n5:39 - Smoke Emitter Settings\n6:49 - Smoke Viewport Display\n8:22 - Fire Shader\n11:02 - Render Setup\n\nhttps://www.iridesium.com/\n\nSupport Iridesium: https://www.iridesium.com/product/iridesium-glitch-hoodie/\n\n¬† Iridesium Blender theme: https://drive.google.com/file/d/1q28GpAPDrczwUbOygxYdbON635x9_CJC/view?usp=sharing', '00:00:00', 'mlCwT5dgEXM', 'video/youtube', 'https://i.ytimg.com/vi/mlCwT5dgEXM/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-09 08:54:28'),
(1981, 1981, '2022-11-09 12:18:29', '2022-11-09 12:18:29', 'YANVcOcoHQw', 'How to Morph in Blender2.8 using animated texture maps', 'I explore how to achieve a morphing effect in blender2.8 using animated texture maps. The techniques used are similar to the last glitching effect tutorial. \n\n\nMy NFT store: https://makersplace.com/riotgear/topshelf/\n\nUPDATE: You can now get the projectfile on gumroad here! Texture are still on the googledrive links due to upload filesize  restrictions.\nhttps://gum.co/cPKaOC\n\n\n\n¬†you can download the textures here: \nhttps://drive.google.com/drive/folders/1faR_SrlynaBMlaeYpgu2pl7ljqQbM3MK\n\nThe shoe model is by: \nhttps://www.artstation.com/fnjoroge\n\n\nfind me:\nfacebook :    https://www.facebook.com/dennis.mose.73\ntwitter:    https://twitter.com/RIOTG3AR\nInsta:    https://www.instagram.com/riotgear3d/\n\n\n\n¬†If you have any tips or ideas or suggestions, please share them in the comments below. also leave that thumbs up blue if you like the video.\nMuch love!', '00:00:00', 'YANVcOcoHQw', 'video/youtube', 'https://i.ytimg.com/vi/YANVcOcoHQw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-10 11:30:26'),
