(1986, 1986, '2022-11-09 12:18:29', '2022-11-09 12:18:29', 'm7c45On2eYk', 'Getting Started with Blender for Video Editing', 'In this video we kick off our series of tutorials focusing on using Blender as a video editor.  We cover how to setup Blender for video editing and then use it to edit and splice together two dissimilar file types, add a sound track, and render/output an edited movie.\n\nTopic and Timestamps:\n0:00 ‚Äì Introduction\n1:57 ‚Äì Installing Blender\n3:25 ‚Äì Setting the Blender environment for video editing\n10:20 ‚Äì Adding movies to Blender\n14:45 ‚Äì Building video proxies\n19:40 ‚Äì Adding markers\n20:20 ‚Äì Cutting clips\n25:32 ‚Äì Moving clips\n27:41 ‚Äì Adding audio to Blender\n29:38 ‚Äì Rendering final video\n33:24 ‚Äì Summary/cheatsheet of operations\n\nSee all the videos related to using Blender as a video editor at https://www.youtube.com/playlist?list=PLxdnSsBqCrrG9vYaQMDE0A16c4M52b7vJ \n\n#Blender\n\nYou can support this channel via Patreon at https://www.patreon.com/christopherwlum.  Thank you for your help!', '00:00:00', 'm7c45On2eYk', 'video/youtube', 'https://i.ytimg.com/vi/m7c45On2eYk/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-13 07:05:09'),
