(1988, 1988, '2022-11-09 12:18:29', '2022-11-09 12:18:29', 'WlaMfIgS2ns', 'Modeling a character BaseMesh in Blender (Tutorial)', 'ROUND CUBE NOT WORKING ?: https://www.youtube.com/watch?v=IarL30rbZYE&feature=youtu.be\n\nIn this tutorial I\'m going to show you my workflow in order to model a character base mesh in Blender. It could be used later on as a starting point for a sculpt. We are going to see how to arrange a good topology and how to make optimal decisions when needed during this process. \n\nHave a nice day !\n\nI\'m using Blender and Human Anatomy Atlas for references.\n\nTools/shortcuts 00:00\nHead 01:58\nNeck 41:38\nTop Chest 44:24\nShoulders 46:44\nEdit and fixing in between \nLower chest/abdominal 01:02:38\nButt 01:06:56\nEdit and fixing in between\nLegs 01:20:34\nFeet 01:26:04\nArm 01:41:45\nWist/Hand 01:53:17', '00:00:00', 'WlaMfIgS2ns', 'video/youtube', 'https://i.ytimg.com/vi/WlaMfIgS2ns/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-16 07:49:36'),
(1989, 1989, '2022-11-09 12:18:29', '2022-11-09 12:18:29', 'DEgzuMmJtu8', 'How to Create Ghibli Trees in 3D - Blender Tutorial', 'In this video, David from Lightning Boy Studio will show how to create 3D trees in the style of Ghibli films, all in Blender 2.83\n\nhttps://twitter.com/LightningBoySt1\nhttps://www.facebook.com/dinomancersproject/\n\nYou can watch our toon shader tutorial series here :\nhttps://youtu.be/TpWI2rU8iF0\n\nCurious to know more about our upcoming animation project \"Dinomancers\"? Check out our animation test here :\nhttps://www.youtube.com/watch?v=RDzCUMUEbu0\n\nGhibli reference image used in the tutorial:\nhttps://drive.google.com/file/d/1_asnR_HqVqIeoAKVYr4eY5vTrHcIYPCT/view?usp=sharing\n\nOpening Logo Sound Mix : Les Productions Underground', '00:00:00', 'DEgzuMmJtu8', 'video/youtube', 'https://i.ytimg.com/vi/DEgzuMmJtu8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-20 09:40:29'),
