(1992, 1992, '2022-11-09 12:18:29', '2022-11-09 12:18:29', 'eoSRMxMDYsk', 'Tutorial: Real Time Animation in Blender', 'Learn how to animate any 3D object by simply recording your cursor\'s movement in real time! We\'ll go through some interesting use cases and explore different techniques for tweaking and editing keyframe data.\n\nIf you want to support the channel: https://patreon.com/polyfjord\n\nFree turret model here: https://gumroad.com/l/kVMkU\n\n$5 Extended asset pack here: https://gumroad.com/l/VzSKg\n\n00:00 The Cube gets life\n01:42 Rise of the Cube\n02:16 Animating the Turret Model\n03:52 Editing messy keyframes with proportional editing\n06:28 Removing keyframes with decimate\n07:15 Weird wing animation\n09:27 Thanks for watching!', '00:00:00', 'eoSRMxMDYsk', 'video/youtube', 'https://i.ytimg.com/vi/eoSRMxMDYsk/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-24 06:14:02'),
