(1994, 1994, '2022-11-09 12:18:29', '2022-11-09 12:18:29', 'xxDIo0i5lpY', 'Holographic City Is Super Easy in Blender with This (Quick and Dirty)', 'Create a quick holographic city in Blender.\n\nNicko16 - https://www.youtube.com/watch?v=YNtKnmRXVlo - give this guys some love!\n\nThe project file is up on Patreon: https://www.patreon.com/kevbcg\n\n- üì≤üëçGrab a free CG Animation Time Saver eBook here, learn about the industry and get lots of shortcuts and links: https://www.virtualtweakers.com/freebook\n\n\nOpen Street Maps Copyright Page - https://www.openstreetmap.org/copyright\n\nBlenderGIS - https://github.com/domlysz/BlenderGIS', '00:00:00', 'xxDIo0i5lpY', 'video/youtube', 'https://i.ytimg.com/vi/xxDIo0i5lpY/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-26 04:20:50'),
(1995, 1995, '2022-11-09 12:18:29', '2022-11-09 12:18:29', '5pOz-N2p4xs', 'Tutorial: Pendulum Waves in Blender', 'Learn how to animate pendulums with a wave effect in Blender! We\'ll generate a sine wave and adjust parameters to create a seamlessly looping pendulum animation. Stay tuned at the end for an experimental analog method of recording pendulum motion.\n\nIf you want to support the channel: https://patreon.com/polyfjord\n\nTimestamps:\n00:00 Intro\n00:26 Modeling the pendulum\n02:17 Animating the pendulum\n03:57 Assigning materials\n04:51 Duplicating pendulums\n05:27 Creating the wave\n07:33 Preparing for rendering\n11:33 Rendering and output\n12:46 Analog experiment\n\nProcedural Textures Tutorial: https://youtu.be/O_spJmmST5I\n\nPendulum Waves in 4K 60 HDR: https://youtu.be/_4ICFmAr_DQ\n\nPurchases made through the links below may provide some compensation to Polyfjord (This is a great way to support the channel!):\nIntro and outro song: https://shutterstock.7eer.net/jWAL9M\nMontage song: https://shutterstock.7eer.net/Vy3576', '00:00:00', '5pOz-N2p4xs', 'video/youtube', 'https://i.ytimg.com/vi/5pOz-N2p4xs/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-27 02:14:52'),
(1996, 1996, '2022-11-09 12:18:29', '2022-11-09 12:18:29', 'O_spJmmST5I', 'Tutorial: Procedural Textures in Blender', 'Blender is a free, open source software you can download at https://blender.org/download/\n\nBlender v2.81 update: At 05:35 in the video - if you\'re using Blender v2.81 or later, make sure to use the \'Distance\' output of the Voronoi Texture node instead of \'Color\'. This will correctly displace the surface identical to the results of this tutorial.\n\nGet the project file with materials here (Please select $0 to download for free):\nhttps://gumroad.com/l/rFBMz\nMake sure you have Blender version 2.8 or later!\n\nMy animated short film STACK is available on Youtube here: https://youtu.be/X9SzUlaH4L0\n\nMy instagram: https://www.instagram.com/lotsalote/\n\n0:00 - Clips from STACK\n0:46 - Intro\n1:03 - Scene setup\n2:19 - Lighting setup\n4:13 - Material setup\n6:42 - Results\n7:46 - Outro\n\nGear used in this video:\nCamera: Sony A7SII with Samyang 14mm T3.1. Recorded externally with BlackMagic Video Assits 4K in 1080p 60fps ProRes 422.\nSound: Zoom H4N\nWorkstation: Nvidia RTX 2080Ti, GTX 1080, Intel CPU i7-6700K @4Ghz, 64GB ram, Win 10\nRender node: 3x 1080Ti, Linux Ubuntu\nRecorded with OBS Studio, using this input overlay addon: https://obsproject.com/forum/resources/input-overlay.552/\n\nMusic from Premiumbeat.com and Youtube Audio Library\n\nThanks for watching!', '00:00:00', 'O_spJmmST5I', 'video/youtube', 'https://i.ytimg.com/vi/O_spJmmST5I/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-27 02:48:28'),
