(1998, 1998, '2022-11-09 12:18:29', '2022-11-09 12:18:29', '72LPW4S8bns', 'Create a Realistic Forest in 30 Minutes | Blender 2.8 Tutorial', 'How to Create a Realistic Forest in 30 Minutes in this Blender 2.8 Tutorial!\nGet Concierge Render here: https://www.conciergerender.com/\n\nHELP US ACHIEVE OUR GOAL OF PLANTING 20,000,000 TREES!\nPLEASE DONATE ! -  https://teamtrees.org/ #teamtrees\n\nDownloads on Patreon: https://www.patreon.com/cggeek\n\n1 Minute Low Poly Tree Tutorial: https://www.youtube.com/watch?v=y7PdiGXbrD0\n\nHDRI: https://hdrihaven.com/hdri/?c=outdoor&h=table_mountain_1\n\nRock Texture: https://www.textures.com/download/3dscans0422/133306?q=rock+sharp\n\nGrass Texture: https://www.textures.com/download/pbr0426/137222?q=grass\n\nSubscribe For More: https://www.youtube.com/subscription_center?add_user=CGGeek \n\nThanks to CoreWeave for sponsoring this video.\n\nInstagram: https://www.instagram.com/cg_geeks/\nTwitter: https://twitter.com/CGGeeks\nFacebook: https://www.facebook.com/CGgeeks/\nArtStation: https://www.artstation.com/artist/cg_geek', '00:00:00', '72LPW4S8bns', 'video/youtube', 'https://i.ytimg.com/vi/72LPW4S8bns/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-27 08:34:21'),
(1999, 1999, '2022-11-09 12:18:29', '2022-11-09 12:18:29', '1jHUY3qoBu8', 'Learn Low Poly Modeling in Blender 2.9 / 2.8', 'Expand description for timestamp shortcuts! This is a long video but it goes through all the techniques that I\'ve learned about low poly modeling in my 5 years of using Blender. I use Blender 2.83 with default keys:\n\nTIMESTAMPS:\n00:00 Intro\n00:55 Basics (navigation, viewport)\n02:12 UV Coloring Technique\n04:46 Shiny Edges - Cavity in Viewport\n06:14 Object vs Edit mode\n07:21 Move\n07:28 Move Gizmo\n08:10 Slide\n08:27 Scale\n08:55 Pivot Point\n09:16 Extrude\n11:26 Extrude along Face Normals\n11:50 Extrude Individual Faces\n12:25 Extrude with Ctrl Right Click\n13:11 Rotate\n13:49 Lock Move/Rotate/Scale on axis\n14:42 Inset\n15:52 Inset Individual Faces\n17:36 Inset with Boundary On/Off (remove center face)\n18:18 Proportional Editing\n19:49 Making a Low Poly Crate\n20:28 Bevel\n21:06 Shrink/Flatten\n21:34 Create Mesh\n22:16 Place 3D Cursor\n22:44 Snap\n23:26 Center 3D Cursor\n23:54 Making a Low Poly Tree\n26:00 Select Linked\n26:45 Duplicate\n28:19 Connected Proportional Editing\n29:36 SELECTION METHODS\n30:32 Loop Select\n30:53 Circle Select\n31:42 Ring Select\n31:56 Select Shortest Path\n32:17 Box Select\n32:38 Xray\n33:26 Lasso Select\n33:54 Grow Selection\n34:22 Shrink Selection\n34:43 Select Random\n34:57 Select Similar\n35:46 Snow capped trees\n36:39 Checker Deselect\n37:17 Hide/Show Selection\n38:10 MESH EDITING\n39:12 Loop Cut\n39:47 Scale on Axis\n41:36 Knife Tool\n41:50 Colorizing Crate\n45:40 Knife Tool Snap to Center \n45:54 Knife Tool Angle Constraint\n46:26 Making a Low Poly Rock\n46:26 Subdivision Modifier\n49:10 Flatten\n50:09 Orientation\n51:30 Vertex Snapping with Ctrl\n52:05 Auto Merge Vertices\n52:43 Merge by Distance (used to be Remove Doubles)\n54:28 Fill / Create Faces\n55:13 Triangulate\n56:51 Recalculate Outside - Flip Normals\n59:22 Bridge Edge Loops (connect meshes)\n01:00:06 Making a Low Poly Computer Table (using face duplication)\n01:03:26 Separate meshes into objects\n01:04:53 Merge meshes into single object\n01:05:28 MODIFIERS\n01:05:40 Mirror Modifier\n01:07:02 Auto Mirror Modifier\n01:08:33 Displace Modifier\n01:12:10 Skin Modifier\n01:13:13 TIPS AND TRICKS\n01:13:30 Vertex Snapping on Axis to align\n01:14:23 ADDONS (FREE, INCLUDED WITH BLENDER)\n01:14:57 Loop Tools / Circle\n01:15:42 Bool Tools\n01:16:33 F2\n01:16:45 FIXING PROBLEMS\n01:17:03 Parallel Faces\n01:18:22 Duplicate Vertices\n01:19:00 Faces facing the wrong way\n01:19:20 Misaligned vertices\n01:19:43 Insetting is not uniformed\n01:20:36 Viewport not rotating around selection\n01:20:49 Subdividing object is too round\n01:21:21 Inset creates a center face on mirrored objects\n01:21:38 Boundary for inset is not working\n01:21:42 Summary / Outro\n\nPalettes:\nhttps://www.dropbox.com/s/c5olic38j8fopet/ImphenziaPalette01.png?dl=0\nhttps://www.dropbox.com/s/1w98xiksiwaywqx/ImphenziaPalette01-256-Gradient.png?dl=0\n\nYou can support me on Patreon:\nhttps://patreon.com/imphenzia\n\nImphenzia Merch is available:\nhttps://teespring.com/stores/imphenzia\n\nBlender settings video (shiny borders):\nhttps://www.youtube.com/watch?v=BlxiCd0Upg4\n\nIf you want to use the palette style UV coloring method, I go through that in both of the above linked videos.\n\nMy official web site:\nhttps://www.imphenzia.com\n\nTwitter:\nhttps://twitter.com/imphenzia\n\nMy Itch.Io page with all my Ludum Dare games:\nhttps://imphenzia.itch.io/\n\nImphenzia Discord server invite:\nhttps://discord.gg/sR7pZ4B\n\n10 Minute Modeling Challenge Playlist - lots of low poly modeling here to watch for inspiration and ideas (new video every Thursday!):\nhttps://youtu.be/IVXuPJuAMJ4\n\nThanks guys, happy modeling!', '00:00:00', '1jHUY3qoBu8', 'video/youtube', 'https://i.ytimg.com/vi/1jHUY3qoBu8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-27 11:03:54');
