(2000, 2000, '2022-11-09 12:18:29', '2022-11-09 12:18:29', 'L3XtAFUWNuk', 'Sculpting in Blender 2.8 | Beginners Detailed Guide | Every Brush', 'Grants New LowPoly Short Course: Learn Blender fast: https://www.gamedev.tv/p/low-poly-landscapes/?coupon_code=GRANT&affcode=45216_9b6dqwx2\nGrant\'s Character Course discount link: https://www.gamedev.tv/p/blender-character-creator-2/?coupon_code=GRABBITT&affcode=45216_9b6dqwx2 \nGrant‚Äôs Drawing course discount link: https://www.gamedev.tv/p/complete-drawing/?coupon_code=GRABBITT&affcode=45216_9b6dqwx2\nI give a basic but detailed overview and guide to sculpting within Blender\n\nI go through each brush in detail:\nDraw Brush\nClay Brush\nClay strips Brush\nInflate Bruch\nBlob Brush\nCrease Brush\nSmooth Brush\nFlatten Brush\nFill Brush\nScrape Brush\nPinch Brush\nGrab Brush\nSnakehook tool\nMasking\nDetail Brush\n\nI also give lots of hints, tips and tricks to help you with you sculpting and know when to use each brush\n**part 2**: https://youtu.be/xTcQjNmdSsE\n\nGrant\'s New Character Course:\nhttps://www.gamedev.tv/p/blender-character-creator-2/?coupon_code=GRABBITT&affcode=45216_9b6dqwx2\n\nWebsite: www.gabbitt.co.uk\n\ndiscord server:  https://discord.gg/Y5QaDnT \n\nLearn the basics of Blender 2.8 : https://youtu.be/wNQYhbvTJi8 \n\nRECOMMENDED GRAPHICS TABLETS:\nI use a graphics tablet to paint with and my recommendations are written below:\n\nUltimate Buyers Video Guide - https://youtu.be/mUnblsyy8CU\n\nNormal Graphics Tablets\n*Cheapest + FAVOURITE:*\nVeikk a15 \nAmazon US - https://amzn.to/2WanAQD\nAmazon UK - https://amzn.to/30JZ1IQ \nGearbest  - https://bit.ly/2Wia6hg \n\nVeikk a30 - great alternative is a15 not available\nAmazon UK - https://amzn.to/2EqrAlI\nAmazon US- https://amzn.to/2K84VgV \n\n*Most sturdy and with tilt:*\nHuion h610 pro v2 \nAmazon US -  https://amzn.to/2W774AS\nAmazon UK - https://amzn.to/2WanZ5B \nGearbest - https://bit.ly/2Lq31Hr \n\nDisplay Tablets\n*My Favourite*\nVEIKK VK1560 \nGearBest - https://bit.ly/2UKNpSU \nAmazon US - https://amzn.to/2HFNC5d \nAmazon UK - https://amzn.to/30Qyvxk \n\n*Heard good things:*\nHuion Kamvas GT \nGearbest - https://bit.ly/2SR7q8r 15 inch \nAmazon UK - https://amzn.to/2I0SeC1 \nAmazon US - https://amzn.to/30QGtXF \n\n*Money no object :)*\nCintique 22‚ÄùHD\nAmazon UK https://amzn.to/2I5MxCX   \nAmazon US https://amzn.to/2MmVGw2  \n\n*What I use*\nMobile studio pro\nAmazon UK - https://amzn.to/2EDI2yn \nAmazon US - https://amzn.to/2EF4zeh \n\nFacebook: https://www.facebook.com/gabbittmedia/\n\nTwitter: https://twitter.com/grantabbitt\n\nSketchfab : https://sketchfab.com/grant.abbitt\n\nPatreon : https://www.patreon.com/gabbitt', '00:00:00', 'L3XtAFUWNuk', 'video/youtube', 'https://i.ytimg.com/vi/L3XtAFUWNuk/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2020-08-27 07:30:52'),
