(2025, 2025, '2022-11-09 12:18:29', '2022-11-09 12:18:29', 'aB8jC0v4b9I', 'Make A Space Station with Blender In 30 Minutes - No Add-ons Required!', 'üòÄ Buy My Project Files And Assets Here: https://gumroad.com/cbaileyfilm \nJoin Patreon: https://www.patreon.com/CBaileyFilm\nJoin YouTube: https://www.youtube.com/CBaileyFilm/join\nJoin Discord: https://discord.gg/UCNJmT5\nCatch The Podcast: https://www.cbaileyfilm.com/cbaileycast/\nCollect My Clean NFTs on Tezos: https://www.hicetnunc.xyz/tz/tz1gCzBmZ4yNVHBCSSV4kNzJVSYxhJ3fF8HT\n\nIn this exciting tutorial we hard surface model a Space Station from scratch with no add-ons.  I cover everything from modelling to materials so get ready for a wild ride!', '00:00:00', 'aB8jC0v4b9I', 'video/youtube', 'https://i.ytimg.com/vi/aB8jC0v4b9I/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2021-05-26 03:23:08'),
(2026, 2026, '2022-11-09 12:18:29', '2022-11-09 12:18:29', '5MxWt1Sea8Q', 'Creating a Spaceship in Blender: A Mini-Course', 'This mini-course is designed to show users how to create a hyper-detailed spaceship using Blender\'s microdisplacement and some greebles. You can create your own spacecraft with or without the suggested addons. There\'s a Table of Contents at the bottom of the Description.\n\nTo download the scene file, just join my Patreon for $1 and you will also receive a KPACK with the greebles and the the materials, as well as a SYNTH greeble recipe (use KIT OPS PRO or KIT OPS FREE).\nhttps://patreon.com/chippwalters\n\nProducts mentioned in this video:\n\nK-Cycles: https://blendermarket.com/products/k-cycles?ref=295\n\nShape Generator and Plating Generator: https://blendermarket.com/creators/mark-kingsnorth?ref=295\n\nKIT OPS SYNTH:\nhttps://blendermarket.com/products/kit-ops-synth\nhttps://gumroad.com/l/kitopssynth\n\nKIT OPS PRO:\nhttps://blendermarket.com/products/kit-ops-pro-asset--kitbashing-addon\nhttps://gumroad.com/l/kitopspro\n\nKIT OPS FREE:\nhttps://gumroad.com/l/kitops\nhttps://blendermarket.com/products/kit-ops-free\n\nDisplacement Guide: http://cw1.me/displacement\n\nJSplacement: https://windmillart.net/?p=jsplacement\n\nTABLE OF CONTENTS\n00:00 - Start\n01:40 - Introduction\n01:57 - K-Cycles\n02:31 - Preview Spaceship Construction\n03:00 - Displacement Explained\n04:00 - Displacement E-Guide\n04:46 - Shape and Plating Generators\n05:25 - JSplacement\n08:25 - Create the Spaceship shape\n09:58 - Scaling the Spaceship\n10:16 - Generate Plates on Spaceship\n11:30 - Bump Material\n14:03 - Displacement Material\n16:25 - Troubleshooting Microdisplacement\n16:48 - Adding Materials to the Spaceship\n17:41 - Apply modifiers\n17:56 - Using Materials with UV Maps\n18:57 - Setting up Displacement on Ship\n20:56 - Set faces for Greebles\n21:20 - Creating Corridor in SYNTH\n22:53 - Adding the Corridor with KIT OPS\n24:30 - Greeble Placement Faces\n25:15 - Creating Solar Dust Shield\n26:07 - Adding Bump Material\n27:23 - Use SYNTH to create Greebles\n29:43 - Displacement Viewport Tips\n30:25 - Adding Bevel to Ship Edges\n30:46 - Viewport considerations\n32:01 - Scene Setup', '00:00:00', '5MxWt1Sea8Q', 'video/youtube', 'https://i.ytimg.com/vi/5MxWt1Sea8Q/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2021-05-26 03:46:47'),
(2027, 2027, '2022-11-09 12:18:29', '2022-11-09 12:18:29', 'erhh-q1BTm8', 'Hard Surface Model A Spaceship No Add-Ons Required! Blender Tutorial', '#scifi #blender #blender3d #b3d #tutorial\nAmazing Assets & Training Material: https://gumroad.com/cbaileyfilm\nJoin Patreon: https://www.patreon.com/CBaileyFilm\nJoin YouTube: https://www.youtube.com/CBaileyFilm/join\nJoin Discord: https://discord.gg/UCNJmT5\n\nIn this exciting tutorial I take you through the basics of how to hard surface model a sci-fi drop-ship.  We create the base mesh and then build a few greebles to place across the surface using some cool techniques! \n\nblender 2.8\nblender 2.82\nblender 2.83\nblender 2.90\nblender 2.9\nblender 2.91\nblender guru donut\nhow to make a gfx', '00:00:00', 'erhh-q1BTm8', 'video/youtube', 'https://i.ytimg.com/vi/erhh-q1BTm8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2021-05-26 03:47:11'),
(2028, 2028, '2022-11-09 12:18:29', '2022-11-09 12:18:29', '89FEqJh8rV8', 'How to kitbash like a pro in Blender!', 'Kitbashing is a fun way to create complex things with little effort or modeling knowledge. Here are some great tips and methods to effectively using others assets to make cool stuff.\n\nThe assets: https://www.blendswap.com/blend/24058\n\nTons of free kitbash downloads: https://www.pinterest.com/search/pins/?rs=typed&q=Free%20kitbash', '00:00:00', '89FEqJh8rV8', 'video/youtube', 'https://i.ytimg.com/vi/89FEqJh8rV8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2021-05-26 04:14:33');
