(2029, 2029, '2022-11-09 12:18:29', '2022-11-09 12:18:29', 'At9qW8ivJ4Q', 'Blender Day 1 - Absolute Basics - Introduction Series for Beginners ( compatible with 3.3)', '#Tutorial #Blender #Beginner #3d #Basic #Introduction \nDownload project files\nhttps://crossmindstudio.gumroad.com/l/lZHjb\n\nhttps://www.patreon.com/CROSSMIND\n\nLinks to download Tutorial Files, Textures,  and Other Resources:\nhttps://www.crossmind.com/introduction-to-blender/\n\nIntro: (00:00)\nInterface to Blender Interface: (00:15)\nhow to Move/Rotate/Scale/Basic Commands of Blender 3D : (05:18)\nUnit Setup: (08:17)\nCreating Objects in Blender, 3D Cursor: (09:54)\nHow to  Nevigate viewport in Blender : (12:06)\nEditing Primitives: (15:09)\nObject Selections / Active Objects : (17:13)\n3D Cursor Menu: (19:40)\nGlobal/Local Coordinates: (20:00)\nTransform Pivot Point: (22:49)\nSnapping Options: (26:17)\nViewport Display Options : (30:51)\nPivot Point: (35:24)\n\nAssignment 1\nCreating a Basic Table in Blender: (39:23)\n\nAssignment 2\nCreating Building with Basic Primitives in Blender ( Lowpoly) : (46:41)\nRendering your scene : (1:09:28)\n\nConclusion: (1:20:59)\n\nAbout - \" introduction to Blender - For Absolute Beginners.\"\n\nThis tutorial series is more about an introduction to Blender and 3D in general. We will discuss the absolute basics of Blender and learn how to build objects, Understand Concepts of 3D Modeling, Lighting, Materials, Rendering, etc and prepare renders out of it. Then we apply all the knowledge we have learned from basic tutorials and create a very simple model of aircraft and then animate a scene with it. It\'s vital to apply all the learnings into some practical context to get a realistic sense of it. \n\nThe content of the tutorial is pretty simple in itself. None of the models are complicated. The focus here is to get comfortable in 3D for the first time. \n\nI have divided the tutorial into 7 days.\n\nDay 1.\nOn the first day we will discuss the absolute basics of Blender, and work our way around the interface, getting comfortable with the interface, creating basic objects, transformation tools, what is 3d cursor, origin, local and global axis, snapping options, etc. and make a very simple scene with just the basic primitives so that you get used to initial important commands and develop some muscle memory with Blender.\nLink - https://www.youtube.com/watch?v=At9qW8ivJ4Q&list=PLgO2ChD7acqH5S3fCO1GbAJC55NeVaCCp&index=3&t=0s\n\nDay 2\nOn the second day we will learn how to edit mesh objects, selection methods and we will create a few very basic objects and try to understand how to bring out different shapes in object editing mode.\nLink - https://www.youtube.com/channel/UCHihootMqyGz175gqOPahtw\n\nDay 3\nThir chapter will be about modifiers,  What are modifiers and vertex weights, and their use and discuss different use case scenarios. It also will create few objects in combination with multiple modifiers.\nLink - https://www.youtube.com/channel/UCHihootMqyGz175gqOPahtw\n\nDay 4\nOn Fourth Day  we will discuss the materials. How do the basic materials work and the meaning of terms used in shaders, How to mix shaders, set up basic PBR shader, textures, etc? We will also talk about UV a bit and will shade all the models we created in modifier chapters.\nLink : https://www.youtube.com/watch?v=qsXlL1WXEQA&list=PLgO2ChD7acqH5S3fCO1GbAJC55NeVaCCp&index=6&t=1665s\n\nDay 5 - will be about basic tools of lighting, what are the different categories of lights, and how they work, such as HDR Lighting, Making Lamp Objects, Emission Shaders etc. We will also discuss and make few light setups with different sources and render them out.\nLink: https://www.youtube.com/watch?v=3QqPY78cK1k&list=PLgO2ChD7acqH5S3fCO1GbAJC55NeVaCCp&index=7&t=1796s\n\nDay 6 \nThis is where everything will start making sense as we make a really fun looking animated aircraft model which will also be the part of an animated scene. In this chapter we will work with blueprints and make a 3d model, solve all the basics modeling related problems on a beginner level and use all the tools of object editing in a practical context. Then we will set up the final asset and shade it for a still render with Eevee.\nLink:https://www.youtube.com/channel/UCHihootMqyGz175gqOPahtw\n\nDay 7\nThe last chapter will be all about animation. We will begin with how to prepare a model for animation.\nTalk about the basic tools of animations in 3D and make a bouncing ball to understand how keyframes work. We will also discuss how to set up keys for different parameters and what are the possibilities of keying parameters available on object and modifier levels. We will also talk about curve editor, f curves, animation f-curve modifiers and lot more.\nLink: https://www.youtube.com/watch?v=ZnWsCD1Ir2s&list=PLgO2ChD7acqH5S3fCO1GbAJC55NeVaCCp&index=10&t=62s\n\n\n\nSYSTEM CONFIGURATION:\nWindows 10 \nDual Xeon silver 4114 2.2 GHz ( 2 processors  20 cores)\nQuadro P 4000 GPU - 8GB\n64 GB 2400 Mhz DDR 4\nSSD NVME \n\nMy Renderro Cloud Workstation\nCPU- 8x2.5 Ghz\nGPU - Nvidia T4 16GB\nRam 32 GB\n\nhttps://www.instagram.com/instacrossmind/\nhttps://vimeo.com/instacrossmind\nhttps://gumroad.com/crossmindstudio\nhttp://www.crossmind.com/', '00:00:00', 'At9qW8ivJ4Q', 'video/youtube', 'https://i.ytimg.com/vi/At9qW8ivJ4Q/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCUQDEkBffzA7X-J3UkrZLpA', '2021-06-12 09:30:37'),
