(2106, 2106, '2022-11-11 20:47:59', '2022-11-11 20:47:59', '4ugMYpzLA0c', 'Filament: with Dan Harrin and Ryan Chandler', 'In this stream I will be joined by Dan Harrin and Ryan Chandler, the maintainers of Filament, as we dive into how we can use filament to build awesome admin panels and forms in the TALL stack.\n\nFollow Dan on twitter: https://twitter.com/danjharrin\nFollow Ryan on twitter: https://twitter.com/ryangjchandler\nSubscribe to Dans YouTube Channel: https://www.youtube.com/channel/UCXpwqLsgBnot6Qz9swdlbZA\nSubscribe to Ryans YouTube Channel: youtube.com/channel/UCK6-JHDgbdeXbnTwc2Lj98g\n\nIf you want to stay up to date with my latest streams, or ask questions about anything I do on my streams, or on some of my packages - feel free to join my discord server where I am available most of the time to answer any questions or give advise. Also, there are some awesome members of the community already on my server who are always helpful. https://discord.gg/jkbfSufNTq\n\nTo stay tuned to any of this content feel free to subscribe where you can get notified of new planned streams when they get scheduled. Also if you like any of my content, please like and drop a comment so I can make sure people are enjoying what I create - and can adapt to feedback', '00:00:00', '4ugMYpzLA0c', 'video/youtube', 'https://i.ytimg.com/vi/4ugMYpzLA0c/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCICFCxDx2-wGH41B8bGerrw', '2022-06-07 08:12:16'),
(2107, 2107, '2022-11-11 20:47:59', '2022-11-11 20:47:59', 'xs0uYMaX5oI', 'Multi-Step Form Wizards with Laravel and Livewire - Filament TALL Stack Form Builder', 'This video, we are using the filament/forms package. You can read the full documentation at: https://filamentphp.com/docs/forms\n\nYou can find out more about Filament on our website: https://filamentphp.com\n\nFollow me on Twitter for more tutorials and other TALL stack tips: https://twitter.com/danjharrin\n\nIf you found this video useful, please consider sponsoring me on GitHub to ensure that I can continue to dedicate time to working on them: https://github.com/sponsors/danharrin', '00:00:00', 'xs0uYMaX5oI', 'video/youtube', 'https://i.ytimg.com/vi/xs0uYMaX5oI/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCICFCxDx2-wGH41B8bGerrw', '2022-06-07 08:12:24'),
(2108, 2108, '2022-11-11 20:47:59', '2022-11-11 20:47:59', 'JAHYfq07uiU', 'Filament Admin: Simple TALL CRUD in Minutes [REVIEW]', 'Today we\'re looking at a package that gained a lot of popularity in Laravel community in recent months: Filament Admin. How does it work? Let me show you.\n\nLink: https://filamentadmin.com\nOur alternative: https://quickadminpanel.com \n\n- - - - -\nSupport the channel by checking out our products:\n- Enroll in my Laravel courses: https://laraveldaily.teachable.com\n- Try our Laravel QuickAdminPanel: https://bit.ly/quickadminpanel\n- Purchase my Livewire Kit: https://livewirekit.com\n- View Laravel Code Examples: https://laravelexamples.com\n- Subscribe to my weekly newsletter: http://bit.ly/laravel-newsletter', '00:00:00', 'JAHYfq07uiU', 'video/youtube', 'https://i.ytimg.com/vi/JAHYfq07uiU/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCICFCxDx2-wGH41B8bGerrw', '2022-06-07 08:12:35'),
(2109, 2109, '2022-11-11 20:47:59', '2022-11-11 20:47:59', 'V6Np8ek6whA', 'PHP Online - Introducing LiveWire and Filament', 'In this stream we are going to focus on how we can add LIveWire and Filament to the PHPOnline project, to make this a snappy experience - but also make the development a lot easier.\n\nIf you want to stay up to date with my latest streams, or ask questions about anything I do on my streams, or on some of my packages - feel free to join my discord server where I am available most of the time to answer any questions or give advise. Also, there are some awesome members of the community already on my server who are always helpful. https://discord.gg/jkbfSufNTq\n\nTo stay tuned to any of this content feel free to subscribe where you can get notified of new planned streams when they get scheduled. Also if you like any of my content, please like and drop a comment so I can make sure people are enjoying what I create - and can adapt to feedback', '00:00:00', 'V6Np8ek6whA', 'video/youtube', 'https://i.ytimg.com/vi/V6Np8ek6whA/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCICFCxDx2-wGH41B8bGerrw', '2022-06-07 08:12:56'),
(2110, 2110, '2022-11-11 20:47:59', '2022-11-11 20:47:59', 'In8SiXqMwh0', 'Filament Laravel TALL Admin Panel Package | Laravel 9 Tutorial', 'This video will show you how to install and work with the Filament TALL admin panel on Laravel.\nLaravel Admin panel.\nLaravel Packages.\nLaravel 9 tutorial.\n\nSupport me: \nhttps://www.patreon.com/Laraveller\nhttps://paypal.me/TonyXhepa\n\nFollow me:\nTwitter: https://twitter.com/Laravellercom\nFacebook Page: https://www.facebook.com/1laravellercom\nInstagram: https://www.instagram.com/laravellercom/\nGithub: https://github.com/laraveller\nWebsite: https://laraveller.com/\nBlog: https://blog.laraveller.com/\n\nSetup VS CODE for Laravel: https://youtu.be/EliywWn4IK4\nSetup Mac for development: https://youtu.be/yxuR5myrVi4\n\nPlaylists:\nLaravel Mail Tutorial - https://bit.ly/37mJUNh \nLaravel Restaurant Reservation - https://bit.ly/3Jc5IcG\nSpatie Laravel Permission - https://bit.ly/3pOsOhN\nLaravel Testing For Beginners - https://bit.ly/3t1gNq4\nLaravel Roles and Permissions - https://bit.ly/3gOhM7d\nLARAVEL INERTIA MOVIE APP - https://bit.ly/3FVMp4Q\nLaravel Livewire Movie App - https://bit.ly/3s8D6v1\nLaravel Classified Website - https://bit.ly/3nsFRnb\nLivewire Employees - https://bit.ly/2ZtIpZY\nLaravel Employees Management - https://bit.ly/3Gglt14\nLaravel admin panel - https://bit.ly/3CcX75M\n#laravel #laraveller', '00:00:00', 'In8SiXqMwh0', 'video/youtube', 'https://i.ytimg.com/vi/In8SiXqMwh0/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCICFCxDx2-wGH41B8bGerrw', '2022-06-07 08:13:11'),
(2111, 2111, '2022-11-11 20:47:59', '2022-11-11 20:47:59', 'Sr15MWxNfrA', 'Building an Uptime Checker with Filament - Laravel Livestream', 'Let\'s build an uptime checker with Filament!\n\nRepository: https://github.com/ryangjchandler/uptime-checker', '00:00:00', 'Sr15MWxNfrA', 'video/youtube', 'https://i.ytimg.com/vi/Sr15MWxNfrA/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCICFCxDx2-wGH41B8bGerrw', '2022-06-07 08:13:25'),
(2112, 2112, '2022-11-11 20:47:59', '2022-11-11 20:47:59', 'Sx5TQdUUA_4', 'Creating a landlord application to manage our tenants (with Laravel and Filament Admin)', 'Part 2 of the Laravel Multi-tenancy\n\nToday I\'m creating a landlord application to manage all of my tenants. I\'m using Filament PHP to create an Admin interface. I\'ll setup all associated resources and actions in Filament. Watch and come along for the ride as we build the multi-tenant landlord application.\n\n00:00 - Intro\n00:25 - What we are building\n00:58 - Getting started with Filament\n02:01 - Filament is up an running\n02:43 - Using Filament Resources to manage the Tenant model\n03:03 - Creating our first Resource\n04:49 - Adding table fields to Index views\n07:41 - Creating a new Tenant via our manager app\n08:28 - Associating domains to the Tenant\n09:52 - Testing our action\n11:46 - Adding relationship resources for HasMany relationships\n13:48 - Wrapping up\n\nWatch Part 1: https://www.youtube.com/watch?v=BitZhTeLgR4&t=2s\n\n#laravel #multitenancy #tenancy #filamentphp', '00:00:00', 'Sx5TQdUUA_4', 'video/youtube', 'https://i.ytimg.com/vi/Sx5TQdUUA_4/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCICFCxDx2-wGH41B8bGerrw', '2022-06-07 08:13:31'),
(2113, 2113, '2022-11-11 20:47:59', '2022-11-11 20:47:59', 'U0cSEc6MdGg', 'Working on Filament - Create Modal for Select Fields (Livestream)', 'Join Dan and I as we work on a new feature for Filament.\n\nNote: we had some technical issues for the first 10 minutes and my ISP decided to cut my upload bandwidth at the end, so the stream has quite an abrupt start and finish. Apologies!\n\nFilament: https://filamentphp.com\nDan: https://twitter.com/danjharrin\nTwitter: https://twitter.com/ryangjchandler', '00:00:00', 'U0cSEc6MdGg', 'video/youtube', 'https://i.ytimg.com/vi/U0cSEc6MdGg/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCICFCxDx2-wGH41B8bGerrw', '2022-06-07 08:16:12'),
(2114, 2114, '2022-11-11 20:47:59', '2022-11-11 20:47:59', 'aWQMC3ie3iQ', '1. Laravel Filament : install filament on new laravel project', 'Playlist : https://www.youtube.com/playlist?list=PL0NWDbuE0eQ35X88Fa_I_7tgCZE0JK-UM\n\nFilament is a collection of tools for rapidly building beautiful TALL stack apps, designed for humans.\n\nFilament Documentation : https://filamentphp.com\n\n\nSocial Links : \nTwitter : https://twitter.com/alpondith\nLinkedin : https://www.linkedin.com/in/alpondith', '00:00:00', 'aWQMC3ie3iQ', 'video/youtube', 'https://i.ytimg.com/vi/aWQMC3ie3iQ/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCICFCxDx2-wGH41B8bGerrw', '2022-06-07 08:18:18'),
