(2243, 2243, '2022-11-11 23:00:29', '2022-11-11 23:00:29', 'Pi_K6B7MxeM', 'Create a PHP Admin Backend with Laravel & Filament', 'Learn how to create a PHP Admin Backend with Laravel & Filament. Create a PHP / Laravel Driven Backend for Your Business App using PHP framework Laravel and the Filament plugin\nHow to Optimize Laravel Performance with Octane\n‚òû https://morioh.com/p/75f3e6350029\nBuild a CMS with Laravel and Vue\n‚òû https://morioh.com/p/715b2bc28221\nBuilding a Vue SPA With Laravel\n‚òû https://morioh.com/p/395957ddc46b\n\nCreate AMAZING Admin Backend for PHP apps very fast and easy\n\nIn this course, we will tackle a challenge that you will encounter in almost every major PHP project:\n\n    How do I get a beautiful and functional backend where I can enter the data for the app?\n\n    Using the PHP framework Laravel and the Filament plugin, we will tackle the problem in this course.\n\nCONTENTS OF THE COURSE\n\n    Installation of Laravel, Jetstream, and Filament: \n    With this you basically create an app structure consisting of frontend, user area, and backend.\n\n    Creating a filament resource\n\n    With this you can create a table overview of your data and input masks for entering or editing your data in just a few minutes. Of course, we pay attention to optimal usability. The cool thing is, that in this overview page you implement features like sortable columns, searchable columns, filters, and much more, very easily and fast.\n\n    Everything works in real-time with Laravel Livewire (= Ajax)\n\n    Management and automatic conversion of images\n\n    With the famous media plugin from the Belgian package maker Spatie, you can manage uploaded files innovatively and bring images into the right format.\n\n    Breakdown of HTML templates into layouts and components\n\n    With Laravel\'s blade engine, everything remains clear and you can get the data from the database to the frontend exactly where it is needed.\n\n    Complicated database queries made easy with Eloquent\n\n    Get data from linked tables (relationships) without SQL headaches. Even sub-queries are automatically created by Laravel, and all this is performance-optimized.\n\nLearn basic Laravel features playfully:\n\n        Models\n\n        Accessors / Mutators\n\n        Seeders\n\n        Fakers\n\n        Soft-Deletes\n\n        Stubs\n\n        Blade\n\n        Configuration settings\n\n\nFurthermore, you will have learned how to define and use constants in Laravel.\n\nWhat you‚Äôll learn\n\n        Create a PHP / Laravel9 driven Backend for your Business application\n        Learn how to use the fantastic Spatie Media Library Plugin\n        Learn to use the powerful Laravel Eloquent Database engine, that makes even subqueries a breeze\n        Create a real Real Estate project\n\nAre there any course requirements or prerequisites?\n\n        Beginner to Intermediate PHP knowledge\n\nWho this course is for:\n\n        PHP developers who want to create apps faster and much better\n        IT Graduates who seek a carrier in an interesting an well paid field of work (Laravel development)\n\n#Laravel #PHP #Morioh\n\nNote: If you have any copyright issue with the content used in our channel or you find something that belongs to you, before you claim it to Youtube, SEND US A MESSAGE and the respective content will be DELETED right away. Thanks for understanding.\n\n‚óºÔ∏è‚óºÔ∏è‚óºÔ∏è‚óºÔ∏è‚óºÔ∏è‚óºÔ∏è‚óºÔ∏è‚óºÔ∏è‚óºÔ∏è‚óºÔ∏è‚óºÔ∏è‚óºÔ∏è‚óºÔ∏è‚óºÔ∏è\nüëï Merchandise: https://www.moteefe.com/store/developer?cp=WP6JDT\nüåé Social Network for Developers: https://morioh.com/', '00:00:00', 'Pi_K6B7MxeM', 'video/youtube', 'https://i.ytimg.com/vi/Pi_K6B7MxeM/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-11 10:49:00'),
