(2299, 2299, '2022-11-12 14:16:28', '2022-11-12 14:16:28', 'Wu-qQzbJmuI', 'BAGAGEIRO KOMBI HOME artesanal / CONSTRU√á√ÉO DA KOMBRASA ep. 18 (pt 2) #64', 'Nosso BAGAGEIRO artesanal da kombi home finalmente ficou pronto, depois de muito trabalho duro finalizamos. S√≥ faltou o deckzinho de madeira, que vai ficar para o pr√≥ximo v√≠deo da constru√ß√£o da KOMBRASA.\nGastamos cerca de R$700 reais para fazer, os acess√≥rios a maquina de solda e tudo mais usamos do nosso parceiro Ribamar.\nRibamar e Sheila sua esposa foram 2 anjos que Deus colocou na nossa frente no Cavalo Queimado em Tocantins, coincidentemente eles eram da mesma cidade que a nossa Urua√ßu-GO, l√° mesmo fizemos amizade.\nAcabou que continuamos conversando e aqui em Urua√ßu, onde estamos parados ele nos ofereceu sua ajuda para nos ajudar na CONSTRU√á√ÉO DA KOMBRASA, a Kombi Home feita artesanalmente do zero.\nNosso eterno agradecimento ao RIBAMAR e a SHEILA\n\nOBS: VAMOS PASSAR AS MEDIDAS E OS MATERIAS USADOS, JUNTO DE COMO FIZEMOS AS PRESILHAS PARA FAZER A FIXA√á√ÉO DO BAGAGEIRO, NO V√çDEO DO DECK DA KOMBI.\n\nRibamar o CADEIRANTE AVENTUREIRO\nhttps://www.youtube.com/channel/UC5vBTFGxvDODfz6ytc3Gr3A\n\nBAGAGEIRO ARTESANAL PARTE 1 https://www.youtube.com/watch?v=J2iRHx-Yw4c&t=2s\n\nCONTATO DA IN√äS (BOLOS DA IN√äS) O MELHOR PUDIM DO BRASIL\nhttps://www.instagram.com/inesmovio/\n\nSOBRE N√ìS\nSomos um casal de doidinhos que viu o NORMAL PERDER SENTIDO e tudo que quer√≠amos era VIVER. Sent√≠amos a necessidade de LIBERDADE, de fazer o que quer√≠amos e mais importante ainda n√£o fazer o que n√£o quer√≠amos. Ent√£o pegamos a √∫nica coisa que t√≠nhamos (UM GOL QUADRADO ANO 93) e ca√≠mos na estrada, rumo a LIBERDADE. Hoje estamos construindo nossa KOMBI HOME em busca de uma maior autonomia para nosso estilo de vida n√¥made, e ainda temos uma filha, a Lua, nossa cachorrinha. VEM COM NOIS QUE √â S√ì O COME√áO...\n\nQuer FACILITAR nossa JORNADA?\nDoe QUALQUER VALOR e nos incentive a produzir cada vez melhores conte√∫