(2470, 2470, '2022-11-14 17:24:19', '2022-11-14 17:24:19', 'GJYwiWI1AWw', 'How to use Spreadsheet in Python with Mito', 'Wouldn\'t it be great to have a Spreadsheet functionality in a Jupyter notebook? Mito generates Python code that corresponds to the edits made in the spreadsheet (via the point and click). In this video, I have the pleasure of inviting Nate from the Mito Team to give a demo of Mito in action. The demo will be using a hypothetical website visit dataset for analyzing user behavior.\n\nHere are some of the topics covered in this video:\n- Merge data frames\n- Perform commonly used spreadsheet functions\n- Filtering data\n- Pivoting data\n- Save Analysis for reuse in the future\n\n‚≠ï Links for this video:\n‚úÖ Book an appointment for getting priority access to Mito https://calendly.com/trymito/mito-early-access-demo?utm_campaign=summer&utm_source=dataprofdemo\n‚úÖ Mito http://trymito.io/?source=dataprofdemo\n\n\n\nüåü Subscribe to this YouTube channel https://www.youtube.com/dataprofessor?sub_confirmation=1\nüåü Join the Newsletter of Data Professor http://sendfox.com/dataprofessor\nüåü Buy me a coffee https://www.buymeacoffee.com/dataprofessor\nüåü Download Kite for FREE https://www.kite.com/get-kite/?utm_medium=referral&utm_source=youtube&utm_campaign=dataprofessor&utm_content=description-only\n\n‚≠ï Playlist:\nCheck out our other videos in the following playlists.\n‚úÖ Data Science 101: https://bit.ly/dataprofessor-ds101\n‚úÖ Data Science YouTuber Podcast: https://bit.ly/datascience-youtuber-podcast\n‚úÖ Data Science Virtual Internship: https://bit.ly/dataprofessor-internship\n‚úÖ Bioinformatics: http://bit.ly/dataprofessor-bioinformatics\n‚úÖ Data Science Toolbox: https://bit.ly/dataprofessor-datasciencetoolbox\n‚úÖ Streamlit (Web App in Python): https://bit.ly/dataprofessor-streamlit\n‚úÖ Shiny (Web App in R): https://bit.ly/dataprofessor-shiny\n‚úÖ Google Colab Tips and Tricks: https://bit.ly/dataprofessor-google-colab\n‚úÖ Pandas Tips and 