(2471, 2471, '2022-11-14 17:24:19', '2022-11-14 17:24:19', 'kzB9QLYdnC0', 'Talking with Founders / Developers of MITO Python Library | Data Science Podcast', 'Ever wanted to leverage your spreadsheet skills in Python? Now you can with Mito, the Python library that enables the use of a Spreadsheet directly in Jupyter. In this video, I sit down for a talk with the founders and developers of Mito (Jacob Diamond-Reivich, Aaron Diamond-Reivich and Nate Rush) where we discuss several interesting topics including among others what is Mito, use cases of Mito, the future of spreadsheets and more.\n\n‚úÖ Sign up to try Mito https://calendly.com/jacobdi/mito-early-access?utm_campaign=summer&utm_source=dataprofvideo1\n‚úÖ Mito http://trymito.io/?source=dataprofvideo1\n\nüåü Buy me a coffee: https://www.buymeacoffee.com/dataprofessor\nüåü Check out Kite (FREE AI-powered coding assistant) https://www.kite.com/get-kite/?utm_medium=referral&utm_source=youtube&utm_campaign=dataprofessor&utm_content=description-only\n\n‚≠ï Timeline\n0:00 Introduction\n1:33 What is Mito?  How did you come up with the idea for Mito?\n3:28 How to get access to Mito?\n4:45 How many are using Mito?\n5:27 Mito is currently in closed Alpha  \n5:54 Learning from users\n7:10 Mito for learning Python\n8:54 Use cases of Mito\n9:42 How Mito differ from related tools (PandasGUI)\n11:16 Use case for learning\n11:49 Use case for reproducibility\n15:19 Use case for auditability (peer review)\n17:11 Custom function in Mito\n19:38 Future directions of Mito\n22:33 Integration with Streamlit?\n23:38 Mito Startup Story\n25:34 Future of spreadsheets\n30:18 Support for DataFrames (Pandas, NVIDIA RAPIDS cuDF and Dask)\n32:20 Integration with BlazingSQL?\n34:49 How do you go from idea to implementation?\n36:36 What features are users requesting for?\n40:23 How did you come up with the name Mito?\n41:32 Conclusion\n41:58 Final remarks from the Mito team\n\n‚≠ï Playlist:\nCheck out our other videos in the following playlists