(2481, 2481, '2022-11-14 17:24:58', '2022-11-14 17:24:58', 'XAGmSPZsYLU', 'Do Excel things, get notebook Python code with Mito - Talk Python Episode #343', 'Here\'s a question: What\'s the most common way to explore data? Would you say pandas and matplotlib? Maybe you went more general and said Jupyter notebooks. How about Excel, or Google Sheets, or Numbers, or some other spreadsheet app? Yeah, my bet is on Excel. And while it has many drawbacks, it makes exploring tabular data very accessible to many people, most of whom aren\'t even developers or data scientists.\n\nOn this episode, we\'re talking about a tool called Mito. This is an add-in for Jupyter notebooks that injects an Excel-like interface into the notebook. You pass it data via a pandas dataframe (or some other source) and then you can explore it as if you\'re using Excel. The cool thing is though, just below that, it\'s writing the pandas code you\'d need to do to actually accomplish that outcome in code.\n\nI think this will make pandas and Python data exploration way more accessible to many more people. So if you\'ve been intimidated by pandas, or know someone who has, this could be what you\'ve been looking for. \n\nCheck out the full episode page at https://talkpython.fm/episodes/show/343/do-excel-things-get-notebook-python-code-with-mito', '00:00:00', 'XAGmSPZsYLU', 'video/youtube', 'https://i.ytimg.com/vi/XAGmSPZsYLU/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-14 05:19:30'),
