(2486, 2486, '2022-11-14 17:24:58', '2022-11-14 17:24:58', 'bHE5bfRxmAM', 'Making Python Projects Easier with Mito', 'Mito is a spreadsheet front-end for Pandas. You can call Mito into your jupyter environment, \nand every edit you make in the spreadsheet will generate the equivalent Python for you. \nThis saves you from constantly going to google and stack-overflow to look up syntax. \n\nMito Website: http://trymito.io/DSL\n\nMito Features: https://docs.trymito.io\n\nMito Download Instructions: https://docs.trymito.io/getting-started/installing-mito\n\nFor Mito Support: jake@sagacollab.com\n\n--------------------------------------------------\nDownload Dataset File - https://drive.google.com/file/d/1CIyauF8wQSq2dI_EctpAmp09O2Mvq79A/view?usp=sharing\n--------------------------------------------------\nGet - Data Analyst Self Study Material ( Rs.450 )  - https://rzp.io/l/dslstudymaterial\n.......................................................................\nGet - Python Pandas Notes ( Rs.99 ) - https://rzp.io/l/pandas-notes \n.......................................................................\n\"Data Analyst Study Material\" includes -\n* All the Projects Source Codes\n* Notes of the complete Data Analytics course, which contain all commands of Core Python, Numpy, Pandas, Matplotlib, SQL that we use for Big-Data Analytics.\n.......................................................................\nContact Mail Id : datasciencelovers@gmail.com\n.......................................................................\n\n#python  #dataanalytics  #datascience', '00:00:00', 'bHE5bfRxmAM', 'video/youtube', 'https://i.ytimg.com/vi/bHE5bfRxmAM/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-14 05:20:25'),
(2487, 2487, '2022-11-14 17:24:58', '2022-11-14 17:24:58', '0n5SD1RpFD8', 'Data Analysis in Python for Excel Users (ft. Mito)', 'If you\'ve ever edited a spreadsheet and wondered what the equivalent Python code would be, this video is for you! Mito is a Jupyterlab extension that allows you to quickly and easily generate Pandas data analysis scripts using the Excel functions you already know. \n\nShoutout to Mito for sponsoring this video! \nMito Installation Instructions: https://docs.trymito.io/getting-started/installing-mito\nLearn more: https://trymito.io/DID\n\nVideo Breakdown: \nIntro: 0:00-1:49\nInstalling Mito: 1:49-2:07\nImporting data: 2:07-2:55\nMerging data: 2:55-3:58\nPandas code being generated and why it\'s useful: 3:58-5:01\nFiltering and sorting data: 5:01-6:13\nAutomatic summary stats and graphing: 6:13-6:37\nPivot tables: 6:37-7:07\nIncorporating Excel functions: 7:07-7:56\nConclusion: 7:56-8:41\n\n\n#dataanalysis #excel #python #datascience #jupyterlab #pandas', '00:00:00', '0n5SD1RpFD8', 'video/youtube', 'https://i.ytimg.com/vi/0n5SD1RpFD8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-14 05:20:32'),
