(2495, 2495, '2022-11-14 17:24:58', '2022-11-14 17:24:58', 'A8kx3rqjgsU', 'Mito Tutorial Ep. 1 - Create a Mitosheet', 'In this video, we have Jake (co-founder of Mito) to show us how you can create your first Mitosheet.\n\nüåü Download Kite for FREE https://www.kite.com/get-kite/?utm_medium=referral&utm_source=youtube&utm_campaign=dataprofessor&utm_content=description-only\n\n‚≠ï Step-by-step instructions\n1. Before rendering a Mitosheet, make sure you\'ve installed Mito correctly (see https://docs.trymito.io/getting-started/installing-mito). Please note that Mito currently only works in JuypterLab 2.0. See this video how to create a JupyterLab notebook, you can watch this video https://www.youtube.com/watch?v=QL0IxDAOEc0\n2. Once you\'ve created a notebook, copy and paste the code below into a Jupyter code cell:\nimport mitosheet\nmitosheet.sheet()\n3. Then run the Mitosheet generating code by clicking on the code cell that contains it and pressing Shift + Enter. \n\nNote: If a Mitosheet does not appear, make sure that you followed the Installation Instructions. Not downloading  the Jupyter Lab extension manager is a common mistake. \n\nSource: https://docs.trymito.io/how-to/creating-a-mitosheet\n\n‚≠ï Support my work:\nüåü Subscribe to this channel (Coding Professor) https://www.youtube.com/channel/UCJzlfIoF8nmWqJIv_iWQVRw?sub_confirmation=1\nüåü Subscribe to my other channel Data Professor https://www.youtube.com/dataprofessor?sub_confirmation=1\nüåü Join the Newsletter of Data Professor http://newsletter.dataprofessor.org\nüåü Buy me a coffee https://www.buymeacoffee.com/dataprofessor\n\n‚≠ï Recommended Books: \nüåühttps://kit.co/dataprofessor\n‚úÖ Python Basics: A Practical Introduction to Python 3 https://amzn.to/3awdWgm\n‚úÖ Learn Python Programming (The no-nonsense, beginner\'s guide) https://amzn.to/2RFpSpn\n‚úÖ Learn to Program with Minecraft https://amzn.to/3x2MujZ\n‚úÖ Automate the Boring Stuff with Python, 2nd Edition: Practical Programming for Total Beginners https://amzn.to/2QzkyDs\n\n‚≠ï Disclaimer:\nRecommended books and tools are affiliate links that gives me a portion of sales at no cost to you, which will contribute to the improvement of this channel\'s contents.\n\n‚≠ï Stock photos, graphics and videos used on this channel: \n‚úÖ Video intro made using Placeit https://1.envato.market/c/2346717/628379/4662\n\n#python #mito #trymito #codingprofessor', '00:00:00', 'A8kx3rqjgsU', 'video/youtube', 'https://i.ytimg.com/vi/A8kx3rqjgsU/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-14 05:21:58'),
(2496, 2496, '2022-11-14 17:24:58', '2022-11-14 17:24:58', 'BYZi27PeT8o', 'Stop Using Excel. Here\'s a better tool for Data Analysis!', 'In this video, we\'ll see an alternative to Microsoft Excel using a Python library called Mito. This library allows us to do data analysis in Python without writing code.\n\nMito install instructions: https://docs.trymito.io/getting-started/installing-mito\nMito Github: https://github.com/mito-ds/monorepo\nMito Website: https://www.trymito.io/\n\nüî• Join My Automation Course in Python: https://www.udemy.com/course/automate-your-life-with-python/?referralCode=7FA8B361D7A92B03A8C3\nüî• Join My Python for Data Science Bootcamp: https://www.udemy.com/course/python-for-data-science-bootcamp-2022-from-zero-to-hero/?referralCode=649B94757CB7A3A4756F\nüî• 8-hour Web Scraping Course in Python: https://www.udemy.com/course/web-scraping-course-in-python-bs4-selenium-and-scrapy/?referralCode=291C4D7FF6F683531933\n‚úÖ  Follow me on Medium: https://frank-andrade.medium.com/', '00:00:00', 'BYZi27PeT8o', 'video/youtube', 'https://i.ytimg.com/vi/BYZi27PeT8o/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-14 05:22:10');
