(2497, 2497, '2022-11-14 17:24:58', '2022-11-14 17:24:58', 'A0IxLGi5xC0', 'Auto Generating Python code by editing Spreadsheet using Mito', '#python #spreadsheet #mito\nMito is a Python Package that lets you generate Python code in a much faster way. Mito allows you to call a spreadsheet front-end into your Python environment. Every edit you make in the front-end, Mito generates the equivalent Python code in the cell below.  In Mito, you can merge datasets, create graphs and charts, make pivot tables, use formulas, look at summary statistics, fill null values and much more! Each edit will generate the Python for you, so you do not need to go to Stack Overflow or Google.\n\nInstalling Mito: https://docs.trymito.io/getting-started/installing-mito\nMito website: https://www.trymito.io/\n\n‚è© OUTLINE:\n0:00 - About MITO\n00:38 - MITO Demo from Jake\n06:28 - Wrap-up\n\n*********************************************\n‚è© Youtube - https://www.youtube.com/c/TechVizTheDataScienceGuy\n‚è© LinkedIn - https://linkedin.com/in/prakhar21\n‚è© Medium - https://medium.com/@prakhar.mishra\n‚è© GitHub - https://github.com/prakhar21\n‚è© Twitter - https://twitter.com/rattller\n*********************************************\n\nTools I use for making videos :)\n‚è© iPad - https://tinyurl.com/y39p6pwc\n‚è© Apple Pencil - https://tinyurl.com/y5rk8txn\n‚è© GoodNotes - https://tinyurl.com/y627cfsa\n\n#machinelearning #pandas #codegeneration #techvizdatascience\nAbout Me:\nI am Prakhar Mishra and this channel is my passion project. I am currently pursuing my MS (by research) in Data Science. I have an industry work-ex of 3 years in the field of Data Science and Machine Learning with a particular focus on Natural Language Processing (NLP).', '00:00:00', 'A0IxLGi5xC0', 'video/youtube', 'https://i.ytimg.com/vi/A0IxLGi5xC0/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-14 05:22:17'),
(2498, 2498, '2022-11-14 17:24:58', '2022-11-14 17:24:58', 'bnkfVS-X_oU', 'How to use Spreadsheet in Python with Mito | Experience Data analysis in python with No code', 'How to use Spreadsheet in Python with Mito | Experience Data analysis in python with No code\n\nWouldn\'t it be great to have a Spreadsheet functionality in a Jupyter notebook? Mito generates Python code that corresponds to the edits made in the spreadsheet', '00:00:00', 'bnkfVS-X_oU', 'video/youtube', 'https://i.ytimg.com/vi/bnkfVS-X_oU/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-11-14 05:22:41');
